INSERT INTO `notes` VALUES (1,NULL,'possibility = 50 には確認＋推定ではなく、推定鉱量が入っている。'),(2,'2006-02-17 11:30:08','TABLE reserve と tmp_prod の fluid_id = 2, 4 (ガス)に単位の変更あり。1e3 で除したものを入力。'),(3,'2006-12-22 09:51:19','CONSTRAINT `tmp_prod_ibfk_1` FOREIGN KEY (`reservoir_id`) REFERENCES `reservoir` (`reservoir_id`) ON UPDATE CASCADE'),(4,'2007-02-26 15:55:24','TABLE tmp_prod where reservoir_id = 83 (3200m of 東新潟) and fluid_id = 2 were updated to 0.0 (from 75.30) because P90 was evaluted to be 0.0.'),(5,'2007-07-19 11:53:34','「前年踏襲」のデータを作るには STORED PROCEDURE fill_empty_reserves, fill_empty_tmp_prods を実行する。それぞれ duplicate_reserves_to_next_year, duplicate_tmp_prods_to_next_year を呼び出している。'),(7,'2007-07-23 13:56:05','smap_well_no で、例えば、\\\\1 のように先頭にバックスラッシュが２つ続くものは 0x1a, 1 の2バイトの文字列になってしまう。関数 ascii() を使えば先頭文字が 0x1a になっているのがわかる。原因は不明。'),(8,'2007-11-22 16:13:01','片貝G層群を一括評価に => reservoir_id = 144。旧reservoir_id は completion_id = 479, 480, 481 が 100、completion_id = 482, 483, 484 が 101、completion_id = 484, 485, 486, 487, 488 が 102、completion_id = 490 が 103。'),(9,'2009-01-20 14:28:41','note_id = 1 の「確認」は紛らわしい。正確には「確認総可採」。「確認鉱量」（以前は単に「可採鉱量」といっていた）は「確認総可採」から「累計生産量」を減じたもの'),(10,'2009-01-22 13:53:38','Deleted records from TABLE direct_input_prod for completion_id = 542 and 543 (Higashi-Niigata MS-30 (YCA, YCB)) and date_prod = 2007-12-31.  All the cum_prod\'s were same as 2006-12-31'),(11,'2009-08-25 11:59:23','岩船沖SIM-B9, および南MS-1(2900m層)の圧入量を正味圧入量とするために、岩船沖SIM-B2,B3,B4,B6,B8の再生産量は2900m層所属としている。'),(12,'2009-01-14 16:25:00','中鮎川地区の油ガス田コードは、2008年06月以降、3805 から 3800 に変更になった（3800 は元々鮎川油ガス田主要部?のコードとして存在している）。');
/*!40000 ALTER TABLE `notes` ENABLE KEYS */;
UNLOCK TABLES;

