DROP TABLE IF EXISTS `reserve_commentary`;
SET @saved_cs_client     = @@character_set_client;
SET character_set_client = utf8;
CREATE TABLE `reserve_commentary` (
  `commentary_id` int(10) unsigned NOT NULL auto_increment,
