  `date_commentary` date NOT NULL default '0000-00-00' COMMENT '解説の日付',
  `possibility` int(10) unsigned NOT NULL default '0',
  `status` varchar(40) default '' COMMENT '「従来通り」、「鉱量見直し」など',
  `datetime_input` datetime default NULL COMMENT '入力日時',
  `commentary` text NOT NULL COMMENT '解説',
  PRIMARY KEY  (`commentary_id`),
  UNIQUE KEY `reservoir_id` (`reservoir_id`,`date_commentary`,`possibility`),
  CONSTRAINT `reserve_commentary_ibfk_2` FOREIGN KEY (`reservoir_id`) REFERENCES `reservoir` (`reservoir_id`) ON UPDATE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=764 DEFAULT CHARSET=utf8 COMMENT='埋蔵量評価の解説';
