INSERT INTO `reserve_commentary` VALUES (3,5,'2003-12-31',90,'採収終了','2006-01-20 10:24:15','採収終了'),(8,10,'2003-12-31',90,'採収終了','2006-01-20 10:40:38','廃坑済み'),(15,17,'2003-12-31',90,'従来通り','2006-01-20 11:10:50','全坑井廃層済み。採収終了。'),(17,19,'2003-12-31',90,'従来通り','2006-01-20 13:14:45','SK-21は前回の減退曲線法による評価を累計生産量が上回ったため、減退曲線の見直しを行った。\r\nSK-22は安定的に連続採収できないため、実績値の計上となっている。適切な措置をとれば自噴回復は十分期待できるが、現状では諸々の制限から、対策は行われていない。\r\nSK-23は順調に生産を続けているが、見直しに足るデータ量は蓄積されていないため、従来評価を踏襲する。'),(18,20,'2003-12-31',90,'従来通り','2006-01-20 13:15:52','SK-2は平成7年7月にポンピング採油を開始して以来、順調に稼動していた。平成15年12月から水量率、GORの上昇傾向し、油生産レートも1kl/Dを切っている可能性がある。SK-3は近年安定して生産を続けており、従来評価の減退傾向を上回る生産レートを維持している。しかしながら、両坑井ともに2004年中の単独計量値がないため、従来評価を踏襲する。'),(21,23,'2003-12-31',90,'従来通り','2006-01-20 13:51:27','採収終了'),(22,24,'2003-12-31',90,'従来通り','2006-01-20 13:56:12','採収終了'),(23,25,'2003-12-31',90,'従来通り','2006-01-20 13:56:48','採収終了'),(24,26,'2003-12-31',90,'従来通り','2006-01-20 13:59:14','採収終了'),(25,27,'2003-12-31',90,'従来通り','2006-01-20 14:03:56','平成15年3月末の西大潟集油所閉鎖に伴い、実績値計上とした。'),(28,30,'2003-12-31',90,'従来通り','2006-01-20 14:02:11','採収終了'),(31,33,'2003-12-31',90,'従来通り','2006-01-20 14:13:46','本層唯一の稼働坑井である東由利原AK-2は日量約150m3/D〜300m3/Dで生産を行っている。安定した生産が望めないことから平成12年末より、実績値の計上としている。'),(32,34,'2003-12-31',90,'従来通り','2006-01-20 14:15:00','SK-1、SK-2は採収を終了し、圧入井に転用済。SK-4、SK-7については自噴不調となった後、長期密閉となっており、鉱量は計上しない。SK-5は圧力の回復を待って開放するサイクル採収を行っていたが、2000年10月以降、圧力の回復が以前よりも小さくなり、長期に密閉しても改善が望めないため、2000年末から鉱量を計上していない。\r\n本層は平成15年中の生産実績がないため、前年評価を踏襲した。'),(33,35,'2003-12-31',90,'従来通り','2006-01-20 14:16:06','SK-10SはH13年末の減退曲線法評価における可採鉱量採収後、自噴停止となり生産再開の見込みが立たないため、実績値評価に切り替えている。採収に坑井作業が必要な他の3坑井については、平成12年末評価において推定鉱量へと移したが、平成13年末評価から確認?として確認鉱量に計上している。'),(37,39,'2003-12-31',90,'従来通り、追加あり','2006-01-20 14:20:21','平成15年中に東由利原AK-1, SK-9でフローテストを実施し、生産能力の確認を行った。\r\n2004年中は、SK-9で約2ヶ月間生産を実施したものの、従来評価を変更するに足るデータは蓄積されていないと判断し、前年評価を踏襲した。\r\n新規に掘削されたSK-17DHでは、少量のフローに留まったため、実績値計上とした。'),(40,42,'2003-12-31',90,'従来通り','2006-01-20 14:37:58','西子吉川SK-1は、2001年2月4日から同年3月6日にかけて4層に対して計6回のDSTを実施し、No.2 DST区間の女川ドレライト層にて油の、No.4 DST区間の船川層福山安山岩にてガスの産出を見た。平成15年11月にガス層のフローテストを実施し、PBU解析結果によって、可採鉱量の下方修正を行った。自噴線敷設予定がないので、引き続き「確認?」として計上する。'),(43,45,'2003-12-31',90,'従来通り','2006-01-20 14:42:25','全坑井廃坑済み。廃層。'),(44,46,'2003-12-31',90,'従来通り','2006-01-20 14:43:18','昨年度、平成13年〜14年に実施した産出テストにより、減退傾向の把握が出来たため、減退曲線法により鉱量評価を実施している。概ね減退傾向に沿っていると判断し、前年度評価を踏襲した。'),(98,54,'2003-12-31',90,'従来通り','2006-01-19 10:39:59','平成11年末評価では、SK-24Aの密閉後の生産データが蓄積されてきたことから減退曲線を見直し、従来の層全体の一括評価から坑井毎の個別評価へ切り替え、密閉による影響の軽減を図った。また平成14年末評価において、SK-1については前回評価データ（Ｈ11年末）に追加データを加えて再評価を行なっている。\r\n平成16年末評価においては、SK-1についてはデータ追加によって評価結果が大きく変わらない点、SK-24Aについては、平成11年10月ビーン変更（25.4→6.5）後のデータは蓄積されたものの、頻繁な密閉・開放により安定した採収データが少ない点を考慮し、前回評価値を踏襲する。'),(100,56,'2003-12-31',90,'従来通り','2006-01-19 10:47:43','平成5年に平成4年度末までの圧入実績を基に、昭和62年のガス圧入スタディ(VIP) の Followup スタディを VIP で実施したが、前回モデルを修正する必要がなかったため、総可採鉱量は 昭和62年評価を踏襲した。\r\nなお、圧入ガスの回収率は100%としており、再生産ガスは全て圧入ガスから成るものとしている。'),(102,58,'2003-12-31',90,'従来通り','2006-01-19 11:15:46','従来通り累計生産量を総可採鉱量として計上した。'),(104,87,'2003-12-31',90,'従来通り','2006-01-19 16:17:56','昭和63年にシミュレーションスタディを実施し鉱量を評価した。その後、本層の坑井は平成3年12月から密閉している。従って本年は昭和63年末評価を踏襲した。\r\nなお、生産再開には地上設備の整備が必要である。'),(105,88,'2003-12-31',90,'従来通り','2006-01-20 11:55:37','藤川III層は当面、生産の予定がないことから平成9年10月に保安対策としてPKR内部にパーマネントタイプのブリッジプラグを設置した。鉱量は前年度評価を踏襲する。\r\nなお、生産再開には改修作業が必要である。\r\n\r\n        昭和61年9月5日〜8日フローテスト実施時の生産状況\r\n\r\n            ガス生産レート： 3,400 m3/d\r\n              内　　圧    ： 360 → 50 Kscg\r\n'),(106,89,'2003-12-31',90,'従来通り','2006-01-20 11:56:05','平成4年に基礎試錐三島の掘削によるデータ増により鉱量の見直しを行った。藤川III層は当面、生産の予定がないことから平成9年10月に保安対策としてPKR内部にパーマネントタイプのブリッジプラグを設置した。鉱量は前年度評価を踏襲する。\r\nなお、生産再開には改修作業が必要である。'),(107,90,'2003-12-31',90,'従来通り','2006-01-18 15:48:07','昭和６２年にガス圧入スタディを実施し鉱量の見直しを行っている。本年も昭和６２年末評価を踏襲する。なお、圧入ガスの回収率は100%としている。\r\nただし、再生産には地上設備の整備が必要である。\r\n\r\n平成16年末\r\n累計実圧入量　（百万M3）	１８７.２\r\n累計再生産量　（百万M3）	０.０\r\n累計　圧入量　（百万M3）	１８７.２\r\n'),(108,91,'2003-12-31',90,'従来通り','2006-01-18 15:59:25','昭和６１年末評価において、可採鉱量を昭和６１年の年間生産量の３年分を見込んで計上した。　\r\n       　　     油　  　 68 kl　×　3　＝　   204 kl\r\n           　　ガス  10,346 m３  ×　3  ＝  31,038 m３\r\n\r\n昭和６２年以降生産実績なし。\r\n1994年8月に急激な内圧上昇が確認され、Ｖ層との導通が懸念される。\r\nなお、生産再開には地上設備の整備が必要である。'),(109,92,'2003-12-31',90,'従来通り','2006-01-18 16:00:12','昭和６３年末評価において、減退曲線法により可採鉱量の見直しを行った。その後坑内浚いを再三試みたが成功せず生産実績はない。本ガス層について平成８年度にマテリアルバランス法による残存可採鉱量の再検討が実施されており、可採鉱量の増加が示唆されている。しかし、Re-Entry技術の面からも残存鉱量回収の不確定要素が多いことから、平成13年末評価における評価方法の見直しにより条件付資源量と位置付け、確認鉱量は実績計上とする。ただし、条件付資源量は前回評価値を踏襲する。'),(110,93,'2003-12-31',90,'従来通り','2006-01-18 16:02:19','実績計上。'),(111,94,'2003-12-31',90,'従来通り','2006-01-20 13:10:11','平成9年、帝石との共同で「吉井・東柏崎スタディ」が実施され、Case1_toc30が平成13年末評価まで埋蔵量に採用されていた。Case1_toc30は、当社が平成8年の中長期計画に基づき生産した場合で、かつ帝石が今後コンプレッサーの能力を30万m3/Dまで増強すると仮定したケースである。\r\n同ケースの生産予測では、当社の生産は2046年まで継続可能であるが現時点では1ブロックの水の付きかたについてのデータが無く、着水後の生産予測には不確定要素が含まれている。この為、確認鉱量としては帝石生産終了時点（2020年3月）までを計上し、その後の当社生産終了時までの生産量を推定鉱量と位置付けてきた。\r\n\r\n平成14年にフォローアップ（これまで使用してきたモデルに対し岩相ユニットCへLGR採用、北東側へ水層追加）を実施し、圧力・着水状況マッチング改善。\r\n将来予測の条件として、現状に合わせるためTOC昇圧能力を30万→15万へ変更、当社の生産プログラムを平成14年の中長期計画へ刷新した。\r\n修正後のモデルを用いた将来予測結果は、前回評価値よりも確認＋推定で+5.3億m3(+4.0%)、確認で+3.3億m3(+2.8%)の修正となった。\r\n平成16年、2D震探再解釈を取り入れ、片貝で実績をあげた多点法Geostatisticsにより新油層モデル作成を作成し、現在再評価を実施中である。\r\n\r\n※ 平成11年にフォローアップが実施時のマッチング状況は以下のとおりである。\r\n・?ブロック(全坑井)及び?ブロック(SK7)の水産出状況、\r\n→LGR採用により、仲通り地区・吉井SK8を除く?ブロックの着水状況再現\r\n・?ブロック(1999年以降全坑井)及び?プロック(安田3,4)のGOR\r\n→?プロック(安田3,4)のGOR再現できていない（平成14年フォローアップの対象から除いた）\r\n・?ブロックの圧力低めに推移\r\n→北東水層追加により、圧力推移再現'),(112,95,'2003-12-31',90,'従来通り','2006-01-18 16:12:11','昭和61年にシミュレーションスタディ(COMP3)を実施し、鉱量の見直しを行なった。\r\n(OGIP: 16.80 →14.06億m3、総可採鉱量：12.67 →9.98億m3、総圧入可能量:6.04億m3)\r\n本年も昭和61年末評価を踏襲する。\r\n圧入ガスの回収率はオペレーションの仕方により異なるが、ここでは回収率100％としている。平成5年4月以降、圧入実績は無い。なお、寄託ガスについては、平成6年に返還を終了している。\r\n平成11年4月にSK-1の再生産テストを実施、OFC=4,189千m3/d。'),(114,97,'2003-12-31',90,'従来通り','2006-01-18 16:13:28','本層は平成5年度に掘削したSK-25 の結果により、平成5年末評価より鉱量を計上している。本年も生産実績が無いため、鉱量は従来の評価値を踏襲した。\r\nなお、累計生産量は試ガス時の生産量のみであり、生産再開にはF/Lおよび地上設備の整備が必要である。\r\n但し、現在水の産出のみとなっている南片貝SK-2とほぼ同等のレベルにあり、仮に現在の評価通り北部と南部が同プールであり南片貝SK-2が水没したものとすると、SK-25も水没している可能性があり、早急にフローテストにより確認する必要がある。\r\n\r\n（注１）本層は3200m層と異なり北部と南部でガス油比はほぼ等しいガス・コンデンセート層であるが、現時点の評価では中間エリアの坑井データが少ないため北部と南部それぞれについて評価している。\r\n\r\n（注）ガスの可採鉱量については、0.1百万m3のまるめ誤差である。\r\n'),(115,98,'2003-12-31',90,'従来通り','2006-01-18 16:28:42','本年も生産実績がないため、鉱量は昨年評価を踏襲した。\r\n(平成９年１１月、片貝SK-17 X’mas交換時のブライン排出に伴う生産のみ)'),(116,99,'2003-12-31',90,'従来通り','2006-01-18 16:29:36','SK-24 掘削後の容積法による評価（従来は油層として評価していたが、SK-24 の掘削結果から上部をガスキャップ、下部を油層として評価）を採用している。平成14年1月、TOC飯塚1成功後の数ヶ月（推定）のフローテスト期間中に圧力干渉の疑いあり。平成15年1月〜4月RLT実施。今後再評価していくこととし、鉱量は従来評価を踏襲する。\r\n\r\n（注１）本層は、北部と南部でガス油比が異なることから、北部は油層、南部はガス・コンデンセート層として、平成元年末評価から北部と南部とに分けて計上されている。現時点の評価では、2700m層と異なり、北部と南部は断層により隔てられた別構造と解釈している。\r\n\r\n（注２）平成４年に実施したSK-24 の産出流体のPVT試験（91年フローテスト時のサンプル）では、流体が臨界状態に非常に近いため、初期状態でガス一相か油一相か判断できていない。また、平成５年度に掘削したSK-25 は、水層であったため再評価を行なうためのデータは得られなかった。したがって、データが入手された後、鉱量の見直しを行なう必要がある。'),(122,67,'2003-12-31',90,'','2006-01-19 14:20:35',' '),(125,70,'2003-12-31',90,'従来通り','2006-01-17 15:24:52','本層で唯一の採収井であるMS-24改は、現状で安定採収が困難なため平成11年のフローテストを最後に密閉中である。生産状況の改善には技術的不確実性が存在すると考えられ、H13年末評価時計上法の変更により前年度まで推定鉱量として計上していた可採鉱量を条件付資源量と位置付け、確認鉱量は従来通り実績分を計上する。\r\n\r\n（参考）「平成11年末評価 解説の骨子」\r\n　本層の採収井MS-24改は、平成9年11月にCTユニットにて浚い作業実施し、自噴再開後は減退傾向を示しながらも順調に生産を継続していたが平成11年4月に再び自噴停止に至った。自噴停止後のフローテストにて中圧採収でガス:10,000m3/d, 水:24KL/dを確認したものの産出水量が多く安定した採収には至っていない。\r\n　生産状況の改善（遮水、マカロニリフト等）が実施できれば残鉱量の回収も可能と考えられるが、技術的不確実性が存在すると考えられることから、残存鉱量は推定鉱量として計上し、確認鉱量は実績計上とした。採収限界レートを1,000m3/dとして減退曲線法による総可採鉱量202百万m3から累計生産量を減じたものを推定鉱量として計上する。'),(126,71,'2003-12-31',90,'従来通り','2006-01-17 15:32:29','本層は未採収のため、昭和62年末の鉱量評価を踏襲した。\r\n平成15年11月、CTU浚い作業実施し、砂による坑内閉塞の改善および現油層圧力を確認した。浚い後のフロー状況は、ガス47,000m3/d、油10.0kl/d、水0.0kl/d（＠D.D.：3.1%, Pws：20.61MPa）。\r\n下層はプラグセットし、MS-31上（2340mA1）、MS-31中（2340mA,B1,B2）を優先して採収することとする。'),(127,72,'2003-12-31',90,'従来通り','2006-01-17 15:33:11','本層は未採収のため、昭和62年末の鉱量評価を踏襲した。\r\n平成15年11月、CTU浚い作業実施し、砂による坑内閉塞の改善および現油層圧力を確認した。浚い後のフロー状況は、ガス103,000m3/d、油23.4kl/d、水0.1kl/d（＠D.D.：8.3%, Pws：21.70MPa）。\r\n現在、下層へはプラグセットし、MS-31上（2340mA1）、MS-31中（2340mA,B1,B2）を優先して採収することとする。'),(128,73,'2003-12-31',90,'従来通り','2006-01-17 15:33:49','平成11年8月以降、一旦レートは低下したがH14年11月自噴不調になる直前までの油量のレートは、平成9年12月に実施したB/S変更(B.S. 4.0→7.0mm)後から平成11年8月に生産レートが低下する前までの油量の減退傾向を若干超えるレートまで回復していた。\r\nH14年11月自噴不調になり、一旦坑井密閉（穿孔区間の1/3が砂で埋没）。H15年1月に生産再開したもののレート回復には至らなかったため、H16年4月CTUによる浚い作業を実施したが浚い作業実施後も自噴不調前の生産レートには回復していない。本年鉱量評価としては、前回評価（平成 13年末評価結果）を踏襲する。'),(129,74,'2003-12-31',90,'従来通り','2006-01-17 17:11:36','MS-31下は平成4年以降、自噴不調・大気放散を繰り返し、平成5年9月に砂産出により自噴停止した。平成6年4月に自噴誘導を行なった結果、自噴に成功し生産を再開したが、自噴不調が頻発するため、平成7年2月に密閉した。その後、平成9年の坑底圧測定で砂による坑内の閉塞が確認されている。\r\n平成15年11月、CTU浚い作業実施し、砂による坑内閉塞の改善および現油層圧力を確認した。ただし、フローテスト状況を勘案すると現状では残存鉱量回収には技術的不確実性が存在すると考えられる。よって、残存鉱量を条件付資源量と位置付け、確認鉱量は従来通り実績分を計上する。\r\n現在、本層へはプラグセットし、MS-31上（2340mA1）、MS-31中（2340mA,B1,B2）を優先して採収することとする。'),(130,75,'2003-12-31',90,'従来通り','2006-01-17 15:34:52','本年も生産実績がないため、昭和63年末評価を踏襲した。\r\nMS-23上については下層（2900mA層）と導通しており、下層から上層への圧入を防ぐため、圧入を生じないレートで下層を生産し、上層は密閉している。'),(131,76,'2003-12-31',90,'従来通り','2006-01-06 11:42:31','MS-42は平成10年6月の試ガスにおいて、油：20.72KL/D、水：0KL/D、ガス：4,950m3/D、GOR239m3/KLの結果を得て採油井に編入された。平成11年6月長期フローテストを最後にしてMS-44掘削等の理由で一時生産中断するまでの生産データにおいて減退傾向が現れているようにも見えるが、生産期間が短く鉱量評価には不十分と考えられことから容積法による評価を従来行なってきた。H16年末時点の単計データを用いた減退曲線法評価値と容積法評価値は近い値を示すが、従来の容積法による評価を踏襲する。'),(132,77,'2003-12-31',90,'従来通り','2006-01-17 16:42:01','MS-44の結果を踏まえ、平成12年末評価において容積法による鉱量の見直しが実施された。\r\nMS-44は、その後のフローテストで水量率が急上昇したことから平成13年10月にPLTを実施した。PLTの結果から、上下2つのP/L区間のうち下部P/L区間からの産出水が全産出水量のおよそ70％であることがわかった。この結果は掘削時のログから特定される高浸透率層の存在と一致しており、平成14年03月に上下P/L区間を分離する位置でブリッジプラグをセットする遮水作業を実施した。\r\n本井からの2900mA層リングオイルは上部P/L区間より回収できると考えているが、遮水作業後の生産データを蓄積した後見直す必要があると考える。(H16年単独計量実績なし)\r\n平成13年度に取得した3D震探データ解釈の結果、評価値を推定鉱量へ計上したが（＠H15末）、確認鉱量については新規掘削データを待って再度評価することとし、前回評価を踏襲する。\r\n\r\n<<平成12年末評価の解説からの抜粋>>\r\nMS-44の坑底位置でこれまでの評価の２倍の砂岩層厚があったこと、及びLKO(lowest known oil)のレベルが37m下がったことにより、前年評価より総可採鉱量で原油が17%の増、ガスが41%の増となった。2900mA3層はMS-44の坑底位置では欠如していた為、同層の総可採鉱量は前年より原油が10%の減、ガスが25%の減となり、2900mA層群全体の総可採鉱量は原油が8%の増、ガスが13%の増となった。\r\n'),(133,78,'2003-12-31',90,'従来通り','2006-01-17 16:46:45','MS-44(2900mA層)の結果を踏まえ、平成12年度評価において容積法による鉱量の見直しが実施された。平成13年度に取得した3D震探データ解釈の結果、評価値を推定鉱量へ計上したが（＠H15末）、確認鉱量については新規掘削データを待って再度評価することとし、前回評価を踏襲する。\r\n\r\n<<平成12年末評価の解説からの抜粋>>\r\n2900mA3層はMS-44の坑底位置では欠如していた為、同層の鉱量は前年評価より原油が10%の減、ガスが25%の減となった。2900A層は坑底位置でこれまでの評価の２倍の砂岩層厚があったことなどにより総可採鉱量で前年より原油が17%の増、ガスが41%の増となっており、2900mA層群全体の総可採鉱量は原油が8%の増、ガスが13%の増となった。'),(134,79,'2003-12-31',90,'従来通り','2006-01-17 16:52:40','MS-44(2900mA層)の結果を踏まえ、平成12年度評価において容積法の見直しが実施された。平成13年度に取得した3D震探データ解釈の結果、評価値を推定鉱量へ計上したが（＠H15末）、確認鉱量については新規掘削データを待って再度評価することとし、前回評価を踏襲する。\r\n\r\n<<平成12年末評価の解説からの抜粋>>\r\n同坑井の坑底位置で砂岩層厚がこれまでの評価より厚かったことにより、総可採鉱量で前年より原油が8%増、ガスが1%増となった。'),(135,80,'2003-12-31',90,'従来通り','2006-01-26 17:38:31','　95年スタディー以降コア分析など新規データが追加されており、構造図も若干の修正が加えられているが、原始鉱量はほとんど変わっていない。前年評価同様、マッチング状況は、圧力・水レートについて若干の乖離が見られるほか、GORの計算結果が実測値を上回っていることによる油の可採鉱量の過小評価の程度は大きい。\r\n今年度評価では、GORの今後の上昇傾向から原油の総可採鉱量のみ再評価する方法（H12末〜）を踏襲したが、GORの上昇傾向に変化が無いことからH12末評価値を採用する。この評価方法は、あくまでもモデル修正までの経過措置と位置付ける。\r\n  今後、平成13年度実施した3D震探からの構造データ等、追加の生産挙動データ、新掘井からのデータなどが期待されるH15年度以降に再スタディーを実施することとし、本年は平成7年(1995年)のシミュレーション結果を踏襲する。\r\n　\r\n \r\nマッチング状況\r\nガス層圧力: 2000年以降計算値が実測値を下回っている。従って、原始鉱量を過小評価しているか、或いは水層の大きさを過小評価している可能性がある。後者の場合は、可採鉱量が減少となる可能性が強い。\r\nGOR: 1995年あたりから計算値が実測値を上回っている。つまり、計算ではコンデンセートをガス層内に取り残す形であり、油の可採鉱量は過小評価していることになる。\r\n水レート: NS-5, NS-18,MS-40では着水挙動を過小評価。NS-15,MS-38では着水挙動を過大評価。\r\n\r\n2900mB層群全体でみると圧力、水量の予測は概ね良好。但し、GORの計算結果が実測値を上回っていることによる油の可採鉱量の過小評価の程度は大きい。\r\n\r\n坑井状況\r\n　　着水状況については、2005年にNS-5で水量率上昇が顕著になったため、レートを制限しての生産となっている。\r\n　出砂状況については、NS-13上、NS-18a以外の全ての坑井について出砂が確認されており、2002年にNS-6が砂によるセパレータ閉塞のため生産不能に陥るトラブルが発生している。NS-6は2004年9月にTBG内砂浚い作業およびThrough TBG Gravel Pack（TTGP）作業を実施し生産状況を監視中（ただしMS-45掘削に伴い同年11月に密閉）であるが、スクリーン・パッキン類の耐久性を確認した上で他坑井へのTTGP適用を検討することとなっている。'),(137,82,'2003-12-31',90,'従来通り','2006-01-17 17:01:52','本層唯一の稼働坑井NS-10が1998年4月17日に水没により自噴停止した。この為、累計生産量を総可採鉱量として実績計上した。'),(138,83,'2003-12-31',90,'従来通り','2006-01-17 17:03:09','平成13年3月に本井3200m層へスルーチュービング・パーフォレーションを実施し、地上配管内でハイドレートを生成しない夏期のみ、現在同坑井で採収中の3400m層とのコミングル採収を開始した。\r\nコミングルガス生産量は3,000m3/Dにも満たないほど微量であり、鉱量については十分な生産データを取得した後再評価することとし、本年は従来通り容積法（平成5年評価）の値を計上する。'),(139,84,'2003-12-31',90,'従来通り','2006-01-17 17:03:54','平成5年の長期フローテスト（RLT）及び平成8年の残存鉱量の評価の結果、残存可採鉱量が少なく酸処理等の坑井刺激作業には経済的リスクが大きいとの判断に至っている。平成11年測定の密閉坑底圧は490kscと高い圧力を維持しているものの、RLTおよびBUCで得られる浸透率は0.01〜0.2mdと非常に小さく、長期的に高い生産レートを維持することは困難である（安定レートは1,000m3/d以下）。\r\n　基本的に本3400m層からの採収は断念し、平成13年3月にMS-22において3200m層を対象にスルーチュービング・パーフォレーションを実施し、3400m層とのコミングル採収を開始した。コミングルガス生産量は3,000m3/Dにも満たないほどの微量である。\r\n鉱量については従来評価と同じく、3400m層からの採収は不確定要素が大きく、多くは望めないことから、従来通り生産実績を鉱量として計上する。'),(159,58,'2003-12-31',50,'従来通り','2006-01-19 11:10:15','820ｍ層（SK-26）H13年末評価より条件付資源量として計上。'),(162,148,'2003-12-31',50,'？','2006-01-18 17:30:16','1997年見附油田改修・改層スタディが実施され、椎谷層中に改修対象となる鉱量が残されている可能性が示唆された。この為、同鉱量を推定鉱量として計上する。'),(167,92,'2003-12-31',50,'？','2006-01-18 17:25:48','H13年末評価より条件付資源量として計上。'),(172,94,'2003-12-31',50,'従来通り','2006-01-19 14:54:41','平成9年、帝石との共同で「吉井・東柏崎スタディ」が実施され、Case1_toc30が平成13年末評価まで埋蔵量に採用されていた。Case1_toc30は、当社が平成8年の中長期計画に基づき生産した場合で、かつ帝石が今後コンプレッサーの能力を30万m3/Dまで増強すると仮定したケースである。\r\n同ケースの生産予測では、当社の生産は2046年まで継続可能であるが現時点では1ブロックの水の付きかたについてのデータが無く、着水後の生産予測には不確定要素が含まれている。この為、確認鉱量としては帝石生産終了時点（2020年3月）までを計上し、その後の当社生産終了時までの生産量を推定鉱量と位置付ける。'),(174,97,'2003-12-31',50,'？','2006-01-18 17:21:06','容積法の全域評価により得られた鉱量と確認鉱量（JIS準拠）により得られた鉱量の差を推定鉱量と位置付ける。\r\n但し、2700m層の南部については、南片貝SK-2のフロー状況（ガスが水に替わった）を鑑み、確認鉱量はJIS準拠ではなく累計生産量を実績計上する。'),(176,99,'2003-12-31',50,'？','2006-01-18 17:20:08','容積法の全域評価により得られた鉱量と確認鉱量（JIS準拠）により得られた鉱量の差を推定鉱量と位置付ける。'),(177,98,'2003-12-31',50,'？','2006-01-18 17:20:32','容積法の全域評価により得られた鉱量と確認鉱量（JIS準拠）により得られた鉱量の差を推定鉱量と位置付ける。'),(186,77,'2003-12-31',50,'？','2006-01-18 17:27:07','LKO以下のリングオイル部を推定鉱量として計上する。'),(187,78,'2003-12-31',50,'？','2006-01-18 17:27:40','リングオイル部を推定鉱量として計上する。'),(188,79,'2003-12-31',50,'？','2006-01-18 17:28:05','リングオイル部を推定鉱量として計上する。'),(197,104,'2003-12-31',90,'従来通り','2006-01-20 16:38:05','・2002年末評価では北MS-1を中心とする半径250mに相当するガス原始鉱量に対して回収率50％を想定して確認鉱量を計上した。確認＋推定鉱量としては、1200m層確認坑井の包絡線エリアをガス原始鉱量とし回収率は50％を想定した。それぞれの総可採鉱量は19.6百万m3、2000.0百万m3と評価された。\r\n・2003/2に北MS-1を改修しフローテストを行ったところ、予想に反して1200m3/d程度の産ガス状況であった。BUC解析の結果非常に低浸透性のガス層と評価された。しかし、400m程度しか離れていないSIM-4ではAOFC160,000m3/dの比較的高浸透性ガス層の評価がなされており判断は未だ難しい。\r\n・この様な結果を受けて2003年末評価では、確認鉱量は今後実績計上とし、確認＋推定鉱量については1200m層全域の地質状況（特に砂の連続性）がよくわかっていないことからMS-1の結果を反映させず昨年評価を踏襲している。\r\n・2004年末評価も2003年末評価を踏襲する。\r\n'),(207,114,'2003-12-31',90,'従来通り','2006-01-20 16:36:52','・北MS-1は岩船沖油田北部砂岩層の広がりを確認するため、2000年度に探掘を実施した。そこで、既存エリアの1900m層及び2000m層に相当する砂岩層をテストした結果油の産出が確認されたので、両層を１ストリング２パッカー仕上げを行い、2000/12/4に採収井に編入した。\r\n・2000m層はDST時点で50KL/Dの油生産量を確認したものの、排泥フローテストでは3KL/Dまで低下した。BUC解析によるとスキンが100以上と多大な坑井障害が認められたため2000/3にフッ化水素酸による酸処理を実施した。酸処理の結果坑井障害は除去され油生産量も45KL/Dまで回復したものの生産が進むにつれて2ヶ月間で約20KL/Dまで低下していった。円筒形モデルによるシミュレーションの結果、坑井近傍半径100ｍポイントにTransmissibilityが周辺の15％であるバリアを設定することによって全てのパフォーマンスが再現可能になった。このスタディ結果は、コヒーレンス解釈によるMS-1周辺の微細断層の存在と調和的である。\r\n・2002年末評価では、2003/2に廃層予定であるため2002年末までの生産量に生産計画量を加え計上したが、実際に廃層を実施したため2003/2までの累計生産量を総可採鉱量として計上している。\r\n・2004年度についても2003年末評価を踏襲している。\r\n'),(386,50,'2004-12-31',90,'従来通り','2006-01-19 11:34:50','本坑井は昭和61年10月サンドベーリング作業し、昭和62年7月から生産を開始したが、出砂のため9月に密閉し、それ以降の生産実績はない。生産の再開は困難と考えられる為、累計生産量を総可採鉱量として計上する。（なお、昭和６１年末の減退曲線法による評価では、可採鉱量はガス:30万m3と予測されている。）'),(387,50,'2004-12-31',50,'?','2006-01-19 11:35:15','評価終了。 平成16年末評価時点で推定鉱量に該当する鉱量なし。'),(388,48,'2004-12-31',90,'従来通り','2005-12-14 16:39:52','H11年末評価より93年ビーン取付け後の減退傾向を用いて減退曲線法による評価に変更。H12年以降の減退傾向が前回評価の減退曲線を上回っていることから、H13年末評価において追加データを加えて再評価を行った。<br>\r\n平成15年1月、J基地-G基地間自噴線の漏洩発生。採算検討の結果、平成16年3月末にて採収終了した。鉱量は実績計上とする。\r\n'),(389,48,'2004-12-31',50,'?','2006-01-19 11:34:05','評価終了。 平成16年末評価時点で推定鉱量に該当する鉱量なし。'),(390,49,'2004-12-31',90,'従来通り','2006-01-19 11:32:36','本坑井はガスリフト採収を実施していたが、昭和61年3月以降、SK-12の生産ガスではキックできなくなり、内圧が上昇する毎に開放する間欠採収に切り替えたが、昭和62年8月以降は生産実績がない。採収の見込みがないため、累計生産量を総可採鉱量として計上した。'),(391,49,'2004-12-31',50,'?','2006-01-19 11:33:33','評価終了。 平成16年末評価時点で推定鉱量に該当する鉱量なし。'),(392,51,'2004-12-31',90,'従来通り','2006-01-19 11:36:17','87年9月浚い＆スワビングしフロー再開後、内圧は低下したもののここ数年間水量1.5〜2.0kl/d程度、内圧0.1〜0.7MPa程度で変動しながら、ガスレート、坑口圧力ともに緩やかに減退していた。平成11年末評価より坑口圧力の減退傾向を用いて鉱量評価しているが、平成12年以降、坑口圧力は月平均約0.26Mpaで推移しており、平成11年末評価時の減退傾向より若干高くなっている。\r\n坑口圧力が下流のライン圧力にまで達したならば、オペレーション条件が変わらない限り坑口圧力はほぼ一定に推移しガスレートが減退していくものと考えられたが、平成14年一年間の水産出状況が不安定だったこととH12年以降のデータ量が十分でないことから、平成11年末評価値を踏襲してきた。\r\n平成15年1月、J基地-G基地間自噴線の漏洩発生に伴い密閉。平成16年4月に廃坑された。'),(393,51,'2004-12-31',50,'?','2006-01-19 11:36:36','評価終了。 平成16年末評価時点で推定鉱量に該当する鉱量なし。'),(394,52,'2004-12-31',90,'再評価、実績計上','2006-01-19 11:37:37','94年に内圧が低下して以降、ここ数年間、内圧0.1〜0.4MPa程度で変動しながらも坑口圧力は緩やかに減退し、ガスレートは微量なため単計値250m3/dを計上していた。\r\n平成11年末評価より坑口圧力の減退傾向を用いて鉱量評価している。平成12年以降、坑口圧力は月平均約0.15Mpaで推移しており、平成14年１年間の年産量は、ガス 91千m3、原油 0.0KLである。\r\nセパレーター圧力は0.1MPa、同じJ基地で採収しているSK11下(680m+750m)と合同採収している。オペレーション条件が変わらない限り坑口圧力はほぼ一定に推移しガスレートが減退していくものと考えられるが、減退を計量できるほどのガスレートではないと判断し、平成14年末評価より実績値を計上。\r\n平成15年1月、J基地-G基地間自噴線の漏洩発生に伴い密閉。平成16年4月に廃坑された。'),(395,52,'2004-12-31',50,'?','2006-01-19 11:37:59','評価終了。 平成16年末評価時点で推定鉱量に該当する鉱量なし。'),(397,53,'2004-12-31',50,'?','2006-01-19 11:39:18','評価終了。 平成16年末評価時点で推定鉱量に該当する鉱量なし。'),(402,55,'2004-12-31',90,'従来通り','2006-01-19 10:43:38','平成5年に平成4年末までの圧入実績を基に、昭和62年のガス圧入スタディ(GASP3) の Followup スタディを GASP3 （水押しを考慮したタンクモデル）で実施している。平成15年にVIPモデルを試作したが今後詳細につめていくこととし、総可採鉱量は昭和62年度評価を踏襲した。\r\nなお、圧入ガスの回収率は100%としており、再生産ガスは全て圧入ガスから成るものとしている。'),(406,57,'2004-12-31',90,'従来通り','2006-01-19 10:49:35','これまでガスの確認鉱量については、坑井別の減退曲線法（SK-22下＠昭和59年末評価、SK-23＠平成元年末評価）による評価結果が、油については層全体の一括評価結果（評価方法は不明）が採用されてきた。平成16年末評価では、平成17年中にSK-23累計ガス生産量が確認鉱量を上回ることが予想されたため、同坑井の鉱量見直しを行うとともに油の鉱量を坑井別評価に変更した。\r\nまたSK-23はこれまで自噴線内ハイドレート生成トラブルのため冬季は生産できない状況であったが、平成16年にラインヒーターを設置し通年採収が可能となった。'),(408,68,'2003-12-31',90,'従来通り','2006-01-05 14:44:48','本層唯一の採収井であったNS-1が、平成6年度に廃坑されたため、平成6年度末から実績計上とした。'),(415,73,'2004-12-31',50,'?','2006-01-19 16:09:46','H10年末評価より暫定値として〔BC層全体鉱量（容積法）の1/4〕−〔MS-42確認鉱量〕を計上していたが、NS4累計生産量がBC層全体鉱量（容積法）を既に上回っていることからH16年末評価より推定鉱量は計上しないこととした。'),(422,81,'2004-12-31',90,'鉱量見直し','2006-01-17 16:59:18','NS-16は、96年の坑井テストにより再導通が確認された。現状では導通状況の定量的評価は困難である為、2900mC,D層を一括して評価している。\r\nC,D両層とも91年及び95年にシミュレーションスタディが実施されており、Ｄ層についてはほぼ同じ結果が得られているが、95年C層のモデルの原始鉱量は端水面深度の違いから91年のそれより5億m3多い。NS-16導通のためC層圧力データが得られないという不確定要素を加味し、H15年末評価までは91年の結果に基づく鉱量を確認鉱量、95年の結果に基づく鉱量を推定鉱量として計上してきたが、平成16年末評価ではC,D層油累計生産量が確認総可採鉱量（’91年Sim.結果）を上回ったことから鉱量の見直しを行った。\r\n【参考】\r\nC及びD層は断層により南北２つのブロックに分けられている。\r\nD層では坑井の圧力挙動から貯留層は断層で遮断され、南北間の導通性は無いと考えられている。一方で、C層ではその北部にしか生産井が存在しないことから断層の導通性については確認できておらず、断層による貯留層の遮断は無いと仮定した上でモデルを構築。\r\n平成16年末評価においてはC+D層北部（NS-16導通のため）、D層南部の２ブロックに分けて減退曲線法による鉱量評価を行った。'),(423,81,'2004-12-31',50,'鉱量見直し','2006-01-17 16:59:58','C,D両層とも91年及び95年にシミュレーションスタディが実施されており、Ｄ層についてはほぼ同じ結果が得られているが、95年C層のモデルの原始鉱量は端水面深度の違いから91年のそれより5億m3多い。NS-16導通のためC層圧力データが得られないという不確定要素を加味し、H15年末評価までは91年の結果に基づく鉱量を確認鉱量、95年の結果に基づく鉱量を推定鉱量として計上してきたが、平成16年末評価ではC,D層油累計生産量が確認総可採鉱量（’91年Sim.結果）を上回ったことから鉱量の見直しを行った。この結果、油の確認鉱量がこれまでの確認＋推定鉱量（’95Sim.結果）を上回ったため、確認＋推定鉱量についても見直しを行い、ガスは1995年のシミュレーション結果（据え置き）、油はGOR予測に基づく評価結果を採用した。'),(424,86,'2004-12-31',90,'従来通り','2006-01-18 15:38:31','平成10年末までの見附油田の鉱量評価は、鉱山自体での採算限界は既に過ぎているため全層一括の減退曲線から得られる次年度末迄の累計量を総可採鉱量として計上してきた。\r\nしかし、平成11年末評価時点で当面廃山が計画されていなかったことから、平成11年末評価より生産量の比較的多いSK-4、SK-29、SK-40について個別に減退曲線法による評価を行い、その他の坑井については生産量が極めて少ないため実績分を計上し、可採鉱量は見込んでいない。\r\n周辺地域の宅地化進行のため、平成15年度にAU基地のSK-29、SK-31、F基地のSK-21について廃坑作業を実施。SK-40の坑口圧力はほぼ下流ライン圧まで減退していることから、平成15年末評価より従来の減退曲線法（坑口圧力）による評価から実績計上に変更した。この結果、見附坑井は全て実績計上となった。'),(426,96,'2004-12-31',90,'従来通り','2006-01-18 16:14:25','南片貝SK-2は、掘削中の溢逸泥を繰り返すトラブルから掘削休止井となった南片貝SK-1の廃坑を可能にすべく2700m層のガス圧を抜く目的で掘削された。1998年の二度のフローテストではハイドレートあるいは地層崩壊によるトラブルにより自噴停止したもののガス5〜7万m3/dの産出を見ていた。ところが、2000年9月にフローテストを実施したところ水の産出しか確認できなかった。\r\nハイドレート生成を回避し連続生産を可能にすべく2001年6月にボトムホールチョークを設置した。以降2002年9月密閉まで、連続生産しフロー状況は安定している。\r\nガスが水に替わった原因ははっきりと掴めていないが、連続生産時のフロー状況から端水面は南片貝SK-2の仕上げ深度直下にあると考えられガス採収の見込みは不確かな面がある。\r\nしたがって、南片貝SK-2のUp-Dipエリアについて推定鉱量を計上している。確認鉱量については、実績計上する。\r\nH13年地質スタディにおいて諸パラメータ（孔隙率など）の見直しを実施している。'),(427,96,'2004-12-31',50,'？','2006-01-18 17:22:14','容積法の全域評価により得られた鉱量と確認鉱量（JIS準拠）により得られた鉱量の差を推定鉱量と位置付ける。\r\n但し、2700m層の南部については、南片貝SK-2のフロー状況（ガスが水に替わった）を鑑み、確認鉱量はJIS準拠ではなく累計生産量を実績計上する。'),(448,103,'2004-12-31',90,'従来通り','2006-01-18 17:18:15','本年も生産実績は無く、累計生産量は試ガス時の生産量である。H13年地質スタディによる本層全域の諸パラメータ（孔隙率など）の見直しを反映させている。\r\nなお、生産再開するにはF/Lおよび地上設備の整備が必要である。'),(450,3,'2004-12-31',90,'再評価','2006-01-20 10:06:26','SK-26、W-3は累計生産量が前年評価の鉱量を超えたため、鉱量の上方修正を行った。SK-27は2005年中に累計生産量が総可採鉱量を超える見込みとなったため、同じく上方修正を行った。SK-70は生産を再開し、1〜2KL/Dのレートで生産したがCO2混入率が25%であるため、実績値計上とする。SK-7は、前年度評価を踏襲した。'),(452,4,'2004-12-31',90,'従来通り','2006-01-20 10:09:53','水攻対象井のSK-37,38の2坑井はGLV不調のためガスリフト効果が低く密閉しているため、従来評価を変更していない。その他の水攻対象井に関しては実績値での計上としている。平成15年〜16年にかけて、本層での生産実績がないので、平成14年末評価を踏襲した。'),(456,6,'2004-12-31',90,'前年通り','2006-01-20 11:44:50','平成15年末評価では、I層単独採収井であるSK-35,47については、生産レートが従来評価からずれて来たため、減退傾向を見直して修正を行い、IIab+III層採収井の鉱量については、SK-45とその他の坑井に分け再評価を行った。平成16年中は、1)貯油タンクトラブルによる生産休止、2) SK-45, 47のガスリフト不調、などが原因で期待通りの稼動が出来ていない。見直しに足る十分なデータが蓄積されていないと判断し、前年度評価を踏襲する。 '),(462,7,'2004-12-31',90,'採収終了','2006-01-20 10:21:05','採収終了'),(466,9,'2004-12-31',90,'再評価','2006-01-20 10:38:11','上下層一括評価により、全鉱量を上層に入力'),(468,156,'2004-12-31',90,'再評価','2006-01-20 11:49:33','DEブロックは、2003年末評価まで、水平断層に区切られた上下ブロックに分割して鉱量評価を実施してきた。しかしながら、下ブロックからの水圧入開始後の圧力挙動から、両ブロックの導通が指摘されていた。また、2004年には、SK-83, 84, 85の3坑の水平坑井が掘削され、圧力測定結果から、従来考えられていた最北部ブロックのGブロックまで、DEブロックと導通している可能性が高いことが判明した。これを機に、2004年末評価より、「北部DEブロックI+II+III層」という呼称で、上下ブロックとGブロックまでを全て含める同一グループとして扱う。\r\n新規掘削されたSK-83H1号井は、高い生産能力を示したものの、SK-82Hの生産能力が半減した。坑井能力は、周辺坑井の生産状況に依存することが明らかになったため、坑井ごとの評価ではなく、全坑井を一括して減退曲線法を適用し、確認鉱量として計上した。また、推定鉱量として、3坑井掘削後の構造解釈見直しによる鉱量評価値(容積法)を計上する。'),(470,11,'2004-12-31',90,'再評価','2006-01-20 11:46:31','本層の坑井は全て合同採収井なので、全生産層の鉱量を層別振り分けファクターで各層に配分している。但しSK-13は既にIII層分の鉱量を打ち切っており、生産量は全量本層の配分となっている。SK-75, 81は、従来の減退傾向を上回るレートで生産しているため、若干の上方修正を行った。また、SK-13についても、生産レートは不安定ながら1〜2KL/Dの生産継続は可能と判断し、最近の減退傾向によって可採鉱量を計上した。\r\nSK-74,76Sは従来通り実績値計上とする。'),(472,12,'2004-12-31',90,'再評価','2006-01-20 11:47:09','本層の坑井はSK-73を除いて全て合同採収井なので、それぞれ層別振り分けファクターを使って各層に配分している。SK-73以外は全てV層との合同採収井であるので、詳細はV層鉱量評価の項を参照のこと。また従来確認鉱量にしてきたSK-77の未仕上げ分は平成11年末評価より推定鉱量に移している。'),(474,13,'2004-12-31',90,'再評価','2006-01-20 11:05:36','本層に属する坑井は、全て合同採収井であることから、鉱量評価を採収層合同で実施し、層別振り分けファクターを用いて各層に振り分けている。 SK-72は平成11年末より実績値で計上している。SK-76L,78Sは減退曲線法で評価してきたが、78Sは平成15年末評価の総可採を累計が上回ったため、減退曲線の見直しを行った。76Lについても、平成15年末評価の総可採を累計量の差が50KLを切ったため、減退曲線の見直しを行った。'),(476,14,'2004-12-31',90,'再評価','2006-01-20 11:48:00','本層に属する坑井は、全てVII層との合同採収井である。詳細はVII層鉱量評価の項を参照。'),(478,15,'2004-12-31',90,'実績値','2006-01-20 11:08:19','SK-77は平成16年1月29日〜2月15日に生産を実施したものの、生産レート(0.5KL/D)は従来の予測よりも減退が進んでいると判断される。少量であることから、今回は実績値計上とした。\r\nSK-78Lも従来通り実績値による評価とした。\r\n'),(480,16,'2004-12-31',90,'実績値','2006-01-20 11:10:07','SK-77は平成16年1月29日〜2月15日に生産を実施したものの、生産レート(0.5KL/D)は従来の予測よりも減退が進んでいると判断される。少量であることから、今回は実績値計上とした。'),(484,18,'2004-12-31',90,'実績値計上、採収終了','2006-01-20 11:12:42','北部集中の合理化方針に従って、2004年をもって採収終了し、SK-12号井を除く坑井は廃坑された。SK-12, SK-68の生産実績を計上した。'),(486,147,'2004-12-31',90,'採収終了','2006-01-20 11:17:38','廃坑'),(488,21,'2004-12-31',90,'再評価','2006-01-20 13:20:14','従来、本ブロックはブロック全体の減退傾向で評価していたが、平成11年末より坑井ごとの減退による評価に切り替えている。SK-6については, 2004年12月にGORが増加してビーンサイズを小さくしたところ自噴停止に陥った。現在、生産は15KL/Dまで回復していることから、従来評価を踏襲した。SK-10は、’03年10月以降GOR上昇がみられるため、GOR=1,000を限界とする減退曲線法に評価方法を変更した。2004年2月後半よりGORがさらに急上昇し、4月20日には自噴停止に陥った。現在はGOR〜500程度で、ガス主体の生産を続けている。GORによる減退傾向を見直し、下方修正を行った。SK-11、SK-4については、2003年末評価の減退傾向を踏襲した。'),(490,22,'2004-12-31',90,'従来通り','2006-01-20 13:22:26','本層の評価は、ガスキャップ部の鉱量を物質収支法、リングオイル部の鉱量をSK-8の減退曲線を用いて算定してきた。リングオイル部のSK-8については従来評価の減退傾向に概ね沿っているため、従来評価を踏襲する。SK-9はガスの需給調整井として使われており、まだ減退が把握されていないことから、昭和51年評価の物質収支法による値を踏襲する。'),(492,36,'2004-12-31',90,'再評価','2006-01-20 14:17:13','SK-14はGWRの低下傾向を用いて評価してきたが、平成16年中に累計生産量が従来評価の総可採鉱量を超えたため、最近のGWRの傾向から、採収限界GWRをSK-10の自噴停止時の実績である2000m3/KLとして鉱量を再評価した。\r\nSK-10は自噴停止となり、再生産テストでも水のみの産出となったため、平成14年末評価以降、実績値計上となっている。2004年中は水圧入テストを実施した。\r\n南鮎川AK-1, 中鮎川SK-1については、DST時の実績のみ計上した。'),(494,37,'2004-12-31',90,'再評価','2006-01-20 14:18:20','平成12年末よりA層全体での物質収支法による評価を開始していた。しかしながら、各坑井の貯留層圧力の幅が大きく、東由利原AK-1のように連続生産が不可能な坑井も存在する。2003年末評価では、密閉後の回復した坑口圧力値を利用した、坑井ごとの減退曲線法によって再評価を行った。SK-8, 北由利原AK-1, 東由利原AK-1の坑口圧は、前回評価の減退傾向をやや上回っているが、見直しに足るデータ量が蓄積されているわけではないため、前年度踏襲とした。'),(496,38,'2004-12-31',90,'従来通り','2006-01-20 14:19:17','2004年1月〜3月に、ガス需給対応のため、SK-12で連続生産を実施した(ガス約100万m3)。この間、南鮎川のPs変化は約3kscで、両坑井の導通性が確認された。南鮎川は2004年7月の酸処理によって、生産レートが大幅に改善された(約80KL/D→約170KL/D)。当面、南鮎川を連続生産し、中鮎川で圧力を監視して、両坑井間の導通性をみる予定である。\r\nいずれの坑井も明確な減退傾向は現れていないため、2003年末評価における容積法の値を踏襲した。ただし、累計実績のGORを採用したため、ガスについては若干の下方修正となった。\r\n今後、圧力データの収集に努め、流動シミュレーションに着手して行きたい。'),(500,40,'2004-12-31',90,'従来通り＋新規','2006-01-20 14:21:40','南鮎川AK-1では、2004年7月に酸処理を実施したが、生産性は改善しなかった。新規掘削されたSK-17DHは、100KL/Dの油レートを記録したが、水量率が30%程度付いたため、適正レートを確定するに至っていない。その他の既存坑井については、前年度までの減退傾向から大きく変化している様子は認められない。現在は、増産後(2004年11月以降)のデータ収集段階にあるため、確認鉱量・推定鉱量ともに前年度評価を踏襲する。'),(502,41,'2004-12-31',90,'再評価','2006-01-20 15:52:05','北鮎川AK-1のOn-1については、東鮎川AK-1のOn-1との導通が明らかであるため、一括して減退法評価に切り替えた。2003年にフローテストを実施した北鮎川On-3については、2004年の坑底圧測定結果により、独立したガス層である可能性が高まったため、単独の減退法で再評価を行った(下方修正)。西鮎川と新鮎川の女川層ドレライトについては、圧力導通が明らかである上に、増産後、順調に生産を続けているため、容積法評価において両坑井半径200mエリアを包絡線で繋いだ領域も新たに計上した。'),(503,41,'2004-12-31',50,'?','2006-01-20 15:52:37','推定鉱量としては、油層シミュレーションに前年度評価を踏襲する。しかしながら、1)坑底圧測定によって、北鮎川の油層と西鮎川の油層との導通性がアキファー部に限定されると解釈されること、2)新鮎川下層と北鮎川下層で地層水産出が認められたこと、からモデル変更が必要である。'),(504,43,'2004-12-31',90,'従来通り','2006-01-20 14:40:46','2003年末評価以降、圧力挙動・検層対比を見直した結果、上位層より?余目69ガス層、?余目49ガス層、?余目48油層、?余目53+55油層、の4つのグループに分けて評価している。SK-53は、生産挙動が従来評価の減退傾向よりも緩やかな減退を示しているため、若干の上方修正を行った。余目48油層、および、キャップガス部分については、2003年末評価の減退傾向に沿っていると判断し、前年度踏襲とした。'),(506,44,'2004-12-31',90,'従来通り','2006-01-20 14:41:40','2003年末評価において、地質スタディに沿ったグループ分けを行い、再評価を実施した。平成15年度に掘削されたSK-74については、2003年末評価と同じく、SK-13号井と同グループとした。ガス井・東部ブロックのいずれも、2003年末評価時の減退傾向に沿っていると判断し、前年度評価を踏襲した。中部ブロック油井群は、前年度評価の減退傾向よりも生産レートが高い状態で推移していることから、減退曲線のシフトによって若干の上方修正を行った。'),(508,28,'2004-12-31',90,'採収終了','2006-01-20 14:00:21','採収終了'),(510,29,'2004-12-31',90,'採収終了','2006-01-20 14:01:34','採収終了'),(512,105,'2004-12-31',90,NULL,'2007-03-08 16:37:30','・昨年より従来から認められていたB9とB5&B10のP/Z乖離を調査するため、B9を長期密閉し、替わりにB10の長期生産を実施した。その結果、下図に示すように乖離の幅が狭まるとともにB9については長期的P/Zトレンドである赤線を上回る値を示した。また、2004年度の測定ではB5,B9,B10共に紫線（OGIP2790MMm3）に収束しつつある。今までのP/Z推移を総合的に判断すると、B9とB5-B10という大きな２つの圧力Compartmentが示唆される。一方、現状の地質モデルをベースにしたシミュレーションも行われており、ここでもB9とB5-B10間に低浸透エリアの存在によって良好な圧力マッチングが得られている。また、現時点での３D震探解釈でもB9とB5-B10間に断層を解釈している。シミュレーションでは同様に水押しの影響に関するスタディも実施しており、あくまで暫定的だが今まで懸念されていた水押しの影響はさほど強くないという見解が得られた。\r\r\r\r・2004年末評価については現在1500m層を中心とした詳細なスタディを実施中であり、かつ水押しの可能性も未だ存在することから今回は確認鉱量ベースでは、昨年同様のB9　P/Zの長期トレンドである赤ラインの1830.7百万m3とした。総可採鉱量は、岩船沖油ガス田採算限界と評価された2013年末（2002年末評価では2011年末。2年延長になった）の累計生産量を計上しており、1202.4百万m3である。確認+推定ガス原始鉱量についても昨年同様に、現在GWCと想定している1900mまでの容積法評価値である2790百万m3とした。総可採鉱量は1925.8百万m3である。'),(514,106,'2004-12-31',90,'従来通り','2006-01-20 16:30:34','・1994年末にガスの累計生産量が1993年末評価の容積法による総可採鉱量を上回った為、評価方法を減退曲線法に変更した。その後1999年末評価時には累計生産量が減退曲線法による総可採鉱量を上回るのは確実であったため、1999年末埋蔵量評価から数値モデルによって鉱量を算定することにした。2003年末評価もこの方法を踏襲する。\r\n・モデルは円筒格子型であり、密閉時の大きく且つ緩やかな圧力回復を表現するため浸透率がコンポジット型で弱い水押しを想定しており、ヒストリーマッチングは比較的良好である。2013年末までの累計生産量を総可採鉱量として計上している。\r\n・2004年度末評価では2007年以降にガスの増販を見込むため、B10の改層による減を見込んでいる。その結果、ガス総可採鉱量は124百万m3と前年比76百万m3となった。なお、本層については北MS-1の改層などにより生産を再開出来る可能性はあるものの今回は推定鉱量には見込まない。\r\n'),(518,107,'2004-12-31',90,'従来通り','2006-01-20 16:31:58','・2002年末評価時に、1600m層初のフルフィールド・シミュレーションモデルを作成し鉱量を評価していた。2003年5月1600m下層を対象層としたMS-B13を掘削したところ、掘削前予想と比べて有効層厚が23mも厚く、かつ水層と油層を遮断する役割を持つ泥岩があるなど当初予想より良好な地質状況であった。生産自体も良好で、2004年3月現在依然初日産110KL/Dを維持している。この様な諸変更を受けてシミュレーションモデルの変更を実施したところ、油原始鉱量で73.8千KLの増加となった。MS-B13も当初予想よりも着水時期が遅れる等の理由で油回収増加が見込まれる。\r\n・2003年末評価はこのシミュレーションモデルをベースに採算限界までのB5とB13の累計油生産量を総可採鉱量として計上した。総可採鉱量で273.8千KL、前年比+138.3千KLと評価された。\r\n・2004年末評価は既存モデルに生産履歴を追加してフォローアップを実施し、その予測を用いて埋蔵量の評価を行なっている。なお、前提条件として、B5の再開時期の1年延期、B13の油生産レート110KL/Dから130KL/Dへの変更を行なっている。この結果、総可採鉱量については、油は微増となったもののガスは40.1百万m3の減となった。\r\n'),(520,108,'2004-12-31',90,'従来通り','2006-01-20 16:32:54','・2002年末評価まではシミュレーションによる評価を実施していたが、1900m層も含めた既存油層の各坑井で明らかな減退傾向が認められること、現シミュレーションモデルには圧力、水マッチング等問題もあることから、2003年末評価より既存油層評価を減退曲線法に切り替えた。1900m層については評価方法を変更したものの油総可採鉱量前年比+1.5千KLとほとんど評価結果に変化はない。\r\n・2004年度評価も既存モデルに生産履歴を追加してフォローアップを実施し、その予測を用いて減退曲線法による評価を行なっており、評価自体に大きな変化はない。ただし、確認＋推定鉱量でこれまでBI1Sを2007年より1200m層に改層するものとしていたが、現状の方針に基づいて、2007年以降も2050m層とコミングルで生産を継続するものとした。\r\n'),(522,109,'2004-12-31',90,'従来通り','2006-01-20 16:33:59','・2000m層については2003年末評価より減退曲線法に評価方法を変更した。構造頂部のB4Sは二次ガスキャップの温存から長期密閉していたが、2002年11月から長期フローテストを実施しており、当初は油レート50KL/Dで生産を継続していた。またGORは当初、1,000程度あったものが180以下に低下したものの昨年5月に油生産量を７５KL/Dに生産量を増やした所、GORが200を越える程度まで増加したため、油生産量を３０KL/Dに抑制し、生産を継続している。\r\n・2004年末評価はB4Sについても減退傾向が認められたため、減退曲線法にて評価している。また、B2S及びB3Sについては圧入候補井であるため、2004年評価から鉱量を見込まないこととした。その結果、油総可採鉱量は962.2千KLと前年度に較べて38.6千KLの減となった。\r\n'),(524,110,'2004-12-31',90,'従来通り','2006-01-20 16:34:38','2004年末評価については評価方法に変更なし。確認＋推定鉱量でこれまでBI1Sを2007年より1200m層に改層するものとしていたが、現状の方針に基づいて、2007年以降も1900m層とコミングルで生産を継続するものとした。'),(526,111,'2004-12-31',90,'従来通り','2006-01-20 16:35:36','・2100m層についても2003年末評価より減退曲線法に評価を変更した。それまで50KL/Dの生産調整をしていたB6Lも幹線圧力に到達し減退が認められたため、長期密閉中のB4Lを除く4坑井で減退曲線法を採用した。確認鉱量は引き続きB4Lの長期密閉を仮定している。\r\n・2004年末評価については現在確認スタディを実施していることから確認鉱量及び確認＋推定鉱量ともに昨年度評価を踏襲することとした。\r\n'),(530,112,'2004-12-31',90,'従来通り','2006-01-20 16:39:10','・椎谷層2800m層は2900m層優先採収のため2002/8以降長期密閉している。2002年末評価では、確認鉱量はJIS規格に準拠し容積法で計上している。但し、ガス回収率は水押しを考慮し50%とし、探査半径はBUC探査半径の573ｍとしている。確認+推定鉱量では、P/Zによりガス原始鉱量を239.2百万M3と評価し、回収率は50%と想定している（実際は採算限界中の層変更により回収率は37.9%にとどまる）。\r\n・2003年末評価では新規生産データ追加は無いもののBUC探査半径に基づく容積法評価の評価精度を疑問視し、確認鉱量としてガス生産レートの減退に基づく減退曲線法に変更した。これによってガス総可採鉱量は前年比-7.0百万m3になった。確認＋推定鉱量は基本的に昨年評価を踏襲しているが、初期GOR、コンデンセートガス係数他物性値の見直しからガス原始鉱量が239.2→227.5百万m3に変更になった。採算限界が2023年末に延長になったことにより取り残しが解消され回収率も想定された50%を満足する結果になった。\r\n・2004年末評価は2003年評価を踏襲する。\r\n'),(534,113,'2004-12-31',90,'従来通り','2006-01-20 16:40:52','・2003年末評価では2800m層同様BUC探査半径に基づく容積法評価の評価精度を疑問視し、確認鉱量としてP/Z初期3点データを使用した物質収支法に変更した。これによってガス原始鉱量は135.8百万m3、回収率は昨年同様50％を想定し、ガス総可採鉱量が前年比+10.0百万m3になった。確認＋推定鉱量は基本的に昨年評価を踏襲しているが、初期GOR、コンデンセートガス係数他物性値の見直しからガス原始鉱量が332.8→322.6百万m3に変更になった。今年密閉坑底圧力測定を実施したが、水押しの懸念も示唆されることから今後も定期的な圧力測定を行い評価のアップデートをする必要がある。なお、採算限界が2023年末に延長になったことにより取り残しが解消され回収率も想定された50%を満足する結果になった。\r\n・2004年末評価では12月末時点でガス累計生産量が67.1百万m3となり、昨年度評価を超えることが確実となったことから推定考量を確認鉱量にランクアップした。その結果ガスの総可採鉱量は161.1百万m3となり前年比＋93百万m3となった。\r\n'),(550,144,'2004-12-31',90,'層別評価⇒グリーンタフ一括評価','2006-01-18 16:33:28','これまで片貝地域のグリーンタフ層（G0〜G5層）はその鉱量評価を層別に行ってきた。しかし片貝SK-8をはじめ、他のグリーンタフ層坑井についても、差の大小はあるがG3坑井の生産に伴う密閉坑底圧の低下が観測されていることから、平成15年シミュレーションスタディでは片貝深部グリーンタフ（G0〜G5）の一括評価が実施された。\r\nH15スタディにて構築された地質モデルのうち、2004年に北片貝SK-1が着水するよう端水レベルを浅く設定したモデル（GWC:-4660m）によるシミュレーション結果は、H15年末評価では確認＋推定鉱量として計上された。またH16年末評価では早期着水モデルによる評価結果を確認鉱量にランクアップし、端水レベルを恣意的に操作していない（GWC:-4850m）モデルによる評価結果（20リアライゼーションのP50）を確認＋推定鉱量に計上した。\r\n\r\nG3坑井の生産挙動は安定しており特に変化は見られない。北片貝SK1の坑底圧力は平成13年2月22日に密閉後（同年4月測定時から同年12月まで）、密閉坑底圧力は約2MPa上昇している。\r\nまた、水分析結果については、Cl-濃度は50〜100mg/L程度であり現在のところ着水の傾向は確認されていない。（平成15年5月に測定した北片貝SK1のCl-濃度のみ290mg/Lと高かく、その後の測定値は通常の50mg/L程度に戻った。継続的な測定は必要）\r\n'),(551,144,'2004-12-31',50,'？','2006-01-18 17:17:09','H15年に片貝深部グリーンタフ（G0〜G5一括、GXは除く）についてシミュレーションスタディを実施し、同年末評価ではGWC深度を浅めに設定し着水を早めたモデルによるシミュレーション結果（北片貝SK-1自噴停止＠2005）を確認＋推定鉱量として計上した。\r\nH16年末評価ではH15年末評価における確認＋推定鉱量を確認鉱量へ計上し、GWC深度を恣意的に操作していないモデル（20リアライゼーション）によるシミュレーション結果（P50値）を確認＋推定鉱量として計上した。'),(554,1,'2005-12-31',90,NULL,'2008-01-10 17:42:53','こんな古い日付の解説は今と なっては誰も入力してくれないでしょう。シクシク (;o;)'),(555,1,'2005-12-31',50,NULL,'2008-01-10 17:42:53',''),(556,94,'2005-12-31',90,NULL,'2007-02-22 17:34:56','　平成9年、帝石との共同で「吉井・東柏崎スタディ」が実施され、Case1_toc30が平成13年末評価まで埋蔵量に採用されていた。Case1_toc30は、当社が平成8年の中長期計画に基づき生産した場合で、かつ帝石が今後コンプレッサーの能力を30万m3/Dまで増強すると仮定したケースである。\r同ケースの生産予測では、当社の生産は2046年まで継続可能であるが現時点では１ブロックの水の付きかたについてのデータが無く、着水後の生産予測には不確定要素が含まれている。この為、確認鉱量としては帝石生産終了時点（2020年3月）までを計上し、その後の当社生産終了時までの生産量を推定鉱量と位置付けてきた。\r　平成14年にフォローアップ（これまで使用してきたモデルに対し岩相ユニットCへLGR採用、北東側へ水層追加）を実施し、圧力・着水状況マッチング改善。\r将来予測の条件として、現状に合わせるためTOC昇圧能力を30万→15万へ変更、当社の生産プログラムを平成14年の中長期計画へ刷新した。\r修正後のモデルを用いた将来予測結果は、前回評価値よりも確認＋推定で+5.3億m3(+4.0%)、確認で+3.3億m3(+2.8%)の修正となった。\r　平成16年、2D震探再解釈を取り入れ、片貝で実績をあげた多点法Geostatisticsにより新油層モデル作成を作成し、現在再評価を実施中である。\r\r※ 平成11年にフォローアップが実施時のマッチング状況は以下のとおりである。\r・	?ブロック(全坑井)及び?ブロック(SK7)の水産出状況、\r   →LGR採用により、仲通り地区・吉井SK8を除く?ブロックの着水状況再現\r・	?ブロック(1999年以降全坑井)及び?プロック(安田3,4)のGOR\r   →?プロック(安田3,4)のGOR再現できていない（平成14年フォローアップの対象から除いた）\r・	?ブロックの圧力低めに推移\r   →北東水層追加により、圧力推移再現\r'),(557,94,'2005-12-31',50,NULL,'2007-02-16 16:52:03','（「確認」に同じく？）'),(558,55,'2005-12-31',90,NULL,'2007-02-19 16:02:23','平成5年に平成4年末までの圧入実績を基に、昭和62年のガス圧入スタディ(GASP3) の Followup スタディを GASP3 （水押しを考慮したタンクモデル）で実施している。平成15年にVIPモデルを試作したが今後詳細につめていくこととし、総可採鉱量は昭和62年度評価を踏襲した。\rなお、圧入ガスの回収率は100%としており、再生産ガスは全て圧入ガスから成るものとしている。\r平成17年中に累計再生産量が累計圧入量を上回り、一次可採鉱量よりガス5.9MMm3を生産した。\r'),(559,56,'2005-12-31',90,NULL,'2007-02-19 16:07:53','平成5年に平成4年度末までの圧入実績を基に、昭和62年のガス圧入スタディ(VIP) の Followup スタディを VIP で実施したが、前回モデルを修正する必要がなかったため、総可採鉱量は 昭和62年評価を踏襲した。\r\rなお、圧入ガスの回収率は100%としており、再生産ガスは全て圧入ガスから成るものとしている。'),(560,57,'2005-12-31',90,NULL,'2007-02-19 16:51:53','これまでガスの確認鉱量については、坑井別の減退曲線法（SK-22下＠昭和59年末評価、SK-23＠平成元年末評価）による評価結果が、油については層全体の一括評価結果（評価方法は不明）が採用されてきた。平成16年末評価では、平成17年中にSK-23累計ガス生産量が確認鉱量を上回ることが予想されたため、同坑井の鉱量見直しを行うとともに油の鉱量を坑井別評価に変更した。\r\rまたSK-23はこれまで自噴線内ハイドレート生成トラブルのため冬季は生産できない状況であったが、平成16年にラインヒーターを設置し通年採収が可能となった。'),(561,70,'2005-12-31',90,NULL,'2007-02-19 17:20:04','本層で唯一の採収井であるMS-24改は、現状で安定採収が困難なため平成11年のフローテストを最後に密閉中である。生産状況の改善には技術的不確実性が存在すると考えられ、H13年末評価時計上法の変更により前年度まで推定鉱量として計上していた可採鉱量を条件付資源量と位置付け、確認鉱量は従来通り実績分を計上する。\r'),(562,77,'2005-12-31',90,NULL,'2007-08-22 15:09:47','下記により大幅に変更となった。\n①  3D Seismic による再解釈\n②  定義域の変更（容積法における確認、推定鉱量領域の変更）\n③  回収率の変更\n仕上げ層が変わった坑井は以下のとおり。\nMS-29　（上）2900A/（下）2900A3　?＞　（上）2900A/（下）2900A\nMS-36　　2900A3＋2900A4　?＞　2900A＋2900A3＋2900A4\nMS-37　　2900A3＋2900A4　?＞　2900A＋2900A3＋2900A4'),(563,78,'2005-12-31',90,NULL,'2007-02-22 15:31:00','以下に伴って、鉱量が大幅に変更となった。\r?  3D Seismicによる再解釈\r?  定義域の変更（容積法における確認、推定鉱量領域の変更）\r?  回収率の変更\r仕上げ層が変わった坑井は以下のとおり。\rMS-29　（上）2900A/（下）2900A3　?＞　（上）2900A/（下）2900A\rMS-36　　2900A3＋2900A4　?＞　2900A＋2900A3＋2900A4\rMS-37　　2900A3＋2900A4　?＞　2900A＋2900A3＋2900A4\r'),(564,79,'2005-12-31',90,NULL,'2007-02-22 15:34:21','以下に伴い、鉱量が変更となった。\r?  3D Seismicによる再解釈\r?  定義域の変更（容積法における確認、推定鉱量領域の変更）\r?  回収率の変更\r仕上げ層が変わった坑井は以下のとおり。\rMS-29　（上）2900A/（下）2900A3　?＞　（上）2900A/（下）2900A\rMS-36　　2900A3＋2900A4　?＞　2900A＋2900A3＋2900A4\rMS-37　　2900A3＋2900A4　?＞　2900A＋2900A3＋2900A4\r'),(565,86,'2005-12-31',90,NULL,'2007-02-22 17:00:55','平成10年末までの見附油田の鉱量評価は、鉱山自体での採算限界は既に過ぎているため全層一括の減退曲線から得られる次年度末迄の累計量を総可採鉱量として計上してきた。\r\rしかし、平成11年末評価時点で当面廃山が計画されていなかったことから、平成11年末評価より生産量の比較的多いSK-4、SK-29、SK-40について個別に減退曲線法による評価を行い、その他の坑井については生産量が極めて少ないため実績分を計上し、可採鉱量は見込んでいない。\r\r周辺地域の宅地化進行のため、平成15年度にAU基地のSK-29、SK-31、F基地のSK-21について廃坑作業を実施。SK-40の坑口圧力はほぼ下流ライン圧まで減退していることから、平成15年末評価より従来の減退曲線法（坑口圧力）による評価から実績計上に変更した。この結果、見附坑井は全て実績計上となった。'),(566,144,'2005-12-31',90,NULL,'2007-02-26 15:21:00','これまで片貝地域のグリーンタフ層（G0〜G5層）はその鉱量評価を層別に行ってきた。しかし片貝SK-8をはじめ、他のグリーンタフ層坑井についても、差の大小はあるがG3坑井の生産に伴う密閉坑底圧の低下が観測されていることから、平成15年シミュレーションスタディでは片貝深部グリーンタフ（G0〜G5）の一括評価が実施された。\r\rH15スタディにて構築された地質モデルのうち、2004年に北片貝SK-1が着水するよう端水レベルを浅く設定したモデル（GWC:-4660m）によるシミュレーション結果は、H15年末評価では確認＋推定鉱量として計上された。またH16年末評価では早期着水モデルによる評価結果を確認鉱量にランクアップし、端水レベルを恣意的に操作していない（GWC:-4850m）モデルによる評価結果（20リアライゼーションのP50）を確認＋推定鉱量に計上した。\r\rG3坑井の生産挙動は安定しており特に変化は見られない。北片貝SK1の坑底圧力は平成13年2月22日に密閉後（同年4月測定時から同年12月まで）、密閉坑底圧力は約2MPa上昇している。\r\rまた、水分析結果については、Cl-濃度は50〜100mg/L程度であり現在のところ着水の傾向は確認されていない。（平成15年5月に測定した北片貝SK1のCl-濃度のみ290mg/Lと高かく、その後の測定値は通常の50mg/L程度に戻った。継続的な測定は必要）'),(567,144,'2005-12-31',50,NULL,'2007-02-26 15:21:00','H15年に片貝深部グリーンタフ（G0〜G5一括、GXは除く）についてシミュレーションスタディを実施し、同年末評価ではGWC深度を浅めに設定し着水を早めたモデルによるシミュレーション結果（北片貝SK-1自噴停止＠2005）を確認＋推定鉱量として計上した。\r\rH16年末評価ではH15年末評価における確認＋推定鉱量を確認鉱量へ計上し、GWC深度を恣意的に操作していないモデル（20リアライゼーション）によるシミュレーション結果（P50値）を確認＋推定鉱量として計上した。'),(568,83,'2005-12-31',90,NULL,'2007-02-26 15:34:49','平成13年3月に本井3200m層へスルーチュービング・パーフォレーションを実施し、地上配管内でハイドレートを生成しない夏期のみ、現在同坑井で採収中の3400m層とのコミングル採収を開始した。\rコミングルガス生産量は3,000m3/Dにも満たないほど微量であり、H18年度にMS-22の2900ｍD層への改層が予定されているため、本年度の評価では鉱量を修正した。\r'),(569,148,'2005-12-31',50,NULL,'2007-02-26 16:09:37','1997年に見附油田改修・改層スタディが実施され、当該層に改修対象となる鉱量が残されている可能性が示唆された。昨年、9月末から10月初にSK-3の改層作業が行われたが、まとまった生産量を見込めないため、同鉱量を推定鉱量から除くこととする。'),(570,77,'2005-12-31',50,NULL,'2007-02-26 16:20:58','下記により大幅に変更となった。\r?  3D Seismic による再解釈\r?  定義域の変更（容積法における確認、推定鉱量領域の変更）\r?  回収率の変更\r'),(571,78,'2005-12-31',50,NULL,'2007-02-26 16:20:17','以下に伴って、鉱量が大幅に変更となった。\r?  3D Seismicによる再解釈\r?  定義域の変更（容積法における確認、推定鉱量領域の変更）\r?  回収率の変更'),(572,79,'2005-12-31',50,NULL,'2007-02-26 16:22:49','以下に伴い、鉱量が変更となった。\r?  3D Seismicによる再解釈\r?  定義域の変更（容積法における確認、推定鉱量領域の変更）\r?  回収率の変更\r'),(573,3,'2005-12-31',90,NULL,'2007-02-26 17:33:16','SK-26、W-3は累計生産量が前年評価の鉱量を超えたため、鉱量の上方修正を行った。SK-7とSK-27は、水攻効果によりほとんど減退傾向が認められなくなった。2005年中に累計生産量が総可採鉱量を超える見込みとなったため上方修正を行った。SK-70は、2004年より生産を再開し、1?2KL/Dのレートで間欠採収したが、CO2混入率が25%であるため、引き続き実績値計上とする。'),(574,4,'2005-12-31',90,NULL,'2007-02-27 10:21:33','水攻対象井のSK-37,38,40の3坑井はGLV不調のためガスリフト効果が低く密閉していたが、2005年4月より生産再開している。SK-37,38については、2005年中の生産実績からは減退傾向を見直すに足るデータは蓄積されていないため、平成14年末評価を踏襲した。SK-40と、その他の水攻対象井に関しては実績値(+生産予算)での計上としている。'),(575,6,'2005-12-31',90,NULL,'2007-02-27 10:25:47','平成15年末評価では、?層単独採収井であるSK-35,47については、生産レートが従来評価からずれて来たため、減退傾向を見直して修正を行い、?ab+?層採収井の鉱量については、SK-45とその他の坑井に分け再評価を行った。SK-47は前年度踏襲としたが、SK-35は従来評価の減退傾向を上回るレートで推移しているため上方修正した。SK-45は生産レート低下･水量率上昇が確認されたため大幅な下方修正となった。 '),(576,156,'2005-12-31',90,NULL,'2007-02-27 15:09:19','  DEブロックは、2003年末評価まで、水平断層に区切られた上下ブロックに分割して鉱量評価を実施してきた。しかしながら、下ブロックからの水圧入開始後の圧力挙動から、両ブロックの導通が指摘されていた。また、2004年には、SK-83, 84, 85の3坑の水平坑井が掘削され、圧力測定結果から、従来考えられていた最北部ブロックのGブロックまで、DEブロックと導通している可能性が高いことが判明した。これを機に、2004年末評価より、｢北部DEブロックI+II+III層｣という呼称で、上下ブロックとGブロックまでを全て含める同一グループとして扱っている。\r  新規掘削されたSK-83H1号井は、高い生産能力を示したものの、SK-82Hの生産能力が半減した。坑井能力は、周辺坑井の生産状況に依存することが明らかになったため、坑井ごとの評価ではなく、全坑井を一括して減退曲線法を適用し、確認鉱量として計上した。また、推定鉱量として、3坑井掘削後の構造解釈見直しによる鉱量評価値(容積法)を計上している。\r  2005年中の本ブロック坑井の生産量は、概ね2004年末評価の減退傾向に沿っており、前年度評価を踏襲する。'),(577,11,'2005-12-31',90,NULL,'2007-02-27 17:20:04','本層の坑井は全て合同採収井なので、全生産層の鉱量を層別振り分けファクターで各層に配分している。但しSK-13は既に?層分の鉱量を打ち切っており、生産量は全量本層の配分となっている。SK-75, 76S, 81は、従来の減退傾向を上回るレートで生産しているため、若干の上方修正を行った。SK-13は2004年末評価の総可採を累計生産量が上回ったものの、2005年12月に自噴停止に陥った。2006年2月現在、ガスリフト採収を再開しているが、生産レートが不安定であることから実績値計上とした。SK-74も従来通り実績値計上とする。 '),(578,12,'2005-12-31',90,NULL,'2007-02-27 17:23:21','本層の坑井はSK-73を除いて全て合同採収井なので、それぞれ層別振り分けファクターを使って各層に配分している。SK-73以外は全て?層との合同採収井であるので、詳細は?層鉱量評価の項を参照のこと。また従来確認鉱量にしてきたSK-77の未仕上げ分は平成11年末評価より推定鉱量に移している。'),(579,13,'2005-12-31',90,NULL,'2007-02-27 17:24:54','本層に属する坑井は、全て合同採収井であることから、鉱量評価を採収層合同で実施し、層別振り分けファクターを用いて各層に振り分けている。 SK-72は平成11年末より実績値で計上している。SK-76L,78Sは減退曲線法で評価してきたが、76Lは平成16年末評価の総可採を累計が上回ったため、減退曲線の見直しを行った。78Sについても、平成16年末評価の総可採と累計量の差が約50KLになったため、減退曲線の見直しを行った。'),(580,15,'2005-12-31',90,NULL,'2007-02-27 17:28:39','SK-77は平成16年1月29日?2月15日に生産を実施したものの、生産レート(0.5KL/D)は従来の予測よりも減退が進んでいると判断された。2005年は2月より連続生産をしている。単計時に安定したレートは得られていないが、無視出来ない生産量になってきたため、実績値評価から減退曲線法に切り替えた。\rSK-78Lは連続生産をしているが、少量のため従来通り実績値(+生産予算)による評価とした。\r'),(581,16,'2005-12-31',90,NULL,'2007-02-27 17:31:44','SK-77は平成16年1月29日?2月15日に生産を実施したものの、生産レート(0.5KL/D)は従来の予測よりも減退が進んでいると判断された。2005年は2月より連続生産をしている。単計時に安定したレートは得られていないが、無視出来ない生産量になってきたため、実績値評価から減退曲線法に切り替えた。'),(582,18,'2005-12-31',90,NULL,'2007-02-27 17:34:54','北部集中の合理化方針に従って、2004年をもって採収終了した。SK-12号井を最後に全坑井廃坑された。'),(583,19,'2005-12-31',90,NULL,'2007-02-28 09:56:51','SK-21は前回の減退曲線法による評価を累計生産量が上回る見込みのため、減退曲線の見直しを行った。SK-22は再度TBGパンチを実施したが少量の生産に止まった。SK-23は順調に生産を続けており、従来の減退傾向を上回るレートで推移していることから上方修正を行った。'),(584,20,'2005-12-31',90,NULL,'2007-02-28 09:59:37','SK-2は平成7年7月にポンピング採油を開始して以来、順調に稼動していた。平成15年12月から水量率、GORの上昇傾向し、油生産レートも1kl/Dを切っている。SK-3は近年安定して生産を続けており、従来評価の減退傾向を上回る生産レートを維持している。2006年中に。累計生産量が総可採を上回る可能性があることから、若干の上方修正を行った。'),(585,21,'2005-12-31',90,NULL,'2007-02-28 10:02:23','従来、本ブロックはブロック全体の減退傾向で評価していたが、平成11年末より坑井ごとの減退による評価に切り替えている。SK-6については、水量率による従来評価を踏襲した。SK-10は、’03年10月以降GOR上昇がみられるため、GOR=1,000を限界とする減退曲線法に評価方法を変更したが、2005年は上昇傾向が緩やかになってきたため、再評価を行った。SK-11、SK-4についても、2003年末評価の減退傾向よりも緩やかになってきたことから、減退傾向を、見直しして若干の上方修正を行った。'),(586,22,'2005-12-31',90,NULL,'2007-02-28 10:04:55','本層の評価は、ガスキャップ部の鉱量を物質収支法、リングオイル部の鉱量をSK-8の減退曲線を用いて算定してきた。リングオイル部のSK-8については従来評価の減退傾向に概ね沿っているため、従来評価を踏襲する。SK-9はガスの需給調整井として使われており、現在のところ緩やかな減退しか認められていないことから、昭和51年評価の物質収支法による値を踏襲する。'),(587,34,'2005-12-31',90,NULL,'2007-03-01 16:58:35','SK-1、SK-2は採収を終了し、圧入井に転用済。SK-4、SK-7については自噴不調となった後、長期密閉となっており、鉱量は計上しない。SK-5は圧力の回復を待って開放するサイクル採収を行っていたが、2000年10月以降、圧力の回復が以前よりも小さくなり、長期に密閉しても改善が望めないため、2000年末から鉱量を計上していない。\r本層は平成17年中の生産実績がないため、前年評価を踏襲した。\r'),(588,36,'2005-12-31',90,NULL,'2007-03-01 17:02:14','  SK-14はGWRの低下傾向を用いて評価してきたが、2004年中に累計生産量が従来評価の総可採鉱量を超えたため、最近のGWRの傾向から、採収限界GWRをSK-10の自噴停止時の実績である2000m3/KLとして鉱量を再評価した。\r  SK-10は自噴停止となり、再生産テストでも水のみの産出となったため、2002年末評価以降、実績値計上となっている。2004年中は水圧入テストを実施した。\r  南鮎川AK-1, 中鮎川SK-1については、DST時の実績のみ計上した。\r'),(589,37,'2005-12-31',90,NULL,'2007-03-01 17:05:10','平成12年末よりA層全体での物質収支法による評価を開始していた。しかしながら、各坑井の貯留層圧力の幅が大きく、東由利原AK-1のように連続生産が不可能な坑井も存在する。2003年末評価では、密閉後の回復した坑口圧力値を利用した、坑井ごとの減退曲線法によって再評価を行った。SK-8, 北由利原AK-1, 東由利原AK-1の坑口圧は、前回評価の減退傾向をやや上回っているが、見直しに足るデータ量が蓄積されているわけではないため、前年度踏襲とした。SK-9S/Sについては水没したと判断されることから、実績値計上に切り替える。 '),(590,38,'2005-12-31',90,NULL,'2007-03-01 17:07:50','  2004年1月?3月に、ガス需給対応のため、SK-12で連続生産を実施した(ガス約100万m3)。この間、南鮎川のPs変化は約3kscで、両坑井の導通性が確認された。南鮎川は2004年7月の酸処理によって、生産レートが大幅に改善された(約80KL/D→約170KL/D)。当面、南鮎川を連続生産し、中鮎川で圧力を監視して、両坑井間の導通性をみる予定である。\r  2005年末評価においては、南鮎川AK-1において累計生産量が総可採鉱量を上回ったため、中鮎川の容積法エリアと包落線で結んだ領域を確認鉱量のエリアとして計上した。また、SK-12の容積法領域をこれまでの南鮎川、中鮎川と同じく半径200mに統一した。GORは累計実績を採用した。\r  今後、圧力データの収集に努め、流動シミュレーションに着手して行きたい。\r'),(591,39,'2005-12-31',90,NULL,'2007-03-01 17:10:05','2004年中に東由利原AK-1, SK-9でフローテストを実施し、生産能力の確認を行った。\r2005年中は、SK-9で約2ヶ月間生産を実施したものの、従来評価を変更するに足るデータは蓄積されていないと判断し、前年評価を踏襲した。\rSK-17DHは実績値のみ計上する。\r'),(592,40,'2005-12-31',90,NULL,'2007-03-01 17:12:39','南鮎川AK-1では、2004年7月に酸処理を実施したが、生産性は改善しなかった。SK-17DHは、100KL/Dの油レートを記録したが、水量率が30%程度付いたため、適正レートを確定するに至っていない。その他の既存坑井について、SK-12, SK-16DHにおいて2006年中に累計生産量が総可採鉱量を上回ると見込まれるため、直近の値を含めた減退曲線を引きなおし、総可採鉱量を修正した。'),(593,149,'2005-12-31',90,NULL,'2007-03-02 14:59:33','低生産性のため、生産せず。TBG内にPlugをセット済み。'),(594,41,'2005-12-31',90,NULL,'2007-03-02 15:21:52','北鮎川（On-57層）は2004年11月の増産以来、約40KL/Dの連続生産を実施している。地層水の産出は見られるもののWCは安定傾向にあり、また油生産レート、坑口圧に減退は見られない。現在のレートでの生産が続いた場合、2006年中に累計生産量が総可採鉱量を超過すると見込まれるが、減退傾向は見えずまた容積法のパラメータも見直す余地がないことから、シミュレーションにおける北鮎川（On57層）が水没するまで（2007年9月）の累計生産量を確認総可採鉱量として計上した。他坑井については前年度評価を踏襲している。'),(595,41,'2005-12-31',50,NULL,'2007-03-02 15:21:52','推定鉱量としては、1) 坑底圧測定によって、北鮎川の油層と西鮎川の油層との導通性がアキファー部に限定されると解釈されること、2) 新鮎川下層と北鮎川下層で地層水産出が認められたこと、からモデルを一部変更しヒストリーマッチングを行ったところ、おおむね良好なマッチングを示したため評価を見直した。'),(596,43,'2005-12-31',90,NULL,'2007-03-02 15:32:40','2003年末評価以降、圧力挙動・検層対比を見直した結果、上位層より?余目69ガス層、?余目49ガス層、?余目48油層、?余目53+55油層、の4つのグループに分けて評価している。SK-53は、生産挙動が従来評価の減退傾向よりも緩やかな減退を示しているため、若干の上方修正を行った。キャップガス部分については、2003年末評価の減退傾向に沿っていると判断し、前年度踏襲とした。余目48油層、および、余目53+55油層については、最近の減退傾向を見直して上方修正を行った。'),(597,44,'2005-12-31',90,NULL,'2007-03-02 15:34:16','2003年末評価において、地質スタディに沿ったグループ分けを行い、再評価を実施した。中部ブロック油井群･ガス井･東部ブロックのいずれも、前年度評価の減退傾向よりも生産レートが高い状態で推移していることから、減退率の変更はせずに減退曲線のシフトによって若干の上方修正を行った。'),(598,46,'2005-12-31',90,NULL,'2007-03-02 15:36:31','昨年度、平成13年?14年に実施したSK-4の産出テストにより、減退傾向の把握が出来たため、減退曲線法により鉱量評価を実施した。2002年9月以降はビーンサイズ1.5mmで操業を続けており、生産レートの減退傾向が微小で圧力減退も認められないことから、水押しの影響を受けていると考えられる。レート自体は減退曲線を上回るものではないため、確認鉱量評価値は前年度踏襲とするが、容積法による評価値(1991年時点)を推定鉱量として再計上する。'),(599,46,'2005-12-31',50,NULL,'2007-03-02 15:36:31','容積法による評価値(1991年時点)を推定鉱量として再計上する。'),(600,104,'2005-12-31',90,NULL,'2007-03-06 16:04:18','  2003/2に北MS-1を改修しフローテストを行ったところ、予想に反して1200m3/d程度の産ガス状況であった。BUC解析の結果非常に低浸透性のガス層と評価された。しかし、400m程度しか離れていないSIM-4ではAOFC160,000m3/dの比較的高浸透性ガス層の評価がなされており判断は未だ難しい。\r  この様な結果を受けて2003年末評価では、確認鉱量は今後実績計上とし、確認＋推定鉱量については1200m層全域の地質状況（特に砂の連続性）がよくわかっていないことからMS-1の結果を反映させず昨年評価を踏襲している。\r  2005年末評価では確認鉱量については従来通り実績計上とした。06年度SIM-B1を改層予定であることから、推定鉱量については容積法で求められた原始鉱量を基にSIM-2と同等の生産能力を仮定しタンクモデルによる評価を実施した。\r'),(601,150,'2005-12-31',90,NULL,'2007-03-08 16:35:06','   2003/2に北MS-1を改修しフローテストを行ったところ、予想に反してWHP 0.06MPA, ガス2800m3/d程度の産ガス状況であった。北MS-1は1,500m層への改層が計画されており、今後生産が見込まれないことから、2005年評価では確認鉱量および確認＋推定鉱量共に実績計上とする。'),(602,150,'2005-12-31',50,NULL,'2007-03-08 16:35:06','北MS-1は1,500m層への改層が計画されており、今後生産が見込まれないことから、2005年評価では確認鉱量および確認＋推定鉱量共に実績計上とする。'),(603,105,'2005-12-31',90,NULL,'2007-03-08 16:41:59','   従来から認められていたB9とB5&B10のP/Z乖離は導通性調査の結果、地域的な不均質性（断層の可能性を含む）の影響であるとの結論に至った。04年度には旧地質モデルをベースにしたシミュレーションが行われており、ここでもB9とB5-B10間に低浸透エリアを存在させることで良好な圧力マッチングが得られている。３D震探解釈でもB9とB5-B10間に断層が解釈されており整合的である。また、シミュレーションによる水押しの影響に関する検討が実施されており、懸念されていた水押しの影響はさほど強くないという見解が得られている。05年に実施された詳細なスタディでも同様の結果が得られており、シミュレーション法から予測されるOGIPは26?30億m3を示している。\r   しかし、05年モデルは砂岩の連続性について未だ疑問点が指摘されている。07年には問題とされている地域内に南西MS-1の掘削が予定されており、かつ西MS-1・北MS-1の改修で1,500m層の追加データが得られる予定であることから、その結果を受けてシミュレーションモデルの採用を判断するものとする。この為、05年評価は前年踏襲とする。\r   2005年評価では、昨年同様にB9　P/Zの長期トレンドであるOGIP1830.7百万m3を確認鉱量(1P)のベース、全坑井のP/Zが収束してきたトレンドであるOGIP2786.1百万m3を確認＋推定（2P）のベースとして採用した。'),(604,106,'2005-12-31',90,NULL,'2007-03-08 16:54:50','   99年末埋蔵量評価から数値モデルが採用されている。モデルは円筒格子型であり、密閉時の大きく且つ緩やかな圧力回復を表現するため浸透率がコンポジット型で弱い水押しを想定しており、ヒストリーマッチングは比較的良好である。採算限界である2010年末までの累計生産量を総可採鉱量として計上している。\r   岩船沖のガス増販計画に伴い、需給を満たす為にB10は1500m層を優先的に採収する必要がある。従って05年評価では採算限界の2010年までには生産を再開できない状況となっており、05年の確認可採鉱量はゼロ評価となる。\r   なお、本層については北MS-1、西MS-1の改層により生産を再開出来る可能性はあるものの同2坑井の能力でB10を代替できるか不確実性が見込まれる為、確認鉱量には見込まない。確認+推定鉱量では、短期間ではあるが生産可能であることから鉱量を見込んでいる。\r   現在の販売計画下では1,500m層の代替坑井を確保しなければ取り残し鉱量が発生する状況となっている。\r'),(605,107,'2005-12-31',90,NULL,'2007-03-08 16:57:43','   2002年に1600m層のフルフィールド・シミュレーションモデルを作成し鉱量評価を実施。2003年5月1600m下層を対象層としたMS-B13を掘削したところ、掘削前予想と比べて有効層厚が23mも厚く、かつ水層と油層を遮断する役割を持つ泥岩があるなど当初予想より良好な地質状況であった。B13掘削後のデータを追加しモデルの変更を実施したところ、油原始鉱量で73.8千KLの増加となった。MS-B13も当初予想よりも着水時期が遅れる等の理由で油回収増加が見込まれる。\r   2005年末評価は既存モデルに生産履歴を追加し、B13の生産状況（着水）をあわせるべくフォローアップを実施した。その結果、油原始鉱量で67.5千KLの増加となった。このモデルを用い埋蔵量の評価を行なっている。なお、ガス増販計画に伴いSIM-B5は1500m層を採収する為、06から07年にかけての11ヶ月間のみの生産となっている。SIM-B5の1500m層への改層および経済限界が2010年（1年前倒し）となったことから、確認鉱量および確認+推定鉱量のガス・油可採鉱量は大幅に減少することとなった。（油確認可採で42.3千KLの減少）\r   現在の販売計画下では1,500m層の代替坑井を確保しなければ取り残し鉱量が発生する状況となっている。\r'),(606,151,'2005-12-31',90,NULL,'2007-03-08 17:36:54','   2003/2に北MS-1を改修しフローテストを行ったところ、予想に反してWHP 0.03MPA, 油4.8 KL/D程度の産油状況であった。北MS-1は1,500m層への改層が計画されており、今後生産が見込まれないことから、2005年評価では確認鉱量および確認＋推定鉱量共に実績計上とする。'),(607,151,'2005-12-31',50,NULL,'2007-03-08 17:36:54','北MS-1は1,500m層への改層が計画されており、今後生産が見込まれないことから、2005年評価では確認鉱量および確認＋推定鉱量共に実績計上とする。'),(608,108,'2005-12-31',90,NULL,'2007-03-08 17:38:34','   2002年末評価まではシミュレーションによる評価を実施していたが、1900m層の各坑井で明らかな減退傾向が認められること、現シミュレーションモデルには圧力、水マッチング等問題もあることから、2003年末評価より評価を減退曲線法に切り替えた。2004年末には生産履歴を追加して減退曲線法による評価を行なっている。\r   減退傾向に変化が見られないことから、2005年末評価は昨年の減退曲線を踏襲した。但し、04年評価の際にB１SのGORを556m3/KLと評価していたが、この高GORは、その後の生産挙動から計量上の問題であることが判明した。従って本年の評価ではB1SのGORのみを108.6m3/KLに修正再評価した。これによりガスの総可採鉱量が若干減少することとなった。\r   SIM-BI1Sは、2007年に1200m層との2層仕上げに改修予定であるが、2007年以降も2050m層とコミングルで生産を継続するものとした。\r \r'),(609,114,'2005-12-31',90,NULL,'2007-03-08 17:40:37','   岩船沖油田北部砂岩層の広がりを確認するため、2000年度に北MS-1の探掘を実施した。既存エリアの1900m層及び2000m層に相当する砂岩層をテストした結果、油の産出が確認され両層を１ストリング２パッカーで仕上げを行い、2000/12/4に採収井に編入した。\r   2000m層はDST時点で50KL/Dの油生産量を確認したものの、排泥フローテストでは3KL/Dまで低下した。BUC解析によるとスキンが100以上と多大な坑井障害が認められた為、2001/3にフッ化水素酸による酸処理を実施した。酸処理の結果坑井障害は除去され油生産量も45KL/Dまで回復したものの生産が進むにつれて2ヶ月間で約20KL/Dまで低下していった。円筒形モデルによるシミュレーションの結果、坑井近傍半径100ｍポイントにTransmissibilityが周辺の15％であるバリアを設定することによって全てのパフォーマンスが再現可能になった。このスタディ結果は、コヒーレンス解釈によるMS-1周辺の微細断層の存在と調和的である。\r   2003/2に廃層。累計生産量を総可採鉱量として計上している。'),(610,109,'2005-12-31',90,NULL,'2007-03-08 17:43:26','   2003年末評価より減退曲線法による評価方法を採用している。構造頂部のB4Sは二次ガスキャップの温存から長期密閉していたが、2002年11月から開始し、油レート50KL/Dで生産を継続していた。またGORは当初、1,000m3/KL程度あったものの徐々に減少し180m3/KLに低下した。B2Sは2003/9、B3Sは2004/4に高水量率の為に生産を中止している。\r   2004年末評価では、既にB4Sに減退傾向が認められていたが、B2S及びB3Sの密閉によるB4Sの増油を期待して、03年評価の減退曲線の減退開始時期を1年遅らせて評価している。\r   しかし、その後もB2S及びB3S密閉の影響がB４Sに見られないことから2005年末評価では、05年末までの生産履歴を追加して減退曲線の見直しを実施した。その結果、油総可採鉱量は917.7千KLと前年度に較べて44.5千KLの減となった。\r'),(611,110,'2005-12-31',90,NULL,'2007-03-08 17:46:22','   2004年末評価は前年度踏襲。確認＋推定鉱量ではこれまでB1Sを2007年より1200m層に改層するものとしていたが、1200m層との同時仕上げの方針に基づき、2007年以降も1900m層とコミングルで生産を継続するものとした。\r   2005年末評価では、05年末までの生産履歴を追加して減退曲線の再評価を実施した。採算限界が2010年（1年前倒し）になった為、総可採鉱量が微減している。'),(612,111,'2005-12-31',90,NULL,'2007-03-09 10:53:39','   2003年末評価より長期密閉中のB4Lを除く4坑井で減退曲線法による評価を採用している。2004年末評価についてはスタディを実施中であることから確認鉱量及び確認＋推定鉱量ともに昨年度評価を踏襲している。しかし、03年末以降、B6L及びB8Lの着水傾向が顕著になっており着水以前の減退傾向（03年評価）を踏襲すると、04年末時点で既に実際の生産履歴と予測値が明らかに大きく乖離した状態となっている。着水後の生産履歴を追加した減退曲線で評価した場合、総可採鉱量は2220.3千KLであり、04年評価は95.4千KLの過大評価となっている。\r   また04年末評価は、確認+推定鉱量としてB４L開放ケースを想定し166.5千KLを計上している。しかし、04年6月?11月に実施したB4L長期フローテストで既に減退傾向が観測されており、B４Lの可採鉱量としては最大限見積もったとしても56千KL程度（実際は更に少ない）であることが判明している。この為、確認+推定総可採は最大でも2277.0千KL程度であると考えられ、04年評価は少なくとも237.0千KLの過大評価となっている。\r   2004年12月からガス圧入法のパイロットテストが開始され、顕著な増油が確認された。これを受けて2006年1月からIOR(ガス圧入)による操業を開始した。2005年評価ではIORによる二次増油分（68.6千KLの増）を見込み、確認総可採鉱量は2288.9千KLと評価されるが、上記理由により04年評価の確認総可採鉱量と比較すると26.8千KLの減少となる。\r'),(613,111,'2005-12-31',50,NULL,'2007-03-09 10:53:39','   2005年評価の確認+推定鉱量総可採にはIORによる増油（Loc-V掘削を含む）206.8千KLを見込み一次量と合わせ2427.8千KLを計上する。IORの増油（206.8千KL）からB4L開放分（56千KL）を引いた差分（150.8千KL）が少なくともIORによる増油になるが、04年評価が少なくとも237.0千KLの過大評価である為、05年評価は差し引き86.2千KLの減少となる。\r'),(614,112,'2005-12-31',90,NULL,'2007-03-09 12:12:42','   2800m層は2900m層の優先採収のため2002/8以降長期密閉している。2002年末評価では、確認鉱量はJIS規格に準拠し容積法で計上し、確認+推定鉱量では、P/Zによりガス原始鉱量を239.2百万M3と評価し計上していた。2003年末評価では確認鉱量としてガス生産レートの減退に基づく減退曲線法に変更した。確認＋推定鉱量は基本的に昨年評価を踏襲しているが、初期GOR、コンデンセートガス係数他物性値の見直しからガス原始鉱量が239.2→227.5百万m3に変更されている。2004年末評価は2003年評価と同じである。\r   06年1月の改修後実施されたフローテストにおいて03年評価で確認鉱量の根拠としていた減退傾向が見られず、減退法で予測された生産量より高いガスレートで安定した生産が可能であることが明らかとなった。この為、評価方法を減退曲線法から物質収支法へ変更した。\r'),(615,112,'2005-12-31',50,NULL,'2007-03-09 12:12:42','   2005年末評価では、03年評価の確認+推定鉱量を確認鉱量にランクアップさせた。また貯留層状態でのガス物性値見直しにより原始鉱量は227.5→230.7百万m3に変更になっている。確認+推定鉱量には長期密閉後の圧力のみを評価に用いたP/Z（ガス原始鉱量474.0百万M3）を採用する。2900ｍ層優先採収のため、経済限界までに生産再開できず、確認可採鉱量はゼロ評価となる。\r'),(616,155,'2005-12-31',90,NULL,'2007-03-09 16:15:11','   岩船沖油田の椎谷層砂岩の広がりを確認するため、2005年度に西MS-1の試掘を実施した。2800m層に相当する砂岩層をテストした結果、ガスの産出が確認され、2000/12/4に採収井に編入した。DST時点では60.7千m3/Dのガス生産量を確認したものの、排泥フローテスト後の圧力測定で貯留層圧力の顕著な低下が認められた。この為、2005/11/9から鉱量の調査を目的として長期フローテストを実施した。その結果、最終的にガス生産量が1600m3/Dまで減少し、かつ貯留層圧力も累計生産量の増加とともに低下していることが判明した。従って本層は砂の広がりが小さく、既存の2800m層とは別プールを形成していると判断された。\r   2005年末評価では、確認鉱量としてフローテスト期間中に測定された貯留層圧力（長期密閉のデータのみ）を使用し、物質収支法の評価を実施した。その結果、最大限見積もってもガス原始鉱量は6.0百万M3程度と評価された。また、Back Pressure testの結果から現在のAOFCは約25,000m3と予想され、安定的に連続生産できるレートは2000m3/D程度と考えられる。これは液体汲み上げに必要な最低ガスレートを大きく下回っており、いつ自噴停止してもおかしくない状況である。\r   07年に坑排水圧入井へ転用するが、改修を実施するまでに可能な限りの採収を行なうこととし確認可採鉱量を新規計上する。\r \r'),(617,113,'2005-12-31',90,NULL,'2007-03-09 16:37:03','   2003年末評価は確認鉱量としてP/Z初期3点データを使用した物質収支法を採用している。ガス原始鉱量は135.8百万m3、回収率は50％を採用した。確認＋推定鉱量は基本的に昨年評価を踏襲しているが、初期GOR、コンデンセートガス係数他物性値の見直しからガス原始鉱量が332.8→322.6百万m3に変更になった。2004年末評価では12月末時点でガス累計生産量が67.1百万m3となり、昨年度評価の総可採鉱量を超えることが確実となったことから推定考量を確認鉱量にランクアップした。その結果ガスの総可採鉱量は161.1百万m3となっている。\r   改修後の2006/01/28に測定された坑底圧力は、昨年評価のP/Z法で予測される圧力に対して非常に高い圧力を維持しており、鉱量の大幅な増加若しくは強い水押の可能性を示唆している。また、地質モデルを考え合わせると水層の存在を仮定する方が整合的である。\r   2005年末評価は確認鉱量として2004年評価モデルを採用した。但し、ガス物性値の見直しによりガス原始鉱量が322.6→320.7百万m3となった。また、確認＋推定鉱量は改修後の圧力を再現する為、SchilthuisのSS Aquifer Modelを採用し評価した。ガス原始鉱量は302.5百万m3と確認の原始鉱量より小さくなるが圧力が高く維持される為、確認+推定の可採鉱量は45.5百万m3の増加となった。\r'),(618,104,'2005-12-31',50,NULL,'2007-03-19 15:58:17','06年度SIM-B1を改層予定であることから、容積法で求められた原始鉱量を基にSIM-2と同等の生産能力を仮定しタンクモデルによる評価を実施した。'),(622,1,'2006-12-31',50,NULL,'2008-02-06 08:23:30','これは2006年末の推定鉱量の解説です。\n'),(623,1,'2006-12-31',90,NULL,'2008-12-03 16:22:23','現在の評価に使用しているモデル（2003年作成ブラックオイル）で、1年分のデータを入れ、マッチング状況がずれていない事を確認した。RERIとの共同研究の値（熱拡散係数）が出てきて、勇払3Dサイズミックの結果が出てくるタイミング（2009年）にThermal Diffusionを考慮した新モデルを作成する予定である。埋蔵量評価は、昨年度評価を踏襲する。'),(624,103,'2005-12-31',90,NULL,'2008-03-04 11:58:17','本年も生産実績は無く、累計生産量は試ガス時の生産量である。H13年地質スタディによる本層全域の諸パラメータ（孔隙率など）の見直しを反映させている。\n\nなお、生産再開するにはF/Lおよび地上設備の整備が必要である。'),(625,103,'2006-12-31',90,NULL,'2008-03-04 13:21:12','本年も生産実績は無く、累計生産量は試ガス時の生産量である。H13年地質スタディによる本層全域の諸パラメータ（孔隙率など）の見直しを反映させている。\n\nなお、生産再開するにはF/Lおよび地上設備の整備が必要である。'),(626,1,'2007-12-31',90,NULL,'2008-12-17 09:24:39','2007年末（平成19年末）の解説はどこにあるのでしょう？\n\n見つからないので 2008年12月12日の朝のニュースです。\n\n「新テロ特措法、給油延長、きょう成立へ」\n　今国会での大きなやま場である新テロ対策特別措置法改正案が12日の午後、衆院本会議で成立する予定である。参院外交防衛委員会は11日、インド洋給油活動を延長する新テロ対策特別措置法改正案を民主、共産、社民各党の反対多数で否決した。12日の参院本会議でも否決される見通し。これを受け、与党は同日の衆院本会議で、3分の2以上の賛成多数で再可決、成立させる予定である。与党法案は新テロ法改正案が、来年1月15日に法案期限切れになり、そのため海上衛隊の給油活動を１年間延長する。今国会の最大の焦点となる。　\n　参院本会議ではまた、金融機関への資本注入を可能とする政府提出の金融法改正案を修正した民主党案が採決される模様。新銀行東京を注入対象から除外する。野党の賛成多数で可決される見通し。この後、衆院に戻され、与党は「特定の金融機関を外すことは適正でない」として、民主党が修正する前の金融法改正案を本会議で再可決する見通しだ。'),(627,19,'2007-12-31',90,NULL,'2008-12-03 15:42:18','SK-22は、2006年（H18）度に廃坑する予定であったが、廃坑前にフローテストを実施した所、生産状況が順調な為、廃坑は取りやめとした。埋蔵量は実績+予算計上とする。'),(628,3,'2007-12-31',90,NULL,'2008-12-09 14:14:22','《下方修正》\n  従来の減退曲線法の足きり値（20KL/D）から、グランドプランベースに変更。減退率は平成20年度採収予算の値を使用。実績計上の坑井（SK-70）に関しては従来どおり、生産実績のみを計上。減退率は大きく変わっていないが、足きり値が変わった分ある坑井は上方修正となり、ある坑井については下方修正となった。層全体としては下方修正である。'),(629,5,'2007-12-31',90,NULL,'2008-12-09 14:18:37','《採収終了》\n採収終了となっていたが、平成19年度に申川SK-73を、北部深層から本層へ改層した。結果は、高水量率（ほぼ100％）の低生産性で若干の油しか確認されなかった。よって申川S-73は実績計上とする。'),(630,6,'2007-12-31',90,NULL,'2008-12-09 14:19:26','《下方修正》\n減退傾向に変化は見られないが、坑井毎の採算限界から、申川鉱場全体の採算限界（グランドプランベース）へ切り替えた為、下方修正となった。'),(631,7,'2007-12-31',90,NULL,'2008-12-03 16:13:11','採収終了'),(632,156,'2007-12-31',90,NULL,'2008-12-09 14:21:52','《下方修正》\n   DEブロックは、2003年（H15）末評価まで、水平断層に区切られた上下ブロックに分割して鉱量評価を実施してきた。しかし、下ブロックからの水圧入開始後の圧力挙動から、両ブロックの導通が指摘された。また、2004年（H16）には、SK-83, 84, 85の3坑の水平坑井が掘削され、圧力測定結果から、従来考えられていた最北部ブロックのGブロックまで、DEブロックと導通している可能性が高いことが判明した。これを機に、2004年（H16）末評価より、｢北部DEブロックI+II+III層｣という呼称で、上下ブロックとGブロックまでを全て含める同一グループとして扱っている。\n    新規掘削されたSK-83H1号井は、高い生産能力を示したものの、SK-82Hの生産能力が半減した。坑井能力は、周辺坑井の生産状況に依存することが明らかになったため、坑井ごとの評価ではなく、全坑井を一括して減退曲線法を適用し、確認鉱量として計上した。また、推定鉱量として、3坑井掘削後の構造解釈見直しによる鉱量評価値(容積法)を計上している。\n    今年度の評価から申川鉱場全体の経済性を考慮したグランドプランベースの評価へ切替え、減退率は平成20年度採収予算の値を用いた。よって、平成24年度採収終了ということになり、鉱量が下方修正となっている。'),(633,10,'2007-12-31',90,NULL,'2008-12-09 14:22:18','《採収終了》\n\n廃坑済み。'),(634,11,'2007-12-31',90,NULL,'2009-02-16 14:28:11','《上方修正》\n\n本層の坑井は全て合同採収井なので、全生産層の鉱量を層別振り分けファクターで各層に配分している。但しSK-13は既にⅢ層分の鉱量を打ち切っており、生産量は全量本層の配分となっている。SK-75, 76S, 81は、従来の減退傾向を上回るレートで生産しているため、若干の上方修正を行った。SK-13は、2005年（H17）12月に自噴停止に陥り、2006年（H18）からガスリフト採収を再開しているが、生産レートが不安定であることから実績値計上とした。SK-74も従来通り実績値計上とする（SK74は2008年度に改修した）。\n\nまた、容積法で計上されている推定鉱量は、現存の坑井で回収するのは不可能であり、新掘や改修も経済的に難しいと判断し、カットする。'),(635,4,'2007-12-31',90,NULL,'2008-12-03 16:20:10','《上方修正》\n水攻対象井のSK-37,38,40の3坑井はGLV不調のためガスリフト効果が低く密閉していたが、2005年（H17）4月より生産再開している。SK-40とに関しては実績値(+生産予算)での計上としている。SK-39は生産性が低く密閉していたが、2006年（H18）10月に開放した所、順調に生産しているので、実績値を計上する。減退傾向に変化は見られないが、グランドプランベースの評価に切り変えた為、採算限界が変わり上方修正となっている。'),(636,12,'2007-12-31',90,NULL,'2009-02-16 14:32:10','《上方修正》\n\n本層の坑井はSK-73を除いて全て合同採収井なので、それぞれ層別振り分けファクターを使って各層に配分している。SK-75、76、81は減退傾向に大きな変化は見られないが、グランドプランベースの評価に切り替えた為、足きり値が変わり上方修正となっている。\n\n層全体として、推定鉱量が容積法で計上されていたが、既存井での回収が難しいこと、新掘・改修は経済的に厳しいことから、2006年（H18）末評価から推定鉱量をカットする。'),(637,13,'2007-12-31',90,NULL,'2008-12-09 14:24:50','《上方修正》\n\n本層に属する坑井は、全て合同採収井であることから、鉱量評価を採収層合同で実施し、層別振り分けファクターを用いて各層に振り分けている。今年度から申川鉱場全体の採算限界を考慮したグランドプランベースに評価方法を切り替えた為、足きり値が変わり上方修正となっている。\n本層全体として、容積法で推定鉱量が計上されていたが、既存井で回収することは難しく、新掘や改修も経済的に厳しいことから、2006年（H18）末評価からカットする。'),(638,14,'2007-12-31',90,NULL,'2008-12-09 14:25:28','《上方修正》\n\n本層に属する坑井は、全てⅦ層との合同採収井である。詳細はⅦ層鉱量評価の項を参照。'),(639,15,'2007-12-31',90,NULL,'2008-12-09 14:26:12','《実績評価》\nSK-77は2004年（H16）1月29日～2月15日に生産を実施したものの、生産レート(0.5KL/D)は従来の予測よりも減退が進んでいると判断された。2005年（H17）2月より連続生産をしており、安定したレートは得られていないが、無視出来ない生産量になってきたため、2006年末に実績値評価から減退曲線法に切り替えたが、実績値評価に戻す。\n\nSK-78Lは連続生産をしているが、少量のため従来通り実績値による評価とした。\n\n　　　推定鉱量については、他の北部深層と同様に、容積法で評価されていたが、既存井での油の回収は難しく、新掘・改修も経済的に厳しい事から2006年（H18）末評価よりカットとする。'),(640,16,'2007-12-31',90,NULL,'2008-12-09 14:26:52','《実績値》\n\nSK-77は2004年（H16）1月29日～2月15日に生産を実施したものの、生産レート(0.5KL/D)は従来の予測よりも減退が進んでいると判断された。2005年（H17）2月より連続生産をしており、単計時に安定したレートは得られていないが、無視出来ない生産量になってきたため、実績値評価から減退曲線法に切り替えたが、2007年末評価で再度実績値に切り替えた。\n\n推定鉱量は、層全体を容積法で計上してあったが、既存井でこれ以上の油の回収が難しいこと、新掘・改修は経済的に厳しいてんなどから、2006年（H18）末評価よりカットとする。'),(641,17,'2007-12-31',90,NULL,'2008-12-09 14:27:23','《採収終了》\n\n全坑井廃層済み。採収終了。'),(642,18,'2007-12-31',90,NULL,'2008-12-09 14:27:57','《実績値計上、採収終了》\n\n北部集中の合理化方針に従って、2004年をもって採収終了した。SK-12号井を最後に全坑井廃坑された。'),(643,20,'2007-12-31',90,NULL,'2008-12-09 14:39:42','《上方修正》\nSK-2は1995年（H7）7月にポンピング採油を開始して以来、順調に稼動していたが、2003年（H15）12月から水量率、GORが上昇し、油生産レートも1kl/Dを切っている。2006年（H18）末評価では、減退曲線法で評価できる鉱量を累計生産量が越えてしまっているため、実績＋予算値計上へ切り替える。\n\nSK-3は近年安定して生産を続けており、減退傾向にも変化が見られないが、グランドプランベースに切り替えた為、足きり値が変わり上方修正となった。'),(644,22,'2007-12-31',90,NULL,'2008-12-09 14:41:25','《下方修正》\n\n本層の評価は、ガスキャップ部の鉱量を物質収支法、リングオイル部の鉱量をSK-8の減退曲線を用いて算定してきた。リングオイル部のSK-8については従来評価の減退傾向に概ね沿っているため、従来評価を踏襲する。ガスキャップについては、SK-9で顕著な減退傾向が認められる為、物質収支法から減退曲線法へ切り替える。減退傾向に大きな変化は見られないが、グランドプラン評価に切り替えた為、足きり値が変わり下方修正となった。'),(645,36,'2007-12-31',90,NULL,'2009-02-10 16:28:54','《上方修正》\n\nSK-14はGWRの低下傾向を用いて評価してきたが、2008年（H20）中に累計生産量が従来評価の総可採鉱量を超えそうなため、最近のGWRの傾向で減退曲線の見直しを行った。\n\nSK-10は自噴停止となり、再生産テストでも水のみの産出となったため、2002年（H14）末評価以降、実績値計上となっている。2004年（H16）は水圧入テストを実施した。\n\n南鮎川AK-1, 中鮎川SK-1については、DST時の実績のみ計上した。'),(646,37,'2007-12-31',90,NULL,'2009-02-10 16:31:59','《上方修正》\n\n2000年（H12）末よりA層全体での物質収支法による評価を行っていたが、各坑井の貯留層圧力の幅が大きく、東由利原AK-1のように連続生産が不可能な坑井も存在する為、2003年（H15）末評価から、密閉後の回復した坑口圧力値を利用した坑井ごとの減退曲線法に切替えている。SK-8, 北由利原AK-1, 東由利原AK-1の減退傾向に変化は見られないが、東由利原AK-1は、2008年度中に累計生産量が埋蔵量を超過すると予測される為、見直しを行い、若干の上方修正とした。SK-9S/Sについては水没したと判断されることから、実績値を計上する。'),(647,21,'2007-12-31',90,NULL,'2008-12-09 14:40:17','《上方修正》\n本ブロックはブロック全体の減退傾向で評価していたが、1999年（H11）末より坑井ごとの減退による評価に切り替えている。減退傾向に変化は見られないが、グランドプランベースの採算限界を用いた評価に切り替えたため、足きり値が変わり上方修正となっている。'),(648,33,'2007-12-31',90,NULL,'2009-02-09 17:34:59','《従来通り》\n\n本層唯一の稼働坑井である東由利原AK-2は日量約150m3/D～300m3/Dで生産を行っている。安定した生産が望めないことから2000年（H12）末より、実績値の計上としている。'),(649,34,'2007-12-31',90,NULL,'2009-02-09 17:35:06','《従来通り》\n\nSK-1、SK-2は採収を終了し、圧入井に転用済。SK-4、SK-7については自噴不調となった後、長期密閉となっており、鉱量は計上しない。SK-5は圧力の回復を待って開放するサイクル採収を行っていたが、2000年（H12）10月以降、圧力の回復が以前よりも小さくなり、長期に密閉しても改善が望めないため、2000年（H12）末から鉱量を計上していない。\n2007年（H19）度生産実績はないため、前年評価を踏襲した。'),(650,35,'2007-12-31',90,NULL,'2009-02-09 18:14:43','《従来通り》\n\nSK-10Sは2001年（H13）末の減退曲線法評価における可採鉱量採収後、自噴停止となり生産再開の見込みが立たないため、実績値評価に切り替えている。採収に坑井作業が必要な他の3坑井については、2000年（H12）末評価において推定鉱量へと移したが、2001年（H13）末評価から確認③として確認鉱量に計上している。'),(651,38,'2007-12-31',90,NULL,'2009-02-16 10:03:56','《従来通り》\n\n2004年（H16）1月～3月にガス需給対応のため、SK-12で連続生産を実施し(ガス約100万m3)、この間、南鮎川のPs変化は約3kscあったことで両坑井の導通性が確認された。南鮎川は2004年（H16）7月の酸処理によって、生産レートが大幅に改善された(約80KL/D→約170KL/D)。当面、南鮎川を連続生産し、中鮎川で圧力を監視して、両坑井間の導通性をみる予定である。\n2005年（H17）末評価においては、南鮎川AK-1において累計生産量が総可採鉱量を上回ったため、中鮎川の容積法エリアと包落線で結んだ領域を確認鉱量のエリアとして計上した。また、SK-12の容積法領域をこれまでの南鮎川、中鮎川と同じく半径200mに統一した。GORは累計実績を採用した。2006年（H18）末評価は前年度評価を踏襲している。2007年度、JOEに委託しBⅠ層モデルを作成中である。'),(652,40,'2007-12-31',90,NULL,'2009-02-16 18:14:52','《上方修正》\nSK-8Lが、2008年中に累計生産量が総可採鉱量を上回ると見込まれるため、直近の値を含めた減退曲線を引きなおし、総可採鉱量を修正した。'),(653,149,'2007-12-31',90,NULL,'2009-02-16 10:03:09','《採収終了》\n\n低生産性のため、生産せず。TBG内にPlugをセット済み。'),(654,41,'2007-12-31',90,NULL,'2009-02-25 14:24:31','《上方修正》\n北鮎川（On-57層）は2004年（H16）11月の増産以来、約40KL/Dの連続生産を実施している。地層水の産出は見られるもののWCは安定傾向にあり、減退はほとんど見られない。シミュレーションでは2007年9月に水没することになっているが、生産状況からその可能性は低いと判断し、油生産量の減退傾向を用いた評価に切り替えた。\n\n西鮎川AK-1On-3,4,D1と、新鮎川AK-1On-D1層は容積法による一括評価となっていたが、それぞれの減退曲線評価へと切り替える。\n\n推定鉱量としては、シミュレーションの値を採用しているが、2005年（H17）末評価で、{}のような見直しを行っている。｛1)坑底圧測定によって、北鮎川の油層と西鮎川の油層との導通性がアキファー部に限定されると解釈されること、2)新鮎川下層と北鮎川下層で地層水産出が認められたこと、からモデルを一部変更しヒストリーマッチングを行ったところ、おおむね良好なマッチングを示したため評価を見直した。｝　マッチング状況としては、概ね良好だが、北鮎川AK-1On-5,7 層は、シミュレーション上では水がついているのに対し、実際は少量の水の産出が認められるだけという状況を再現できていない。また、圧力についても、北鮎川AK-1は坑底圧力の実測値に対し、シミュレーション値は低く出ている。これらを解決する為に、北鮎川のブロックの浸透率を変化させたり、HCの量を増やしたりしてマッチングを試みたが、良好な結果は得られていない。今後は、北鮎川AK-1On-5,7の経過を見守りつつ、シミュレーションモデルの修正を行っていきたい。'),(655,42,'2007-12-31',90,NULL,'2009-02-16 18:18:18','《前年度通り》\n\n西子吉川SK-1は、2001年（H13）2月4日から同年3月6日にかけて4層に対して計6回のDSTを実施し、No.2 DST区間の女川ドレライト層にて油の、No.4 DST区間の船川層福山安山岩にてガスの産出を見た。平成15年11月にガス層のフローテストを実施し、PBU解析結果によって、可採鉱量の下方修正を行った。船川層のガスに関しては、需給の逼迫により、2007年（H19）度に自噴線を敷設し、12月より生産を開始した。2006年末評価時に確認②から確認①へ変更する。'),(656,43,'2007-12-31',90,NULL,'2008-12-05 16:47:22','2003年（H15）末評価以降、圧力挙動・検層対比を見直した結果、上位層より①余目69ガス層、②余目49ガス層、②余目48油層、④余目53+55油層、の4つのグループに分けて評価している。SK-53は、累計生産量が、鉱量を上回っている為、TPの足きり値を見直し、若干の上方修正を行った。'),(657,44,'2007-12-31',90,NULL,'2008-12-09 15:44:59','《従来通り》\n\n2003年（H15）末評価において、地質スタディに沿ったグループ分けを行い、再評価を実施した。中部ブロック油井群･ガス井･東部ブロックのいずれも、減退傾向に変化がないので前年度評価を踏襲する。'),(658,45,'2007-12-31',90,NULL,'2008-12-09 15:45:28','《採収終了》\n\n全坑井廃坑済み。廃層。'),(659,46,'2007-12-31',90,NULL,'2009-02-26 19:16:13','《従来通り》\n\n2001年（H13）～2002年（H14）に実施したSK-4の産出テストにより、減退傾向の把握が出来たため、減退曲線法により鉱量評価を実施している。2002年（H14）9月以降はビーンサイズ1.5mmで操業を続けており、生産レートの減退傾向が微小で圧力減退も認められないことから、水押しの影響を受けていると考えられる。レート自体は減退曲線を上回るものではないため、確認鉱量評価値は前年度踏襲とするが、容積法による評価値(1991年時点)を推定鉱量として再計上する。'),(660,39,'2006-12-31',90,NULL,'2008-12-09 13:52:13','東由利原AK-1は,長期の連続生産は行っていないが、減退傾向が緩くなっている為、見直しを行った。\n\nSK-9は、2005年（H17）約2ヶ月間生産を実施したものの、従来評価を変更するに足るデータは蓄積されていないと判断し、前年評価を踏襲した。\nSK-17DHは実績値のみ計上する。'),(661,39,'2007-12-31',90,NULL,'2009-02-16 18:15:04','東由利原AK-1の減退曲線を見直した際、ガスの鉱量が変更されていなかった為、それをUpdateする。それ以外については前年評価踏襲。\n\n（以下は前年踏襲）\nSK-9は、2005年（H17）約2ヶ月間生産を実施したものの、従来評価を変更するに足るデータは蓄積されていないと判断し、前年評価を踏襲した。\nSK-17DHは実績値のみ計上する。'),(662,68,'2007-12-31',90,NULL,'2008-12-09 16:12:43','《従来通り》\n\n本層唯一の採収井であったNS-1が、平成6年度に廃坑されたため、平成6年度末から実績計上とした。\n'),(663,70,'2007-12-31',90,NULL,'2008-12-09 16:14:57','《従来通り》\n\n本層で唯一の採収井であるMS-24改は、現状で安定採収が困難なため平成11年のフローテストを最後に密閉中である。生産状況の改善には技術的不確実性が存在すると考えられ、H13年末評価時計上法の変更により前年度まで推定鉱量として計上していた可採鉱量を条件付資源量と位置付け、確認鉱量は従来通り実績分を計上する。\n【平成11年末評価 解説の骨子】\n　本層の採収井MS-24改は、平成9年11月にCTユニットにて浚い作業実施し、自噴再開後は減退傾向を示しながらも順調に生産を継続していたが平成11年4月に再び自噴停止に至った。自噴停止後のフローテストにて中圧採収でガス:10,000m3/d, 水:24KL/dを確認したものの産出水量が多く安定した採収には至っていない。\n　生産状況の改善（遮水、マカロニリフト等）が実施できれば残鉱量の回収も可能と考えられるが、技術的不確実性が存在すると考えられることから、残存鉱量は推定鉱量として計上し、確認鉱量は実績計上とした。採収限界レートを1,000m3/dとして減退曲線法による総可採鉱量202百万m3から累計生産量を減じたものを推定鉱量として計上する。\n（平成19年末評価）\n　　唯一の採収井であるMS-24改は水没しており、確認鉱量・確認+推定鉱量ともに計上していない。MS-24改は、平成20年度に廃坑予定である。\n\n'),(664,72,'2007-12-31',90,NULL,'2008-12-09 16:16:28','《従来通り》\n\n埋蔵量評価については、昭和62年末の鉱量評価（容積法）を踏襲した。累計生産量を更新し、可採鉱量のみ変更した。\n生産中のMS-31中は、坑口圧力、生産量とも比較的安定しており、減退傾向は認められない。したがって、従来とおりの容積法を用いた総可採鉱量を採用する。\n\n（平成19年末評価）\n　　MS-31中は、需給調整井として、安定した生産を行っている為、従来通りの容積法評価値を踏襲する。\n'),(665,73,'2007-12-31',90,NULL,'2008-12-17 17:13:08','《変更：実績計上》\n\n本井は累計油生産量が287千KLと非常に大きく、容積法による原始鉱量の評価値を大きく上回る。従来評価は平成13年末の減退曲線法を用いていたが、平成14年11月の自噴不調以降、生産量が回復せず、今後可採鉱量を回収する可能性が低いと考えられたことから、可採鉱量を削除し、生産量を実績計上する。\n \n\n【過去の経緯】\n平成11年8月以降に一旦レートは低下したが、H14年11月自噴不調になる直前までの油レートは、平成9年12月に実施したB/S変更（B.S. 4.0→7.0mm）後から平成11年8月に生産レートが低下する前までの油量の減退傾向を若干超えるレートまで回復していた。\nH14年11月自噴不調となり、穿孔区間の1/3が砂で埋没したことから坑井を密閉した。\nH15年1月に生産を再開したが、生産レートが回復しなかったことから、H16年4月にCTU浚い作業を実施した。しかしながら、作業実施後も自噴不調前の生産レートには回復していない。\n\n（平成19年末評価）\n　　昨年同様に実績計上とする。'),(666,76,'2007-12-31',90,NULL,'2008-12-09 16:23:30','《従来通り》\n\n平成18年中の生産実績なし。前年度評価を踏襲する。\n\n【過去の経緯】\nMS-42は平成10年6月の試ガスにおいて、油：20.72KL/D、水：0KL/D、ガス：4,950m3/D、GOR239m3/KLの結果を得て採油井に編入された。平成11年6月長期フローテストを最後にしてMS-44掘削等の理由で一時生産中断するまでの生産データにおいて減退傾向が現れているようにも見えるが、生産期間が短く鉱量評価には不十分と考えられことから容積法による評価を従来行なってきた。H16年末時点の単計データを用いた減退曲線法評価値と容積法評価値は近い値を示すが、従来の容積法による評価を踏襲する。\n \n\n＜参考：平成11年末評価より＞\nH11年末時点のデータを用いた場合、総可採鉱量は以下の値となる。\n\n評価方法			総可採鉱量	備考　　　　　　\n容積法		 	11,920	KL	R.F. =20%\n減退曲線法		 5,100 	KL	生産限界=1.0KL/d\nMB法		 5,200 ～ 4,300 	KL	R.F =25%～30%\n\nなお、MB法については圧力データが３点しかなく計算精度はあまり高くないものの、その推定値が減退曲線法の評価値に比較的近い値を示している。Ｑ基地掘削終了後、追加データを取得し評価精度の向上を図ることとする。\n'),(667,74,'2007-12-31',90,NULL,'2008-12-09 16:24:20','《従来通り》\n\nMS-31下は平成4年以降、自噴不調・大気放散を繰り返し、平成5年9月に砂産出により自噴停止した。平成6年4月に自噴誘導を行なった結果、自噴に成功し生産を再開したが、自噴不調が頻発するため、平成7年2月に密閉した。その後、平成9年の坑底圧測定で砂による坑内の閉塞が確認されている。\n平成15年11月、CTU浚い作業実施し、砂による坑内閉塞の改善および現油層圧力を確認した。ただし、フローテスト状況を勘案すると現状では残存鉱量回収には技術的不確実性が存在すると考えられる。よって、残存鉱量を条件付資源量と位置付け、確認鉱量は従来通り実績分を計上する。\n現在、本層へはプラグセットし、MS-31上（2340mA1）、MS-31中（2340mA,B1,B2）を優先して採収することとする。（現在、MS-31中を生産中）\n'),(668,75,'2007-12-31',90,NULL,'2008-12-09 16:29:20','《従来通り》\n\n本年も生産実績がないため、昭和63年末評価を踏襲した。\nMS-23上については下層（2900mA層）と導通しており、下層から上層への圧入を防ぐため、圧入を生じないレートで下層を生産し、上層は密閉している。'),(669,80,'2007-12-31',90,NULL,'2008-12-09 16:35:08','《従来通り》\n\n（平成18年末評価）\n現在の鉱量評価は1995年に実施されたシミュレーションモデルを基にしているが、坑井毎の着水状況やガス油比などが実績からずれてきており、モデルの修正が必要と認識されている。平成18年度に三次元震探の解釈結果を基に地質モデリング作業が行われ、現在貯留層モデルを構築中（ヒストリーマッチング）である。本年は昨年の評価を踏襲する。\n　\n坑井状況で特筆すべきは、NS-5とNS-12である。NS-5は、高水量率により2005年3月に密閉していたが、2006年5月に、NS-13Uパイプライン漏洩事故の後に坑井を開放したところ、地層水を連続的に汲み上げることができ、安定生産中である。\nNS-12は、2000年頃から地層水の産出を確認してきたが、近年ガス水比の低下が顕著である。2006年中頃にガス水比が50,000m3/KL程度に低下したことから、生産挙動を注視する必要がある。\n \n\n　1995年スタディー以降コア分析など新規データが追加されており、構造図も若干の修正が加えられているが、原始鉱量はほとんど変わっていない。前年評価同様、マッチング状況は、圧力・水レートについて若干の乖離が見られるほか、GORの計算結果が実測値を上回っていることによる油の可採鉱量の過小評価の程度は大きい。\n\n今年度評価では、GORの今後の上昇傾向から原油の総可採鉱量のみ再評価する方法（H12末～）を踏襲したが、GORの上昇傾向に変化が無いことからH12末評価値を採用する。この評価方法は、あくまでもモデル修正までの経過措置と位置付ける。\n  \n今後、平成13年度実施した3D震探からの構造データ等、追加の生産挙動データ、新掘井からのデータなどを用いてモデルの見直し作業を行っているが、作業途中であることから、本年は平成7年(1995年)のシミュレーション結果を踏襲する。\n\nマッチング状況\nガス層圧力: 2000年以降計算値が実測値を下回っている。従って、原始鉱量を過小評価しているか、或いは水層の大きさを過小評価している可能性がある。後者の場合は、可採鉱量が減少となる可能性が強い。\nGOR: 1995年あたりから計算値が実測値を上回っている。つまり、計算ではコンデンセートをガス層内に取り残す形であり、油の可採鉱量は過小評価していることになる。\n水レート: NS-5, NS-18,MS-40では着水挙動を過小評価。NS-15,MS-38では着水挙動を過大評価。\n\n2900mB層群全体でみると圧力、水量の予測は概ね良好。但し、GORの計算結果が実測値を上回っていることによる油の可採鉱量の過小評価の程度は大きい。\n\n坑井状況\n\n　　出砂状況については、NS-13上、NS-18a以外の全ての坑井について出砂が確認されており、2002年にNS-6が砂によるセパレータ閉塞のため生産不能に陥るトラブルが発生している。NS-6は2004年9月にTBG内砂浚い作業およびThrough TBG Gravel Pack（TTGP）作業を実施し生産状況を監視中であるが、生産量は回復せず、ほぼ水没と判断できる。\n\n（平成19年末評価）\n　　減退傾向に変化はなく、シミュレーションのマッチング状況も昨年と同じ部分で、乖離が見られる。新しいシミュレーションモデルに関しては進んでいない（完成時期も未定）。\n\n　　 NS-12は、実際にはGWRが下がってきているが、シミュレーション上では水つきを再現できていない。しかし、NS-15やNS-5はシミュレーションでの将来予測値よりも高レートで生産しており、全体的にはシミュレーションの将来予測の値の方が過小評価になっている。\n'),(670,81,'2007-12-31',90,NULL,'2008-12-17 17:18:10','《鉱量見直し》\n\n（平成17年末評価）\nNS-16は、96年の坑井テストにより再導通が確認された。現状では導通状況の定量的評価は困難である為、2900mC,D層を一括して評価している。\nC,D両層とも91年及び95年にシミュレーションスタディが実施されており、Ｄ層についてはほぼ同じ結果が得られているが、95年C層のモデルの原始鉱量は端水面深度の違いから91年のそれより5億m3多い。NS-16導通のためC層圧力データが得られないという不確定要素を加味し、H15年末評価までは91年の結果に基づく鉱量を確認鉱量、95年の結果に基づく鉱量を推定鉱量として計上してきたが、平成16年末評価ではC,D層油累計生産量が確認総可採鉱量（’91年Sim.結果）を上回ったことから鉱量の見直しを行った。\n\n【参考】\nC及びD層は断層により南北２つのブロックに分けられている。\nD層では坑井の圧力挙動から貯留層は断層で遮断され、南北間の導通性は無いと考えられている。一方で、C層ではその北部にしか生産井が存在しないことから断層の導通性については確認できておらず、断層による貯留層の遮断は無いと仮定した上でモデルを構築。\n平成16年末評価においてはC+D層北部（NS-16導通のため）、D層南部の２ブロックに分けて減退曲線法による鉱量評価を行った。\n\n（平成18年末評価）\n本年は、以下の理由により、評価方法を変更した。\n1）	東新潟MS-22を2900m D層に改層した結果、着水していることが確認されたこと。\n2）	坑井毎の減退傾向が明確であること。\nMS-22は構造の頂部に位置する坑井であり、地層水の産出は予想外していなかったが、改修後のフローテスト（2006年11月）で、6.2KL/Dの水産出が確認された。従来からの貯留層モデル（1995年モデル）では、地層水の着水は全く計算されず、2900mD層からガスが数年生産されると予想されていた。この結果から、貯留層モデルの精度は低いと考えられ、本モデルで評価してきた  推定鉱量は、削除することとした。\n一方、確認鉱量は南北ブロックの坑底圧力挙動より評価してきたが、坑井毎の減退傾向がはっきりしていることから、坑井毎の減退曲線法に切替えた。\n\n【ガス】\nNS16上下、MS27はGWR減退傾向より推定\nNS13Lは、QGPの減退傾向より推定\nMS22は実績がないので、予算量を計上\n【原油】\n坑井毎のGOR上昇傾向より推定\n\n（平成19年末評価）\n昨年の評価でMS-22は予算量を鉱量に見込んでいたが、平成19年にフローテストを行ったところ、水量率が高く、ガス量も200～300m3/Dであった為、水没と判定されている。その分が、ガス-4,000千m3となった。本井は機を見て、2900mB層、もしくは2900mA層に改層する予定である（Through Tubingで作業可能）。\nまた、NS-13下は、N基地で低圧採収をされていたが、N基地無人化に伴い、低圧採収がなくなるので、2008年3月で密閉となる。\nその他の坑井に関しては、減退傾向に変化が見られないため、昨年度評価を踏襲する。'),(671,82,'2007-12-31',90,NULL,'2008-12-09 16:36:57','《採収終了》\n\n本層唯一の稼働坑井NS-10が1998年4月17日に水没により自噴停止した。この為、累計生産量を総可採鉱量として実績計上した。\n'),(672,83,'2007-12-31',90,NULL,'2008-12-09 16:37:43','《変更：採収終了》\n\n平成18年11月に改修し、2900mD層に改層し、本層の採収は終了した。\n\n【過去の経緯】\n平成13年3月に、本井3200m層へ、スルーチュービング・パーフォレーションを実施し、採収中の3400m層とのコミングル採収を開始した。生産は、地上配管内でハイドレートを生成しない夏期のみとしている。\n生産量が非常に微量であることから、H18年度にMS-22の2900ｍD層への改層した。\n\n'),(673,84,'2007-12-31',90,NULL,'2008-12-09 16:38:27','《変更：採収終了》\n\n平成18年11月に改修し、2900mD層に改層し、本層の採収は終了した。\n\n【過去の経緯】\n平成5年の長期フローテスト（RLT）及び平成8年の残存鉱量の評価の結果、残存可採鉱量が少なく酸処理等の坑井刺激作業には経済的リスクが大きいとの判断に至っている。平成11年測定の密閉坑底圧は490kscと高い圧力を維持しているものの、RLTおよびBUCで得られる浸透率は0.01～0.2mdと非常に小さく、長期的に高い生産レートを維持することは困難である（安定レートは1,000m3/d以下）。\n　基本的に本3400m層からの採収は断念し、平成13年3月にMS-22において3200m層を対象にスルーチュービング・パーフォレーションを実施し、3400m層とのコミングル採収を開始した。コミングルガス生産量は3,000m3/Dにも満たないほどの微量である。\n鉱量については従来評価と同じく、3400m層からの採収は不確定要素が大きく、多くは望めないことから、従来通り生産実績を鉱量として計上する。\n'),(674,54,'2007-12-31',90,NULL,'2008-12-10 11:18:07','《従来通り》\n\n（平成11年末評価）\n	　SK-24Aの密閉後の生産データが蓄積されてきたことから減退曲線を見直し、従来の層全体の一括評価から坑井毎の個別評価へ切り替え、密閉による影響の軽減を図った。\n（平成14年末評価）\nSK-1については前回評価データ（Ｈ11年末）に追加データを加えて再評価を行なっている。\n   （平成16年末評価）\nSK-1についてはデータ追加によって評価結果が大きく変わらない点、SK-24Aについては、平成11年10月ビーン変更（25.4→6.5）後のデータは蓄積されたものの、頻繁な密閉・開放により安定した採収データが少ない点を考慮し、前回評価値を踏襲する。\n（平成17年末評価）\n平成17年末評価においても、SK-1についてはデータ追加によって評価結果が大きく変わらない点、SK-24Aについては、平成17年度に生産がなかったことより、前回評価値を踏襲する。\n（平成18年末評価）\n平成18年末評価では、坑井の生産状況を考慮した結果、水付きによる可採鉱量の不確実性が高いと判断し、<実績+予算>計上とした。\n\n（平成19年末評価）\n生産井は紫雲寺SK-1と紫雲寺SK-24Aの2坑井であるが、両井とも実績計上である。今回も、\n<実績+H20予算>の量を計上している。\n \n'),(675,55,'2007-12-31',90,NULL,'2008-12-18 10:13:35','《従来通り》\n\n平成5年に平成4年末までの圧入実績を基に、昭和62年のガス圧入スタディ(GASP3) の Followup スタディを GASP3 （水押しを考慮したタンクモデル）で実施している。平成15年にVIPモデルを試作したが今後詳細につめていくこととし、総可採鉱量は昭和62年度評価を踏襲した。\nなお、圧入ガスの回収率は100%としており、再生産ガスは全て圧入ガスから成るものとしている。\n（平成17年末評価）\n平成17年中に累計再生産量が累計圧入量を上回り、一次可採鉱量よりガス5.9MMm3を生産した。\n（平成19年末評価）\n平成19年には、圧入と再生産のラインの複線化が完了し、順調に圧入している。よって、平成19年末評価では、+23.4百万m3の貯蔵ガスとなっている。'),(676,56,'2007-12-31',90,NULL,'2008-12-18 10:13:43','《従来通り》\n\n平成5年に平成4年度末までの圧入実績を基に、昭和62年のガス圧入スタディ(VIP) の Followup スタディを VIP で実施したが、前回モデルを修正する必要がなかったため、総可採鉱量は 昭和62年評価を踏襲した。\nなお、圧入ガスの回収率は100%としており、再生産ガスは全て圧入ガスから成るものとしている。\n（平成19年末評価）\n平成19年12月に、長島SK-1DをN層へ改層した為に、X17（Ⅱ層）は、廃層としている。また、同12月に、圧入・再生産能力の増強を目的とした長島SK-2Dを掘削している。'),(677,96,'2007-12-31',90,NULL,'2008-12-12 14:44:03','《従来通り》\n\n南片貝SK-2は、掘削中の溢逸泥を繰り返すトラブルから掘削休止井となった南片貝SK-1の廃坑を可能にすべく2700m層のガス圧を抜く目的で掘削された。1998年の二度のフローテストではハイドレートあるいは地層崩壊によるトラブルにより自噴停止したもののガス5～7万m3/dの産出を見ていた。ところが、2000年9月にフローテストを実施したところ水の産出しか確認できなかった。\nハイドレート生成を回避し連続生産を可能にすべく2001年6月にボトムホールチョークを設置した。以降2002年9月密閉まで、連続生産しフロー状況は安定している。\nガスが水に替わった原因ははっきりと掴めていないが、連続生産時のフロー状況から端水面は南片貝SK-2の仕上げ深度直下にあると考えられガス採収の見込みは不確かな面がある。\nしたがって、南片貝SK-2のUp-Dipエリアについて推定鉱量を計上している。確認鉱量については、実績計上する。\nH13年地質スタディにおいて諸パラメータ（孔隙率など）の見直しを実施している。'),(678,97,'2007-12-31',90,NULL,'2008-12-10 13:07:29','《従来通り》\n\n本層は平成5年度に掘削したSK-25 の結果により、平成5年末評価より鉱量を計上している。本年も生産実績が無いため、鉱量は従来の評価値を踏襲した。\nなお、累計生産量は試ガス時の生産量のみであり、生産再開にはF/Lおよび地上設備の整備が必要である。\n但し、現在水の産出のみとなっている南片貝SK-2とほぼ同等のレベルにあり、仮に現在の評価通り北部と南部が同プールであり南片貝SK-2が水没したものとすると、SK-25も水没している可能性があり、早急にフローテストにより確認する必要がある。\n\n（注１）本層は3200m層と異なり北部と南部でガス油比はほぼ等しいガス・コンデンセート層であるが、現時点の評価では中間エリアの坑井データが少ないため北部と南部それぞれについて評価している。\n\n（注）ガスの可採鉱量については、0.1百万m3のまるめ誤差である。\n'),(679,98,'2007-12-31',90,NULL,'2008-12-12 14:44:44','《従来通り》\n\n本年も生産実績がないため、鉱量は昨年評価を踏襲した。\n(平成９年１１月、片貝SK-17 X’mas交換時のブライン排出に伴う生産のみ)'),(680,99,'2007-12-31',90,NULL,'2008-12-10 13:10:59','《従来通り》\n\nSK-24 掘削後の容積法による評価（従来は油層として評価していたが、SK-24 の掘削結果から上部をガスキャップ、下部を油層として評価）を採用している。平成14年1月、TOC飯塚1成功後の数ヶ月（推定）のフローテスト期間中に圧力干渉の疑いあり。平成15年1月～4月RLT実施。今後再評価していくこととし、鉱量は従来評価を踏襲する。\n\n（注１）本層は、北部と南部でガス油比が異なることから、北部は油層、南部はガス・コンデンセート層として、平成元年末評価から北部と南部とに分けて計上されている。現時点の評価では、2700m層と異なり、北部と南部は断層により隔てられた別構造と解釈している。\n\n（注２）平成４年に実施したSK-24 の産出流体のPVT試験（91年フローテスト時のサンプル）では、流体が臨界状態に非常に近いため、初期状態でガス一相か油一相か判断できていない。また、平成５年度に掘削したSK-25 は、水層であったため再評価を行なうためのデータは得られなかった。したがって、データが入手された後、鉱量の見直しを行なう必要がある。'),(681,144,'2007-12-31',90,NULL,'2008-12-18 10:29:19','《層別評価⇒グリーンタフ一括評価》\n\nこれまで片貝地域のグリーンタフ層（G0～G5層）はその鉱量評価を層別に行ってきた。しかし片貝SK-8をはじめ、他のグリーンタフ層坑井についても、差の大小はあるがG3坑井の生産に伴う密閉坑底圧の低下が観測されていることから、平成15年シミュレーションスタディでは片貝深部グリーンタフ（G0～G5）の一括評価が実施された。\nH15スタディにて構築された地質モデルのうち、2004年に北片貝SK-1が着水するよう端水レベルを浅く設定したモデル（GWC:-4660m）によるシミュレーション結果は、H15年末評価では確認＋推定鉱量として計上された。またH16年末評価では早期着水モデルによる評価結果を確認鉱量にランクアップし、端水レベルを恣意的に操作していない（GWC:-4850m）モデルによる評価結果（20ﾘｱﾗｲｾﾞｰｼｮﾝのP50）を確認＋推定鉱量に計上した。\n\nG3坑井の生産挙動は安定しており特に変化は見られない。北片貝SK1の坑底圧力は平成13年2月22日に密閉後（同年4月測定時から同年12月まで）、密閉坑底圧力は約2MPa上昇している。\nまた、水分析結果については、Cl-濃度は50～100mg/L程度であり現在のところ着水の傾向は確認されていない。（平成15年5月に測定した北片貝SK1のCl-濃度のみ290mg/Lと高く、その後の測定値は通常の50mg/L程度に戻った。継続的な測定は必要）\n\n（平成19年末評価）\n　片貝の埋蔵量評価は、平成15年のモデル製作以来ヒストリーマッチは行わず、マッチングの傾向がずれていないことのみを確認している。北部の坑井（北片貝SK-1、片貝SK-22、片貝SK-18）については、シミュレーション値よりも実際のBHPの方が高く推移しているが、南部の坑井（南片貝SK-3、片貝SK-16、片貝SK-19）については、シミュレーション値の方が高く推移しており、北部に関してはシミュレーションの結果がConservativeな事が示唆されている。いずれにせよ、技研の火山岩研究の結果などを統合して平成20年からモデルの見直しを行う予定である。P/Zにて圧力の減退傾向を評価すると、減退傾向には変化はなく、シミュレーションよりも大きなOGIPを示している。\n　平成19年8月に、北片貝SK-1Dと片貝SK-22の間に片貝SK-27Dが掘削され、約145,000m3/dの安定レートを確認している。'),(682,103,'2007-12-31',90,NULL,'2008-12-18 10:29:48','《従来通り》\n\n本年も生産実績は無く、累計生産量は試ガス時の生産量である。H13年地質スタディによる本層全域の諸パラメータ（孔隙率など）の見直しを反映させている。\nなお、生産再開するにはF/Lおよび地上設備の整備が必要である。'),(683,86,'2007-12-31',90,NULL,'2008-12-18 10:15:29','《従来通り》\n\n平成10年末までの見附油田の鉱量評価は、鉱山自体での採算限界は既に過ぎているため全層一括の減退曲線から得られる次年度末迄の累計量を総可採鉱量として計上してきた。\n\n（平成11年末評価）\n平成11年末評価時点で当面廃山が計画されていなかったことから、平成11年末評価より生産量の比較的多いSK-4、SK-29、SK-40について個別に減退曲線法による評価を行い、その他の坑井については生産量が極めて少ないため実績分を計上し、可採鉱量は見込んでいない。\n\n（平成15年末評価）\n周辺地域の宅地化進行のため、平成15年度にAU基地のSK-29、SK-31、F基地のSK-21について廃坑作業を実施。SK-40の坑口圧力はほぼ下流ライン圧まで減退していることから、平成15年末評価より従来の減退曲線法（坑口圧力）による評価から実績計上に変更した。この結果、見附坑井は全て実績計上となった。\n\n（平成19年末評価）\n　　生産井は見附SK-40のみであり、実績+平成20年予算の計上となっている。'),(684,87,'2007-12-31',90,NULL,'2008-12-18 10:18:25','《従来通り》　　　　　　　　　　　　　　　　　　　　　　　　　　　　　　　　\n昭和６３年にシミュレーションスタディを実施し鉱量を評価した。その後、本層の坑井は平成３年１２月から密閉している。従って本年は昭和６３年末評価を踏襲した。\nなお、生産再開には地上設備の整備が必要である。\n　（平成19年末評価）\n　　　生産実績はなく、評価は前年度踏襲とする。紛失してしまった（紙ベースでしか残っていない）昭和63年作のシミュレーションモデルを再構築をJOEへ依頼し作業中である。'),(685,88,'2007-12-31',90,NULL,'2008-12-18 10:18:59','《従来通り》　　　　　　　　　　　　　　　　　　　　　　　　　　　　　　　　\n藤川Ⅲ層は当面、生産の予定がないことから平成９年１０月に保安対策としてPKR内部にパーマネントタイプのブリッジプラグを設置した。鉱量は前年度評価を踏襲する。\nなお、生産再開には改修作業が必要である。\n\n        昭和６１年９月５日～８日フローテスト実施時の生産状況\n\n            ガス生産レート： 3,400 m３/d\n              内　　圧    ： 360 → 50 kscg'),(686,89,'2007-12-31',90,NULL,'2008-12-18 10:19:29','《従来通り》　　　　　　　　　　　　　　　　　　　　　　　　　　　　　　　　\n平成４年に基礎試錐三島の掘削によるデータ増により鉱量の見直しを行った。藤川Ⅲ層は当面、生産の予定がないことから平成９年１０月に保安対策としてPKR内部にパーマネントタイプのブリッジプラグを設置した。鉱量は前年度評価を踏襲する。\nなお、生産再開には改修作業が必要である。'),(687,90,'2007-12-31',90,NULL,'2008-12-18 10:23:14','《従来通り》　　　　　　　　　　　　　　　　　　　　　　　　　　　　　　　　\n昭和６２年にガス圧入スタディを実施し鉱量の見直しを行っている。本年も昭和６２年末評価を踏襲する。なお、圧入ガスの回収率は100%としている。\nただし、再生産には地上設備の整備が必要である。\n\n（平成19年末評価）\n　　生産もしておらず、前年度評価踏襲とする。なお、平成20年12月から冬期間のみガスの生産を開始する。\n\n	平成17年末\n累計実圧入量　（百万M3）	１８７.２\n累計再生産量　（百万M3）	０.０\n累計　圧入量　（百万M3）	１８７.２'),(688,92,'2007-12-31',90,NULL,'2008-12-18 10:25:58','《従来通り》\n\n昭和６３年末評価において、減退曲線法により可採鉱量の見直しを行った。その後坑内浚いを再三試みたが成功せず生産実績はない。本ガス層について平成８年度にマテリアルバランス法による残存可採鉱量の再検討が実施されており、可採鉱量の増加が示唆されている。しかし、Re-Entry技術の面からも残存鉱量回収の不確定要素が多いことから、平成13年末評価における評価方法の見直しにより条件付資源量と位置付け、確認鉱量は実績計上とする。ただし、条件付資源量は前回評価値を踏襲する。'),(689,93,'2007-12-31',90,NULL,'2008-12-18 10:26:23','《従来通り》　　　　　　　　　　　　　　　　　　　　　　　　　　　　　　　　 \n　実績計上。'),(690,94,'2007-12-31',90,NULL,'2008-12-12 14:42:10','《従来通り》\n\n平成9年、帝石との共同で「吉井・東柏崎スタディ」が実施され、Case1_toc30が平成13年末評価まで埋蔵量に採用されていた。Case1_toc30は、当社が平成8年の中長期計画に基づき生産した場合で、かつ帝石が今後コンプレッサーの能力を30万m3/Dまで増強すると仮定したケースである。\n同ケースの生産予測では、当社の生産は2046年まで継続可能であるが現時点では１ブロックの水の付きかたについてのデータが無く、着水後の生産予測には不確定要素が含まれている。この為、確認鉱量としては帝石生産終了時点（2020年3月）までを計上し、その後の当社生産終了時までの生産量を推定鉱量と位置付けてきた。\n\n（平成14年末評価）\n平成14年にフォローアップ（これまで使用してきたモデルに対し岩相ユニットCへLGR採用、北西側へ水層追加）を実施し、圧力・着水状況マッチング改善。\n将来予測の条件として、現状に合わせるためTOC昇圧能力を30万→15万へ変更、当社の生産プログラムを平成14年の中長期計画へ刷新した。\n修正後のモデルを用いた将来予測結果は、前回評価値よりも確認＋推定で+5.3億m3(+4.0　%)、確認で+3.3億m3(+2.8%)の修正となった。なお、平成18年末時点では、この修正モデ　ルを正式モデルとして採用している。\n\n（平成16年末評価）\n平成16年から、2D震探再解釈を取り入れ、片貝で実績をあげた多点法Geostatisticsによる新油層モデル構築を行ってきたが、最適モデルを得ることは出来ていない。なお、他のスタディとの優先順位から、現在、その作業は中断されている。\n\n（平成18年末評価）\n平成18年、妙法寺ブロックの構造上位に位置する妙法寺SK-1と妙法寺SK-9の坑内調査を実施した所、長期密閉中にも係わらず、水没状態であることが確認された。水レベルは、両坑井とも、－2468mSSLであり、予測よりも100m近く水レベルが上がっていた。\n平成17年末評価では、確認で13.5億m3、確認＋推定で30億m3と見込まれているが、この内の大部分は、吉井Ⅰブロック及び妙法寺ブロックから生産する想定である。そのため、吉井Ⅰブロック及び妙法寺ブロックにどれくらいガスが残っているかが問題となった。\n現在検討作業中であるが、まだ結論が出ていないため、平成18年末埋蔵量評価は、前年を踏襲こととしたが、平成19年末埋蔵量評価には、その検討結果を反映させる予定である。\n\n参考のため、検討作業について、現在までに分かったことを以下に記載しておく。\n	現モデルによる妙法寺ブロックと吉井Ⅰブロックの予測\n	妙法寺SK-1,9の水レベルは、両坑井とも、－2468mSSLであり、予測よりも100m近く水レベルが上がっている。\n	一方、吉井Ⅰブロックの坑井の挙動は、予測と概ね合っている。吉井Ⅰブロックでは、着水し始めた坑井もあるが、ほとんどの坑井でまだ水が着いていない。吉井Ⅰブロックの坑井の仕上げ深度を考えると、妙法寺ブロックの水レベルは吉井Ⅰブロックの水レベルよりも高いと考えられる。\n	現モデルの修正\n	吉井Ⅰブロック・妙法寺ブロックのガス原始鉱量が少なく、妙法寺ブロックの西側の水押しが非常に強い場合、浸透性の良いユニットCを伝わって、妙法寺SK-1,9に水が浸入して来る挙動は表現できる。\n	ただし、吉井Ⅰブロックのガス原始鉱量は、ドラスティックには減る可能性は低いと考えられる。\n	妙法寺ブロックのガス原始鉱量が少なく、かつ妙法寺ブロックの西側の水押しが非常に強いモデルを用いて、挙動の確認を行う必要がある。\n\n（平成19年末評価）\n　　　　吉井モデルの見直し作業をJOEへ委託し行っている。結果が2008年3月末に出る為、平成20年末評価に反映させる。吉井SK-11は、水量率増加の為、2006年11月から昇圧採収をしている。'),(691,78,'2007-12-31',90,NULL,'2008-12-12 13:29:22','《従来通り》\n\nMS-44(2900mA層)の結果を踏まえ、平成12年度評価において容積法による鉱量の見直しが実施された。平成13年度に取得した3D震探データ解釈の結果、評価値を推定鉱量へ計上したが（＠H15末）、確認鉱量については新規掘削データを待って再度評価することとし、前回評価を踏襲する。\n\n（平成12年末評価の解説からの抜粋）\n2900mA3層はMS-44の坑底位置では欠如していた為、同層の鉱量は前年評価より原油が10%の減、ガスが25%の減となった。2900A層は坑底位置でこれまでの評価の２倍の砂岩層厚があったことなどにより総可採鉱量で前年より原油が17%の増、ガスが41%の増となっており、2900mA層群全体の総可採鉱量は原油が8%の増、ガスが13%の増となった。\n\n（平成17年末評価）\n下記の点で変更を行っている。\n①	3D Seismicによる再解釈\n②	定義域の変更（容積法における確認、推定鉱量領域の変更）\n③	回収率の変更\n仕上げ層が変わった坑井は以下のとおり。\nMS-29　（上）2900A/（下）2900A3　－＞　（上）2900A/（下）2900A\nMS-36　　2900A3＋2900A4　－＞　2900A＋2900A3＋2900A4\nMS-37　　2900A3＋2900A4　－＞　2900A＋2900A3＋2900A4\nそれに伴って、総可採鉱量、累計生産量、可採鉱量が大幅に変わった。\n\n（平成19年末評価）\n　　確認鉱量に関しては、前年度評価を踏襲している。確認+推定鉱量は今年からシミュレーションの結果を採用している。シミュレーションではLogの対比と、層の定義が今までと異なる為、2900mA層一括として評価している。詳細は、2900mＡ層一括評価の項を参照。\n'),(692,91,'2007-12-31',90,NULL,'2008-12-18 10:23:43','《従来通り》　　　　　　　　　　　　　　　　　　　　　　　　　　　　　　　　\n昭和６１年末評価において、可採鉱量を昭和６１年の年間生産量の３年分を見込んで計上した。　\n       　　     油　  　 68 kl　×　3　＝　   204 kl\n           　　ガス  10,346 m３  ×　3  ＝  31,038 m３\n\n昭和６２年以降生産実績なし。\n1994年8月に急激な内圧上昇が確認され、Ｖ層との導通が懸念される。\nなお、生産再開には地上設備の整備が必要である。'),(693,104,'2007-12-31',90,NULL,'2009-02-03 09:46:59','　《　従来通り　》\n\n・	2003/2に北MS-1を改修しフローテストを行ったところ、予想に反して1200m3/d程度の産ガス状況であった。BUC解析の結果非常に低浸透性のガス層と評価された。しかし、400m程度しか離れていないSIM-4ではAOFC160,000m3/dの比較的高浸透性ガス層の評価がなされており判断は未だ難しい。\n・	この様な結果を受けて2003年末評価では、確認鉱量は今後実績計上とし、確認＋推定鉱量については1200m層全域の地質状況（特に砂の連続性）がよくわかっていないことからMS-1の結果を反映させず昨年評価を踏襲している。\n・	2005年末評価では確認鉱量については従来通り実績計上とした。06年度SIM-B1を改層予定であることから、推定鉱量については容積法で求められた原始鉱量を基にSIM-2と同等の生産能力を仮定しタンクモデルによる評価を実施した。\n・	2006年末評価では確認鉱量については従来通り実績計上とした。08年度Loc.Yで仕上げを予定していることから、推定鉱量については容積法で求められた原始鉱量を基にSIM-2と同等の生産能力を仮定しタンクモデルによる評価を実施した。\n・	2007年末評価では、2006年末評価と同様に確認鉱量を実績計上とし、タンクモデルによる評価結果を確認＋推定鉱量とした。'),(694,150,'2007-12-31',90,NULL,'2008-12-12 15:28:31','《　従来通り　》\n\n・	2003/2に北MS-1を改修しフローテストを行ったところ、予想に反してWHP 0.06MPA, ガス2800m3/d程度の産ガス状況であった。北MS-1は1,500m層への改層が計画されており、今後生産が見込まれないことから、2005年評価では確認鉱量および確認＋推定鉱量共に実績計上とする。\n・	2006年評価も前年度を踏襲する\n・	2007年7月に北MS-1改層（1500m層）が完了した。2007年末評価についても確認鉱量（実績）のみの計上で変更なし。\n'),(695,105,'2007-12-31',90,NULL,'2008-12-17 13:54:25','　《 従来通り 》\n\n・	従来から認められていたB9とB5&B10のP/Z乖離は導通性調査の結果、地域的な不均質性（断層の可能性を含む）の影響であるとの結論に至った。04年度には旧地質モデルをベースにしたシミュレーションが行われており、ここでもB9とB5-B10間に低浸透エリアを存在させることで良好な圧力マッチングが得られている。３D震探解釈でもB9とB5-B10間に断層が解釈されており整合的である。また、シミュレーションによる水押しの影響に関する検討が実施されており、懸念されていた水押しの影響はさほど強くないという見解が得られている。05年に実施された詳細なスタディでも同様の結果が得られており、シミュレーション法から予測されるOGIPは26～30億m3を示している。\n・	しかし、05年モデルは砂岩の連続性について未だ疑問点が指摘されている。07年には問題とされている地域内に南西MS-1の掘削が予定されており、かつ西MS-1・北MS-1の改修で1,500m層の追加データが得られる予定であることから、その結果を受けてシミュレーションモデルの採用を判断するものとする。この為、05年評価は前年踏襲とする。\n・	05年評価では、昨年同様にB9　P/Zの長期トレンドであるOGIP1830.7百万m3を確認鉱量(1P)のベース、全坑井のP/Zが収束してきたトレンドであるOGIP2786.1百万m3を確認＋推定（2P）のベースとして採用した。\n・	2006年評価も前年度を踏襲する。（データが追加されたが特に変更するにいたらなかった。）\n・	2007年は北MS-1が1500m層に改層されたほか、南西MS-1のMDTデータが追加されたが、北MS-1を含む既存坑井の圧力データは坑井作業・需給の都合上取得できなかった。2007年末の物質収支法（P/Z）によるOGIP評価は確認・確認＋推定ともに変更なし。'),(696,106,'2006-12-31',90,NULL,'2008-12-16 15:47:33','　'),(697,107,'2007-12-31',90,NULL,'2008-12-17 16:06:56','　《 再評価 》\n\n・	2002年に1600m層のフルフィールド・シミュレーションモデルを作成し鉱量評価を実施。2003年5月1600m下層を対象層としたMS-B13を掘削したところ、掘削前予想と比べて有効層厚が23mも厚く、かつ水層と油層を遮断する役割を持つ泥岩があるなど当初予想より良好な地質状況であった。B13掘削後のデータを追加しモデルの変更を実施したところ、油原始鉱量で73.8千KLの増加となった。MS-B13も当初予想よりも着水時期が遅れる等の理由で油回収増加が見込まれる。\n・	2005年末評価は既存モデルに生産履歴を追加し、B13の生産状況（着水）をあわせるべくフォローアップを実施した。その結果、油原始鉱量で67.5千KLの増加となった。このモデルを用い埋蔵量の評価を行なっている。なお、ガス増販計画に伴いSIM-B5は1500m層を採収する為、06から07年にかけての11ヶ月間のみの生産となっている。SIM-B5の1500m層への改層および経済限界が2010年（1年前倒し）となったことから、確認鉱量および確認+推定鉱量のガス・油可採鉱量は大幅に減少することとなった。（油確認可採で42.3千KLの減少）\n・	現在の販売計画下では1,500m層の代替坑井を確保しなければ取り残し鉱量が発生する状況となっている。\n・	2006年末評価では、2005年同様既存モデルをアップデ－トし、使用した。SIM-B13の酸処理成功を見込んで、酸処理後は80kl/dの設定としている。可採鉱量の減少分は本年より取り入れたガスリストの制限による。（ガスリフト用ガス井の坑口圧が7.0MPa以下になった時点で、油の生産量をゼロとするもの。）\n・	2007年末評価では、GORとSIM-B13酸処理後の生産能力のマッチングを改善する目的で’03モデルのパラメータ（残留ガス飽和率とB13スキンファクター）を見直した。またガスリフトなしの条件でシミュレーションを行っていることから、長期予測では岩船沖のガスリフトが終了した後も生産継続としている。'),(698,151,'2006-12-31',90,NULL,'2008-12-12 15:59:16','　《　従来通り　》\n\n・	2003/2に北MS-1を改修しフローテストを行ったところ、予想に反してWHP 0.03MPA, 油4.8 KL/D程度の産油状況であった。北MS-1は1,500m層への改層が計画されており、今後生産が見込まれないことから、2005年評価では確認鉱量および確認＋推定鉱量共に実績計上とする。\n・	2006年評価も前年度を踏襲する。\n・	2007年7月に北MS-1改層（1500m層）が完了した。2007年末評価についても確認鉱量（実績）のみの計上で変更なし。\n'),(699,151,'2007-12-31',90,NULL,'2008-12-12 15:59:40','　《　従来通り　》\n\n・	2003/2に北MS-1を改修しフローテストを行ったところ、予想に反してWHP 0.03MPA, 油4.8 KL/D程度の産油状況であった。北MS-1は1,500m層への改層が計画されており、今後生産が見込まれないことから、2005年評価では確認鉱量および確認＋推定鉱量共に実績計上とする。\n・	2006年評価も前年度を踏襲する。\n・	2007年7月に北MS-1改層（1500m層）が完了した。2007年末評価についても確認鉱量（実績）のみの計上で変更なし。\n'),(700,108,'2007-12-31',90,NULL,'2008-12-17 14:02:14','　《 再評価 》\n\n・	2002年末評価まではシミュレーションによる評価を実施していたが、1900m層の各坑井で明らかな減退傾向が認められること、現シミュレーションモデルには圧力、水マッチング等問題もあることから、2003年末評価より評価を減退曲線法に切り替えた。2004年末には生産履歴を追加して減退曲線法による評価を行なっている。\n・	減退傾向に変化が見られないことから、2005年末評価は昨年の減退曲線を踏襲した。但し、04年評価の際にB１SのGORを556m3/KLと評価していたが、この高GORは、その後の生産挙動から計量上の問題であることが判明した。従って本年の評価ではB1SのGORのみを108.6m3/KLに修正再評価した。これによりガスの総可採鉱量が若干減少することとなった。\n・	SIM-BI1Sは、2007年に1200m層との2層仕上げに改修予定であるが、2007年以降も2050m層とコミングルで生産を継続するものとした。\n・	2006年末評価は、前年度同様減退曲線法評価であるが、本年より取り入れたガスリストの制限（ガスリフト用ガス井の坑口圧が7.0MPa以下になった時点で、油の生産量をゼロとするもの）により、可採鉱量が減少している。\n・	2007年末評価では減退曲線のアップデートのみ行った。長期予測では昨年同様ガスリフト終了時に採収終了としている。'),(701,109,'2007-12-31',90,NULL,'2008-12-17 16:09:31','《 再評価 》\n・	2003年末評価より減退曲線法による評価方法を採用している。構造頂部のB4Sは二次ガスキャップの温存から長期密閉していたが、2002年11月から開始し、油レート50KL/Dで生産を継続していた。またGORは当初、1,000m3/KL程度あったものの徐々に減少し180m3/KLに低下した。B2Sは2003/9、B3Sは2004/4に高水量率の為に生産を中止している。\n・	2004年末評価では、既にB4Sに減退傾向が認められていたが、B2S及びB3Sの密閉によるB4Sの増油を期待して、03年評価の減退曲線の減退開始時期を1年遅らせて評価している。\n・	しかし、その後もB2S及びB3S密閉の影響がB４Sに見られないことから2005年末評価では、05年末までの生産履歴を追加して減退曲線の見直しを実施した。その結果、油総可採鉱量は917.7千KLと前年度に較べて44.5千KLの減となった。\n・	2006年末評価は、前年度同様減退曲線法評価であるが、本年より取り入れたガスリストの制限（ガスリフト用ガス井の坑口圧が7.0MPa以下になった時点で、油の生産量をゼロとするもの）により、可採鉱量が減少している。\n・	2007年末評価では減退曲線のアップデートのみ行った。長期予測では昨年同様ガスリフト終了時に採収終了としている。'),(702,110,'2007-12-31',90,NULL,'2008-12-17 14:07:26','《 再評価 》\n・	2004年末評価は前年度踏襲。確認＋推定鉱量ではこれまでB1Sを2007年より1200m層に改層するものとしていたが、1200m層との同時仕上げの方針に基づき、2007年以降も1900m層とコミングルで生産を継続するものとした。\n・	2005年末評価では、05年末までの生産履歴を追加して減退曲線の再評価を実施した。採算限界が2010年（1年前倒し）になった為、総可採鉱量が微減している。\n・	2006年末評価は、前年度同様減退曲線法評価であるが、本年より取り入れたガスリストの制限（ガスリフト用ガス井の坑口圧が7.0MPa以下になった時点で、油の生産量をゼロとするもの）により、可採鉱量が減少している。\n・	2007年末評価では減退曲線のアップデートのみ行った。長期予測では昨年同様ガスリフト終了時に採収終了としている。'),(703,111,'2007-12-31',90,NULL,'2009-07-28 13:36:41','　《 再評価 》\n・	2003年末評価より長期密閉中のB4Lを除く4坑井で減退曲線法による評価を採用している。2004年末評価についてはスタディを実施中であることから確認鉱量及び確認＋推定鉱量ともに昨年度評価を踏襲している。しかし、03年末以降、B6L及びB8Lの着水傾向が顕著になっており着水以前の減退傾向（03年評価）を踏襲すると、04年末時点で既に実際の生産履歴と予測値が明らかに大きく乖離した状態となっている。着水後の生産履歴を追加した減退曲線で評価した場合、総可採鉱量は2220.3千KLであり、04年評価は95.4千KLの過大評価となっている。\n・	また04年末評価は、確認+推定鉱量としてB４L開放ケースを想定し166.5千KLを計上している。しかし、04年6月～11月に実施したB4L長期フローテストで既に減退傾向が観測されており、B４Lの可採鉱量としては最大限見積もったとしても56千KL程度（実際は更に少ない）であることが判明している。この為、確認+推定総可採は最大でも2277.0千KL程度であると考えられ、04年評価は少なくとも237.0千KLの過大評価となっている。\n・	2004年12月からガス圧入法のパイロットテストが開始され、顕著な増油が確認された。これを受けて2006年1月からIOR(ガス圧入)による操業を開始した。2005年評価ではIORによる二次増油分（68.6千KLの増）を見込み、確認総可採鉱量は2288.9千KLと評価されるが、上記理由により04年評価の確認総可採鉱量と比較すると26.8千KLの減少となる。\n・	2005年評価の確認+推定鉱量総可採にはIORによる増油（Loc-V掘削を含む）206.8千KLを見込み一次量と合わせ2427.8千KLを計上する。IORの増油（206.8千KL）からB4L開放分（56千KL）を引いた差分（150.8千KL）が少なくともIORによる増油になるが、04年評価が少なくとも237.0千KLの過大評価である為、05年評価は差し引き86.2千KLの減少となる。\n・	2006年末評価では、本格的にIORが実施されたため、昨年までの減退曲線法からシミュレ－ションによる評価へ変更している（5realization、P.90）。そのため、IORの継続による増油を見込んでおり、可採鉱量が増加した。\n・	2007年末評価についてもシミュレーションによる鉱量評価を行った（確認：P90、確認＋推定：P50）。2006年末評価に使用されたモデルと異なる点は、JOEスタディにてTBGテーブルを見直したこととLoc.V位置の最適化を行ったこと（i.datを比較するとKroのエンドポイントも異なっていた）。'),(704,114,'2007-12-31',90,NULL,'2008-12-12 16:08:17','《　従来通り 》\n\n・	岩船沖油田北部砂岩層の広がりを確認するため、2000年度に北MS-1の探掘を実施した。既存エリアの1900m層及び2000m層に相当する砂岩層をテストした結果、油の産出が確認され両層を１ストリング２パッカーで仕上げを行い、2000/12/4に採収井に編入した。\n・	2000m層はDST時点で50KL/Dの油生産量を確認したものの、排泥フローテストでは3KL/Dまで低下した。BUC解析によるとスキンが100以上と多大な坑井障害が認められた為、2001/3にフッ化水素酸による酸処理を実施した。酸処理の結果坑井障害は除去され油生産量も45KL/Dまで回復したものの生産が進むにつれて2ヶ月間で約20KL/Dまで低下していった。円筒形モデルによるシミュレーションの結果、坑井近傍半径100ｍポイントにTransmissibilityが周辺の15％であるバリアを設定することによって全てのパフォーマンスが再現可能になった。このスタディ結果は、コヒーレンス解釈によるMS-1周辺の微細断層の存在と調和的である。\n・	2003/2に廃層。累計生産量を総可採鉱量として計上している。\n \n'),(705,112,'2007-12-31',90,NULL,'2008-12-17 16:05:32','　《 従来通り 》　\n・	2800m層は2900m層の優先採収のため2002/8以降長期密閉している。2002年末評価では、確認鉱量はJIS規格に準拠し容積法で計上し、確認+推定鉱量では、P/Zによりガス原始鉱量を239.2百万M3と評価し計上していた。2003年末評価では確認鉱量としてガス生産レートの減退に基づく減退曲線法に変更した。確認＋推定鉱量は基本的に昨年評価を踏襲しているが、初期GOR、コンデンセートガス係数他物性値の見直しからガス原始鉱量が239.2→227.5百万m3に変更されている。2004年末評価は2003年評価と同じである。\n・	06年1月の改修後実施されたフローテストにおいて03年評価で確認鉱量の根拠としていた減退傾向が見られず、減退法で予測された生産量より高いガスレートで安定した生産が可能であることが明らかとなった。この為、評価方法を減退曲線法から物質収支法へ変更した。\n・	2005年末評価では、03年評価の確認+推定鉱量を確認鉱量にランクアップさせた。また貯留層状態でのガス物性値見直しにより原始鉱量は227.5→230.7百万m3に変更になっている。確認+推定鉱量には長期密閉後の圧力のみを評価に用いたP/Z（ガス原始鉱量474.0百万M3）を採用する。2900ｍ層優先採収のため、経済限界までに生産再開できず、確認可採鉱量はゼロ評価となる。\n・	2006年末評価では、南MS-1のDual string化を見込み、可採鉱量を計上している。そのため、評価は前年と同様であるが、2900m層と同時に生産ができるため可採鉱量増加となった。\n・	2007年は南西MS-1の掘削・仕上げが行われたほか、南MS-1aがDual string化（改修）された。南西MS-1の圧力データが追加されたが、南MS-1a2800m層と同一/別プールかを断定するには長期生産テストを行って圧力の推移を観察する必要があると考えられる。南西MS-1圧力が若干ながら（0.2MPa程度）南MS-1aの初期圧力を下回っていたことから、2007年末評価では南MS-1aと同一プールとして物質収支法（P/Z）による鉱量評価を行ったが、OGIP評価を変更するにはデータ不足と判断し確認・確認＋推定ともに変更なしとした。ただし生産坑井追加による早期回収効果で総可採鉱量は増加している。'),(706,155,'2007-12-31',90,NULL,'2008-12-12 16:13:42','《 従来通り 》　\n・	岩船沖油田の椎谷層砂岩の広がりを確認するため、2005年度に西MS-1の試掘を実施した。2800m層に相当する砂岩層をテストした結果、ガスの産出が確認され、2000/12/4に採収井に編入した。DST時点では60.7千m3/Dのガス生産量を確認したものの、排泥フローテスト後の圧力測定で貯留層圧力の顕著な低下が認められた。この為、2005/11/9から鉱量の調査を目的として長期フローテストを実施した。その結果、最終的にガス生産量が1600m3/Dまで減少し、かつ貯留層圧力も累計生産量の増加とともに低下していることが判明した。従って本層は砂の広がりが小さく、既存の2800m層とは別プールを形成していると判断された。\n・	2005年末評価では、確認鉱量としてフローテスト期間中に測定された貯留層圧力（長期密閉のデータのみ）を使用し、物質収支法の評価を実施した。その結果、最大限見積もってもガス原始鉱量は6.0百万M3程度と評価された。また、Back Pressure testの結果から現在のAOFCは約25,000m3と予想され、安定的に連続生産できるレートは2000m3/D程度と考えられる。これは液体汲み上げに必要な最低ガスレートを大きく下回っており、いつ自噴停止してもおかしくない状況である。\n・	07年に坑排水圧入井へ転用するが、改修を実施するまでに可能な限りの採収を行なうこととし確認可採鉱量を新規計上する。\n・	2006年度評価では、坑排水圧入井への転用のため実績計上とした。\n・	2007年7月の改修作業により西MS-1は2100m層への坑廃水圧入井に編入された。\n \n'),(709,162,'2007-12-31',90,NULL,'2008-12-17 17:03:41','　《　新規計上　》\n・	2007年に南西MS-1の掘削・仕上げが実施され、新たに2850m層が発見された。2008年1月にフローテスト（80hr）を行ったところ、坑井開放直後から坑口圧・生産レートの減少傾向が見られた。坑井密閉後に117hrのBUC測定を行ったが、BUC測定終了時の坑底圧力はフローテスト前と比較して6MPa程度低く、また依然顕著な上昇傾向を示していたためP*の推定が困難な（どのようなP*を与えてもマッチングできる）状況であった。そこで物質収支法による鉱量評価は行わずフロー中の減退曲線から鉱量を推定したが、数十万m3オーダーの可採鉱量しか見込まれないため、確認鉱量については実績計上、推定鉱量は見込まないこととした。'),(710,113,'2007-12-31',90,NULL,'2009-01-26 12:00:38','　《　従来通り　》\n・	2003年末評価は確認鉱量としてP/Z初期3点データを使用した物質収支法を採用している。ガス原始鉱量は135.8百万m3、回収率は50％を採用した。確認＋推定鉱量は基本的に昨年評価を踏襲しているが、初期GOR、コンデンセートガス係数他物性値の見直しからガス原始鉱量が332.8→322.6百万m3に変更になった。2004年末評価では12月末時点でガス累計生産量が67.1百万m3となり、昨年度評価の総可採鉱量を超えることが確実となったことから推定考量を確認鉱量にランクアップした。その結果ガスの総可採鉱量は161.1百万m3となっている。\n・	改修後の2006/01/28に測定された坑底圧力は、昨年評価のP/Z法で予測される圧力に対して非常に高い圧力を維持しており、鉱量の大幅な増加若しくは強い水押の可能性を示唆している。また、地質モデルを考え合わせると水層の存在を仮定する方が整合的である。\n・	2005年末評価は確認鉱量として2004年評価モデルを採用した。但し、ガス物性値の見直しによりガス原始鉱量が322.6→320.7百万m3となった。また、確認＋推定鉱量は改修後の圧力を再現する為、SchilthuisのSS Aquifer Modelを採用し評価した。ガス原始鉱量は302.5百万m3と確認の原始鉱量より小さくなるが圧力が高く維持される為、確認+推定の可採鉱量は45.5百万m3の増加となった。\n・	2006年末評価では、圧力デ－タとP/Zのトレンドの乖離が顕著になったため、見直しを行い、SchilthuisのSS Aquifer Modelを採用し評価した。確認鉱量ではガス原始鉱量が320.7→290.1百万m3となり、確認＋推定鉱量ではガス原始鉱量が302.5→376.6百万m3となった。\n・	2007年は南西MS-1の掘削・仕上げが行われたほか、南MS-1aがDual string化された。DST時の南西MS-1油層圧力は南MS-1a初期圧力よりも低く既発見2900m層（南MS-1a）と同一プールであると判断されたが、仕上げ後1MMm3程度の生産で密閉圧力が3MPa以上低下しており、南MS-1aとは別プールである可能性も考えられる。南西MS-1圧力データの信頼性に問題はないと考えられるが、別プールと断定するにはデータ不足と判断し、2007年末評価では従来の解釈通り同一層として物質収支法（SS Aquifer model）による鉱量評価を行った。南西DST時圧力は2005年末評価における確認＋推定ライン上にプロットされるものの、上記のように南西は南と別プールである可能性が残っているため、OGIP評価は変更しないこととした。'),(711,106,'2007-12-31',90,NULL,'2008-12-17 16:57:18','　　《 従来通り 》\n\n・	99年末埋蔵量評価から数値モデルが採用されている。モデルは円筒格子型であり、密閉時の大きく且つ緩やかな圧力回復を表現するため浸透率がコンポジット型で弱い水押しを想定しており、ヒストリーマッチングは比較的良好である。採算限界である2010年末までの累計生産量を総可採鉱量として計上している。\n・	岩船沖のガス増販計画に伴い、需給を満たす為にB10は1500m層を優先的に採収する必要がある。従って05年評価では採算限界の2010年までには生産を再開できない状況となっており、05年の確認可採鉱量はゼロ評価となる。\n・	2007年末評価においても、販売ガス確保のためにB10は1500m層優先採収としたほか、Loc.Y(2string、1200/1500/1550m層仕上げ予定)についてはSIM-4で実績のある1200m層、1500m層の生産を優先したため、確認鉱量ベースの長期予測では1550m層の生産が見込めなかった（よって確認鉱量は実績計上で変更なし）。確認＋推定鉱量には’99シミュレーション結果を採用した（B10からの採収期間：52ヶ月）。\n \n'),(712,57,'2007-12-31',90,NULL,'2008-12-18 10:07:52','《従来通り》\n\nこれまでガスの確認鉱量については、坑井別の減退曲線法（SK-22下＠昭和59年末評価、SK-23＠平成元年末評価）による評価結果が、油については層全体の一括評価結果（評価方法は不明）が採用されてきた。\n（平成16年末評価）\n平成17年中にSK-23累計ガス生産量が確認鉱量を上回ることが予想されたため、同坑井の鉱\n量見直しを行うとともに油の鉱量を坑井別評価に変更した。またSK-23はこれまで自噴線内ハイドレート生成トラブルのため冬季は生産できない状況であったが、平成16年にラインヒーターを設置し通年採収が可能となった。\n（平成17年末評価）\nSK-23についてはデータ追加によって評価結果が大きく変わらない点、SK-22については、平成17年度に生産がなかったことより、前回評価値を踏襲する。\n（平成18年末評価）\n坑井の生産状況を考慮した結果、水付きによる可採鉱量の不確実性が高いと判断し、実績計上とした。\n\n（平成19年末評価）\n唯一の対象井である紫雲寺SK-23は、H18年以来生産していない為、昨年度評価を踏襲する。なお、紫雲寺SK-23（2950m+3000m層）の生産予定はなく、平成20年度に改修を行う予定である。'),(713,71,'2007-12-31',90,NULL,'2008-12-17 17:11:33','《従来通り》\n\n本層は未採収のため、昭和62年末の鉱量評価を踏襲した。\n平成15年11月、CTU浚い作業実施し、砂による坑内閉塞の改善および現油層圧力を確認した。浚い後の生産状況は、以下の通り。\nガス47,000m3/D、油10.0KL/D、水0.0KL/D（＠D.D.：3.1%, Pws：20.61MPa）\n現在、MS-31中（2340mA,B1,B2）を採収中。\n'),(714,95,'2007-12-31',90,NULL,'2008-12-18 10:27:53','《従来通り》\n	\n昭和61年にシミュレーションスタディ(COMP3)を実施し、鉱量の見直しを行なった。\n(OGIP: 16.80 →14.06億m3、総可採鉱量：12.67 →9.98億m3、総圧入可能量:6.04億m3)\n本年も昭和61年末評価を踏襲する。\n圧入ガスの回収率はオペレーションの仕方により異なるが、ここでは回収率100％としている。平成5年4月以降、圧入実績は無い。なお、寄託ガスについては、平成6年に返還を終了している。\n\n（平成11年末評価）\n平成11年4月にSK-1の再生産テストを実施、OFC=4,189千m3/d。\n　（平成19年末評価）\n　　　見直しをする要素もないことから、前年度踏襲とする。'),(715,1,'2008-12-31',90,NULL,'2009-03-18 11:49:41','従来、ブラックオイルモデルによる評価結果（2003年末評価）を確認鉱量としていた。2007年末確認鉱量では、高い岩石圧縮率を想定したブラックオイルモデルについて、マッチング状況が大きく変化していないことを確認したうえで将来予測を行い、従来評価(2003年末)と大差ないことを確認している。\n2008年末評価では、当初、新たな3D震探データを用いた構造解釈を反映したモデルで進めていたが、構造解釈が刻々と更新中であることから、シミュレーション用の貯留層モデルの枠組みは従来モデルを使用することとした。ただし、定期坑底圧測定結果から、南勇払SK-1GNの圧力挙動が他坑井と異なる傾向が顕著になったため、下記の修正を施してヒストリーマッチングを行った。\n・南勇払SK-1GN周辺と他領域との間に導通性を下げる境界 を想定する。\n・上記に応じて、南勇払SK-1GN周辺アキファー部のフラクチャー孔隙容積を上げ、反対に、あけぼの周辺のアキファー部の容積を下げた。\n・掘削結果に応じて、沼ノ端SK-7D, SK-8D/8D-1周辺の浸透率を下げた。\n将来予測のための各坑井の条件としては、フロー時の坑底圧･坑口圧をPIでマッチングさせて、坑口圧の下限･水量(各坑井)<30KL/Dを拘束条件とした。適正生産量の条件は、予測開始時点(2009年1月)でのみ付与した。また、予測においては、H21年度掘削予定の沼ノ端SK-10D(Loc.B4), 中長期計画に含まれている｢あけぼのLoc.B3｣を設定した。ただし、前者については、シミュレーションモデルの中では、沼ノ端SK-1D(& 6D)とそれぞれ同一セルに設定される。\n油量については、確認鉱量評価では、最近の実績傾向(GORと累計ガス生産量との関係)を外挿して求めた。'),(716,113,'2008-12-31',90,NULL,'2009-01-28 16:12:23','鉱量を坑井ごとにのテスト中...。'),(717,33,'2008-12-31',90,NULL,'2009-02-16 11:20:39','《従来通り》\n\n本層唯一の稼働坑井である東由利原AK-2は日量約150m3/D～300m3/Dで生産を行っている。安定した生産が望めないことから、2000年（H12）末より、実績値の計上としている。'),(718,34,'2008-12-31',90,NULL,'2009-02-16 11:20:47','《従来通り》\n\nSK-1、SK-2は採収を終了し、圧入井に転用済。SK-4、SK-7については自噴不調となった後、長期密閉となっており、鉱量は計上しない。SK-5は圧力の回復を待って開放するサイクル採収を行っていたが、圧力の回復が小さくなり、長期に密閉しても改善が望めないため、2000年（H12）末から鉱量を計上していない。'),(719,35,'2008-12-31',90,NULL,'2009-02-20 13:31:29','《再評価　新基準PRMS2007への移行》\n\n改修作業が必要な3坑井（SK11,SK14,西SK1)で見込まれる鉱量を、2001年（H13）末評価以降、確認鉱量（区分3）として計上していた。しかしながら、新評価基準（PRMS2007）の可採鉱量として認定する為には、開発（改修）計画の合理的期間内（通常5ヵ年）での実施およびその会社承認が要求される。本年の評価時点では改修実施に向けた投資計画の承認が得られておらず、可採鉱量として認定できない。従って上記3坑井で見積もられた鉱量を条件付資源量へ移動し、実績計上とする。'),(720,17,'2008-12-31',90,NULL,'2009-02-16 14:39:47','《採収終了》\n\n全坑井廃層済み。採収終了。'),(721,36,'2008-12-31',90,NULL,'2009-02-25 14:18:01','《再評価　新基準PRMS2007への移行》　　経済限界　20５8年末\n\n新評価基準(PRMS2007)へ算定方法を変更する。\n減退曲線法で予測される生産量の中で、経済的に採収可能と考えられる油ガス量を確認鉱量として計上する。\nSK-10は自噴停止となり、再生産テストでも水のみの産出となったため、2002年（H14）末評価以降、実績値計上。2004年（H16）は水圧入テストを実施。南鮎川AK-1, 中鮎川SK-1については、DST時の実績値のみ計上。\nSK-14は、坑口圧力がほぼ一定化した2005年以降で、かつ同一B/S(5mm）時の単計データを用い減退曲線を再評価した。下限GWRを2000m3/KLに設定したケースを確認鉱量に採用する。'),(722,36,'2008-12-31',50,NULL,'2009-02-25 14:18:01','《再評価　新基準PRMS2007への移行》　　経済限界　2079年末\n\n新評価基準(PRMS2007)へ算定方法を変更する。\nSK-14減退曲線の下限GWRを1500m3/KLまで採収可能と仮定したケースを採用し、経済限界までに採収可能と考えられる油ガス量を推定鉱量として計上する。'),(723,37,'2008-12-31',90,NULL,'2009-02-25 14:17:51','《再評価　新基準PRMS2007への移行》　　　経済限界　2058年末\n\n需給調整に伴いB/Sが頻繁に変更されている。坑井解放後急速に生産量が減少する特徴が観測されるが、密閉により生産能力が回復している。低生産性（貯留岩性状が悪い）の影響で、局所的な圧力低下が生じていると考えられる。減退曲線法の適用には適していない為、複数坑井モデルによる物質収支法による評価へ変更する。各坑井で測定された貯留層圧力にバラツキが観測される為、平均貯留層圧力の推定差から確認モデル(GIP=215MMm3)と推定モデルを設定した。\n\n確認モデルを用い、経済限界までに採収可能と考えられる油ガス量を確認鉱量として計上する。'),(724,37,'2008-12-31',50,NULL,'2009-02-25 14:17:51','《再評価　新基準PRMS2007への移行》　　経済限界　2079年末\n\n想定平均貯留層圧力の違いにより、推定モデル（GIP＝320MMm3）を採用した。\n推定モデルを用い、経済限界までに採収可能と考えられる油ガス量を推定鉱量として計上する。'),(725,38,'2008-12-31',90,NULL,'2009-02-25 14:19:19','《再評価　新基準PRMS2007への移行》　　経済限界　2058年末\n\n2007年末評価ではJIS規格の容積法が採用されていたが、本年より新評価基準PRMS2007へ算定方法を変更する。\n\n200７年JOEに委託しBⅠ層シミュレーションモデルが作成された。同モデルは枕状溶岩分布域全てに有効孔隙を想定している。2009年1月、同モデルのフォローアップスタディを実施し、坑井で確認された生産能力および油ガス徴を基に油ガスの分布範囲を限定し、埋蔵量評価用モデルを新たに作成、再ヒストリマッチングを実施した。\n　　　①確認モデル（１P）は、坑井テストで十分な生産能力があると確認された領域\n　　　②確認+推定モデル（２P)は、坑井で良好な油ガス徴が確認された領域\n　　　③確認+推定＋予想モデル（３P)は、枕状溶岩分布域（JOEモデル）\n\n①確認モデルによる生産予測値を採用し、経済限界までに採収可能と考えられる油ガス量を確認鉱量として計上する。'),(726,38,'2008-12-31',50,NULL,'2009-02-25 14:19:19','《再評価　新基準PRMS2007への移行》　　経済限界　2079年末\n\n２００９年1月作成されたモデル②確認+推定モデル（２P)による生産予測値を採用し、経済限界までに採収可能と考えられる油ガス量を推定鉱量として計上する。'),(727,39,'2008-12-31',90,NULL,'2009-02-25 14:21:21','《再評価　新基準PRMS2007への移行》　　経済限界　2058年末\n\n2007年末評価ではJIS規格の容積法が採用されていたが、本年より新評価基準PRMS2007へ算定方法を変更する。\n\n前年評価では、SK8Sおよび東AK１を減退曲線法で評価している。しかし、観測されている減退傾向は、SK8S：GOR上昇に伴う油生産量の低下（相対浸透率の影響）、東AK1：密閉により繰り返し生産能力が改善しているおり、局所的な圧力低下の影響、による見かけの減退傾向であると考えられことから、現時点での減退曲線法の適用は困難と判断する。\n\n2009年1月、新評価基準（PRMS2007)に準拠した容積法の再評価を実施し、この容積法鉱量を基にB2層シミュレーションモデルを新たに構築、ヒストリーマッチを実施した。（6成分コンポジショナルモデル）\n確認モデルとして、容積法１P鉱量を基に作成されたシミュレーションモデル採用し、その生産予測値を用いて確認可採鉱量を評価した。採用したシミュレーションモデルは、OOIP:１６７万KL、ネットグロス比12%相等となっている。'),(728,39,'2008-12-31',50,NULL,'2009-02-25 14:21:21','《再評価　新基準PRMS2007への移行》　　経済限界　2079年末\n\n2009年1月、新評価基準（PRMS2007)に準拠した容積法の再評価を実施。推定モデルには、容積法２P鉱量を基に作成したシミュレーションモデル採用し、その生産予測値を用いて確認＋推定可採鉱量を評価した。採用したシミュレーションモデルは、OOIP:241万KL、ネットグロス比16%相等となっている。'),(729,40,'2008-12-31',90,NULL,'2009-02-25 14:22:17','《再評価　新基準PRMS2007への移行》　　経済限界　2058年末\n\n2007年末評価ではJIS規格の容積法が採用されていたが、本年より新評価基準PRMS2007へ算定方法を変更する。\n\n本層は、2002年にシミュレーションモデルが作成され、その結果をもって由利原増産計画が策定されている。しかしながら、本格的な増産開始前の評価であり、かなりの不確実性を内包していると判断された為、確認鉱量モデルへの採用が見送られてきた。\n\n2009年1月、増産後の生産履歴を用いシミュレーションモデルの修正作業を実施した。併せて、2002年モデルの問題点として指摘されてきた原始鉱量（水－油膨張による圧力マッチング手法）についてセンシティビティ調査を行い不確実性を評価した。この結果、複数の水－油容積比の組み合わせにおいて生産挙動が再現できることが判明した。\n\nこれら生産挙動を再現するシミュレーションモデル群の中で将来採収可能な油ガス量が最も小さくなるモデルを確認鉱量用に採用し、経済限界までに採収可能と考えられる油ガス量を確認鉱量として計上する。'),(730,40,'2008-12-31',50,NULL,'2009-02-25 14:22:17','《再評価　新基準PRMS2007への移行》　　経済限界　2079年末\n\nシートフロー溶岩の平均初期水飽和率は、坑井検層の解釈結果から、90％程度であると見込まれている。検層解析結果に従い、シートフロー溶岩の平均初期水飽和率を90％とし、かつ生産挙動を再現するモデルを推定鉱量用のモデルとして採用する。同モデルを用いて経済限界までに採収可能と考えられる油ガス量を推定鉱量として計上する。'),(731,149,'2008-12-31',90,NULL,'2009-02-16 10:22:25','《採収終了》\n\n低生産性のため、生産せず。TBG内にPlugをセット済み。'),(732,41,'2008-12-31',90,NULL,'2009-04-13 16:48:30','《再評価　新基準PRMS2007への移行》　　経済限界　2058年末\n\n2007年末評価ではJIS規格の容積法と減退曲線法の組み合わせが使用されていたが、本年より新評価基準PRMS2007へ算定方法を変更する。\n\n本層は、1999年に簡易シミュレーションモデルが作成され、その後の生産履歴を用いて、2002年および、2004年にモデルの見直しが実施されている。当初、北地区の3～7層（北AK-1の油層部分）、西地区（新AK-1、西SK-1のブロック）、東地区のOn-１層（ガス層、東AK-1、北AK-1）間の同通性が検討されてきたが、その後実施された坑底圧力測定によりブロック間導通がないことが確認された。\n\nまた、北地区の3～7層（北AK-1の油層部分）で測定された貯留層圧力は、シミュレーションモデルの予測値より高く維持されており、かつ、北AK-1(YC1)着水後の水量率増加傾向が予測と比べ非常に緩やかであることなど、同モデルの明らかな鉱量不足を示唆している。今後、西子川地区との同通性を含め地質及びシミュレーションモデルの再構築が必須と考えられる。\n\n本年末評価では、新評価基準に準拠し見直された容積法による評価結果と、坑井の生産挙動の状況から、現在のシミュレーションモデルで予測される鉱量は、確認鉱量の基準を満たすと判断した。\n従って、同モデルを用いて経済限界までに採収可能と考えられる油ガス量を確認鉱量として計上する。（推定鉱量の確認鉱量への格上げ）。'),(733,41,'2008-12-31',50,NULL,'2009-04-13 16:48:30','《再評価　新基準PRMS2007への移行》　　経済限界　2079年末\n\n2009年1月、新評価基準に準拠し容積法の再評価が実施された。この評価結果に基づき、シミュレーションモデルの鉱量配分を修正・再ヒストリーマッチを実施した。修正後モデルもなお、北地区の3～7層（北AK-1の油層部分）の圧力が、実測値より低く推移している。西子川地区との同通性を含めた地質再検討及びシミュレーションモデルの再構築が必要と考えられる。\n\n2008年末評価では、容積法２P鉱量を基に修正を加えたシミュレーションモデルを推定鉱量用のモデルとして採用する。同モデルを用いて経済限界までに採収可能と考えられる油ガス量を推定鉱量として計上する。'),(734,42,'2008-12-31',90,NULL,'2009-02-25 14:25:57','《再評価　新基準PRMS2007への移行》　　経済限界　2058年末\n\n西子吉川SK-1は、2001年（H13）2月4日から同年3月6日にかけて4層に対して計6回のDSTを実施し、No.2 DST区間の女川ドレライト層にて油の、No.4 DST区間の船川層福山安山岩にてガスの産出を見た。平成15年11月にガス層のフローテストを実施し、PBU解析結果によって、可採鉱量の下方修正を行った。船川層のガスに関しては、需給の逼迫により、2007年（H19）度に自噴線を敷設し、12月より生産を開始した。\n\n本年末評価では、2008年末までに観測されたデータにおいて貯留層圧力の低下傾向が明瞭になってきた為、物質収支法による評価へと切り替えを実施する。想定される水押しの強さの違いにより、①確認鉱量モデルと②推定鉱量モデルを設定した。\n①確認モデルを用いて経済限界までに採収可能と考えられる油ガス量を確認鉱量として計上する。'),(735,42,'2008-12-31',50,NULL,'2009-02-25 14:25:57','《再評価　新基準PRMS2007への移行》　　経済限界　2079年末\n\n物質収支法モデルのなかで、圧力推移を最も良く再現しているモデルを推定モデルとして採用し、経済限界までに採収可能と考えられる油ガス量を推定鉱量として計上する。\n\nまた、昨年末評価までは、女川ドレライト（油）層の容積法算定値を推定鉱量として計上していたが、採収設備の設置計画が承認されておらず、新評価基準（PRMS2007)が可採鉱量に求める要件を満たしていない。従って、該当鉱量を条件付資源量へ移動する。'),(736,1,'2008-12-31',50,NULL,'2009-03-18 11:49:41','従来、物質収支法による評価結果（2000年末評価）を確認＋推定鉱量としていた。2007年末確認＋推定鉱量については、ブラックオイルモデル(岩石圧縮率はガスサイクリングスタディと同様の値)を使用して将来予測を行い、同様に従来評価(2000年末評価)と大差ないことを確認している。\n2008年末評価では、当初、新たな3D震探データを用いた構造解釈を反映したモデルで進めていたが、構造解釈が刻々と更新中であることから、シミュレーション用の貯留層モデルの枠組みは従来モデルを使用することとした。ただし、定期坑底圧測定結果から、南勇払SK-1GNの圧力挙動が他坑井と異なる傾向が顕著になったため、下記の修正を施してヒストリーマッチングを行った。\n・南勇払SK-1GN周辺と他領域との間に導通性を下げる境界 を想定する。\n・上記に応じて、南勇払SK-1GN周辺アキファー部のフラクチャー孔隙容積を上げ、反対に、あけぼの周辺のアキファー部の容積を下げた。\n・掘削結果に応じて、沼ノ端SK-7D, SK-8D/8D-1周辺の浸透率を下げた。\n将来予測のための各坑井の条件としては、フロー時の坑底圧･坑口圧をPIでマッチングさせて、坑口圧の下限･水量(各坑井)<30KL/Dを拘束条件とした。適正生産量の条件は、予測開始時点(2009年1月)でのみ付与した。また、予測においては、H21年度掘削予定の沼ノ端SK-10D(Loc.B4), 中長期計画に含まれている｢あけぼのLoc.B3｣を設定した。ただし、前2者については、シミュレーションモデルの中では、沼ノ端SK-1D(& 6D)とそれぞれ同一セルに設定される。(現段階では、経済限界を30万Sm3/Dとして可採鉱量を打切りとしている。)\n油量については、従来評価と同様の関係(GORとガス回収率、1996年のシミュレーション結果)を外挿して求めた。'),(737,3,'2008-12-31',90,NULL,'2009-02-20 13:19:17','《再評価　新基準PRMS2007への移行》　　経済限界　2015年末\n\n新評価基準(PRMS2007)へ算定方法を変更する。\n減退曲線法で予測される生産量の中で、経済的に採収可能と考えられる油ガス量を\n確認鉱量として計上する。'),(738,4,'2008-12-31',90,NULL,'2009-02-20 13:19:34','《再評価　新基準PRMS2007への移行》　　経済限界　2015年末\n\n新評価基準(PRMS2007)へ算定方法を変更する。\n減退曲線法で予測される生産量の中で、経済的に採収可能と考えられる油ガス量を\n確認鉱量として計上する。'),(739,5,'2008-12-31',90,NULL,'2009-02-20 13:20:21','《再評価　新基準PRMS2007への移行》　　経済限界　2015年末\n\n新評価基準(PRMS2007)へ算定方法を変更する。\n減退曲線法で予測される生産量の中で、経済的に採収可能と考えられる油ガス量を\n確認鉱量として計上する。\n申川SK72と申川SK77を改層、生産量を見込む。'),(740,6,'2008-12-31',90,NULL,'2009-02-20 13:20:34','《再評価　新基準PRMS2007への移行》　　経済限界　2015年末\n\n新評価基準(PRMS2007)へ算定方法を変更する。\n減退曲線法で予測される生産量の中で、経済的に採収可能と考えられる油ガス量を\n確認鉱量として計上する。'),(741,7,'2008-12-31',90,NULL,'2009-02-16 14:20:19','《採収終了》　'),(742,156,'2008-12-31',90,NULL,'2009-02-20 13:20:45','《再評価　新基準PRMS2007への移行》　　経済限界　2015年末\n\n新評価基準(PRMS2007)へ算定方法を変更する。\n減退曲線法で予測される生産量の中で、経済的に採収可能と考えられる油ガス量を\n確認鉱量として計上する。'),(743,10,'2008-12-31',90,NULL,'2009-02-16 14:23:28','《採収終了》'),(744,11,'2008-12-31',90,NULL,'2009-02-20 13:20:56','《再評価　新基準PRMS2007への移行》　　経済限界　2015年末\n\n新評価基準(PRMS2007)へ算定方法を変更する。\n減退曲線法で予測される生産量の中で、経済的に採収可能と考えられる油ガス量を\n確認鉱量として計上する。'),(745,12,'2008-12-31',90,NULL,'2009-02-20 13:21:05','《再評価　新基準PRMS2007への移行》　　経済限界　2015年末\n\n新評価基準(PRMS2007)へ算定方法を変更する。\n減退曲線法で予測される生産量の中で、経済的に採収可能と考えられる油ガス量を\n確認鉱量として計上する。'),(746,13,'2008-12-31',90,NULL,'2009-02-20 13:21:15','《再評価　新基準PRMS2007への移行》　　経済限界　2015年末\n\n新評価基準(PRMS2007)へ算定方法を変更する。\n減退曲線法で予測される生産量の中で、経済的に採収可能と考えられる油ガス量を\n確認鉱量として計上する。'),(747,14,'2008-12-31',90,NULL,'2009-02-20 13:21:25','《再評価　新基準PRMS2007への移行》　　経済限界　2015年末\n\n新評価基準(PRMS2007)へ算定方法を変更する。\n減退曲線法で予測される生産量の中で、経済的に採収可能と考えられる油ガス量を\n確認鉱量として計上する。'),(748,15,'2008-12-31',90,NULL,'2009-02-20 13:21:34','《再評価　新基準PRMS2007への移行》　　経済限界　2015年末\n\n新評価基準(PRMS2007)へ算定方法を変更する。\n減退曲線法で予測される生産量の中で、経済的に採収可能と考えられる油ガス量を\n確認鉱量として計上する。'),(749,16,'2008-12-31',90,NULL,'2009-02-16 14:39:23','《再評価》　採収終了'),(750,18,'2008-12-31',90,NULL,'2009-02-16 14:41:06','《採収終了》'),(751,147,'2008-12-31',90,NULL,'2009-02-16 14:41:27','《採収終了》'),(752,19,'2008-12-31',90,NULL,'2009-02-20 13:22:02','《再評価　新基準PRMS2007への移行》　　経済限界　2015年末\n\n新評価基準(PRMS2007)へ算定方法を変更する。\n減退曲線法で予測される生産量の中で、経済的に採収可能と考えられる油ガス量を\n確認鉱量として計上する。'),(753,20,'2008-12-31',90,NULL,'2009-02-20 13:22:12','《再評価　新基準PRMS2007への移行》　　経済限界　2015年末\n\n新評価基準(PRMS2007)へ算定方法を変更する。\n減退曲線法で予測される生産量の中で、経済的に採収可能と考えられる油ガス量を\n確認鉱量として計上する。'),(754,21,'2008-12-31',90,NULL,'2009-02-20 13:22:30','《再評価　新基準PRMS2007への移行》　　経済限界　2015年末\n\n新評価基準(PRMS2007)へ算定方法を変更する。\n減退曲線法で予測される生産量の中で、経済的に採収可能と考えられる油ガス量を\n確認鉱量として計上する。'),(755,22,'2008-12-31',90,NULL,'2009-02-20 13:22:40','《再評価　新基準PRMS2007への移行》　　経済限界　2015年末\n\n新評価基準(PRMS2007)へ算定方法を変更する。\n減退曲線法で予測される生産量の中で、経済的に採収可能と考えられる油ガス量を\n確認鉱量として計上する。'),(756,2,'2008-12-31',90,NULL,'2009-02-19 13:16:45','具体的開発計画が未定のため資源量へ振替'),(757,2,'2008-12-31',50,NULL,'2009-02-19 13:16:45','具体的開発計画が未定のため資源量へ振替'),(758,43,'2008-12-31',90,NULL,'2009-02-26 19:08:35','《再評価　新基準PRMS2007への移行》　　経済限界　2036年末\n\n新評価基準(PRMS2007)へ算定方法を変更する。\n\n余目SK-48は、解釈の違いによって複数の減退曲線が設定できる。従って、減退傾向が大きいものを確認鉱量用減退曲線（減退率：0.56%/月）として採用した。\n減退曲線法で予測される生産量の中で、経済的に採収可能と考えられる油ガス量を\n確認鉱量として計上する。'),(759,44,'2008-12-31',90,NULL,'2009-02-26 19:11:23','《再評価　新基準PRMS2007への移行》　　経済限界　2036年末\n\n新評価基準(PRMS2007)へ算定方法を変更する。\n減退曲線法で予測される生産量の中で、経済的に採収可能と考えられる油ガス量を\n確認鉱量として計上する。'),(760,46,'2008-12-31',90,NULL,'2009-02-26 19:12:17','《再評価　新基準PRMS2007への移行》　　経済限界　2036年末\n\n新評価基準(PRMS2007)へ算定方法を変更する。\n減退曲線法で予測される生産量の中で、経済的に採収可能と考えられる油ガス量を\n確認鉱量として計上する。'),(761,44,'2008-12-31',50,NULL,'2009-02-26 19:11:23','《再評価　新基準PRMS2007への移行》　　経済限界　2067年末\n\n新評価基準(PRMS2007)へ算定方法を変更する。\n減退曲線法で予測される生産量の中で、経済的に採収可能と考えられる油ガス量を\n推定鉱量として計上する。'),(762,46,'2008-12-31',50,NULL,'2009-02-26 19:12:17','《再評価　新基準PRMS2007への移行》　　経済限界　2067年末\n\n新評価基準(PRMS2007)へ算定方法を変更する。\n減退曲線法で予測される生産量の中で、経済的に採収可能と考えられる油ガス量を\n推定鉱量として計上する。'),(763,43,'2008-12-31',50,NULL,'2009-02-26 19:08:35','《再評価　新基準PRMS2007への移行》　　経済限界　2067年末\n\n新評価基準(PRMS2007)へ算定方法を変更する。\n\n余目SK-48は、解釈の違いによって複数の減退曲線が設定できる。減退傾向が緩やかなものを推定鉱量用減退曲線（減退率：0.05%/月）として採用した。\n減退曲線法で予測される生産量の中で、経済的に採収可能と考えられる油ガス量を\n推定鉱量として計上する。');
